var jscanciones = [
{"id":1,"ti":"500 Grados","tono":"C","estilo":"0","le":"Una lluvia diferente ahora est\u00e1 inundando en el cielo,\n Tormenta de bendici\u00f3n y poder,\n Un calor tan glorioso invade toda la iglesia\n 500 grados de puro fuego santo y poder,\n Para hacer enfermedades desaparecer,\n Para hacer al enemigo huir de ti.\n\n \/\/Una nube de victoria invade toda la iglesia,\n La predicci\u00f3n de Dios dice que va a llover,\n Va a llover lenguas de fuego por todos los lados\n Y de esta bendici\u00f3n quiero salir mojado,\n Mojado y revestido por ese poder,\n Ahora lo imposible va a acontecer.\n\n Es la promesa de Dios,\n El fuego va a caer por ese poder\n Es la promesa de Dios,\n El fuego va a caer por ese poder.\n\n Ya comienza a acontecer,\n Bajo de esta lluvia puedo contemplar,\n Aleluya de aqu\u00ed, gloria, aleluya de all\u00e1,\n Inundando a los hermanos bendici\u00f3n en las manos,\n Veo millares de \u00e1ngeles viniendo en un inmenso trueno.\n\n De este lado hay poder;\n De este lado hay victoria;\n Aqu\u00ed al frente hay hermanos\n Siendo bautizados, dando gloria;\n Aqu\u00ed en el medio fuego cae,\n Toda enfermedad no resiste y sale\n Por el santo nombre de Jes\u00fas.\n\n Una nube diferente ahora est\u00e1 inundando esta iglesia,\n Tormenta de bendici\u00f3n y poder,\n Un calor tan glorioso est\u00e1 quemando el pecado,\n Destruyendo todo lo que te aflige,\n 500 grados de puro fuego santo y poder,\n Y ya hizo enfermedades desaparecer,\n Y ya hizo al enemigo huir de ti\/\/\n\n500 grados de puro fuego santo y poder."},
{"id":2,"ti":"A Cada Instante","tono":"C","estilo":"0","le":"\/\/Se\u00f1or yo quiero construir\n una habitaci\u00f3n y vivir junto a Ti,\n Se\u00f1or en suprema adoraci\u00f3n,\n aqu\u00ed est\u00e1 mi coraz\u00f3n que te quiere adorar\/\/\n\n \/\/A cada instante de mi vida yo te agradecer\u00e9,\n a cada instante de mi vida siempre te exaltar\u00e9,\n a cada instante de mi vida siempre te amar\u00e9 Se\u00f1or\/\/"},
{"id":3,"ti":"A El Alto Y Sublime","tono":"C","estilo":"0","le":"A el alto y sublime que habita la eternidad\n Y su nombre es el santo de Israel.\n Al que habita en las alturas y en la santidad,\n Con el quebrantado y humilde de esp\u00edritu.\n Para hacer vivir el esp\u00edritu humilde\n Y para vivificar el coraz\u00f3n quebrantado.\n\n \/\/Sea la gloria, honor, alabanza y poder,\n Al que reina por los siglos y su nombre Santo es\/\/"},
{"id":4,"ti":"A Qui\u00e9n Ir\u00e9","tono":"C","estilo":"0","le":"A qui\u00e9n ir\u00e9 en necesidad,\n A qui\u00e9n ir\u00e9 en busca de paz\n Y qui\u00e9n podr\u00e1 mi vida saciar de verdad.\n\n Qui\u00e9n m\u00e1s tendr\u00e1 de mi compasi\u00f3n\n Y entender\u00e1 mi coraz\u00f3n,\n Qui\u00e9n cambiar\u00e1 mi eternidad sino T\u00fa, Jes\u00fas.\n\n Cristo a d\u00f3nde m\u00e1s podr\u00eda ir,\n Cristo qu\u00e9 otro lugar puede existir,\n S\u00f3lo T\u00fa tienes palabras de amor,\n Camino al padre y verdad eres T\u00fa"},
{"id":5,"ti":"A Ti Atribuimos","tono":"C","estilo":"0","le":"A Ti atribuimos la gloria,\n A Ti atribuimos la honra,\n A Ti atribuimos poder y majestad,\n Santo es el Se\u00f1or"},
{"id":6,"ti":"A Ti Clam\u00e9 Y Me Sanaste","tono":"C","estilo":"0","le":"A ti clam\u00e9 y me sanaste,\n por eso te glorificar\u00e9,\n Eres Santo recibe adoraci\u00f3n.\n\n Busqu\u00e9 a Jehov\u00e1 y \u00c9l me oy\u00f3,\n Bendito sea el nombre de Dios,\n \u00c9l es digno de mi adoraci\u00f3n.\n\n Jehov\u00e1 es mi fortaleza y escudo,\n \u00c9l es mi Roca y mi castillo,\n \u00c9l es Santo, \u00c9l es digno.\n\n L\u00e1mpara es tu palabra\n Y lumbrera a mi camino, \n \u00c9l es santo, \u00c9l es\u2026\n\n \/\/Santo, digno,\n \u00c9l es santo, \u00c9l es digno,\n \u00c9l es Dios\/\/"},
{"id":7,"ti":"A Ti El Alfa Y La Omega","tono":"C","estilo":"0","le":"A Ti, el alfa y la omega,\n El principio y el fin y el gran Yo Soy,\n Me rindo\u2026\n\n A Ti, el Todopoderoso,\n El que es y el que ser\u00e1 y el gran Yo Soy,\n Me entrego\u2026\n\n Yo quiero que gobiernes mi vida,\n Me doy en sacrificio a Ti,\n Yo quiero que T\u00fa ordenes mi caminar,\n Que siempre viva en tu voluntad."},
{"id":8,"ti":"A Ti Jes\u00fas Cantamos","tono":"C","estilo":"0","le":"\/\/A Ti Jes\u00fas cantamos hoy s\u00f3lo a Ti\/\/\n Levantamos nuestras voces\n Y nuestras manos como ofrenda de amor,\n Recibe hoy nuestra ofrenda de amor."},
{"id":9,"ti":"Abre Mis Ojos Oh Cristo","tono":"C","estilo":"0","le":"Abre mis ojos oh Cristo,\n Abre mis ojos te pido,\n \/\/Yo quiero verte\/\/\n\n \/\/Y contemplar tu majestad\n Y el resplandor de tu gloria,\n Derrama tu amor y poder,\n Cuando cantamos: santo, santo\/\/\n\n \/\/\/Santo, Santo, Santo\/\/\/\n Yo quiero verte."},
{"id":10,"ti":"Aclamad A Dios","tono":"C","estilo":"0","le":"\/\/Aclamad a Dios con alegr\u00eda toda la tierra,\n Cantad la gloria de su nombre\/\/\n\n Poned gloria en su alabanza,\n decidle a Dios: \/\/\/\u00a1Cu\u00e1n asombrosas son tus obras!\/\/\/\n\n \/\/Toda la tierra te adorar\u00e1,\n Toda la tierra canta a tu nombre\/\/"},
{"id":11,"ti":"Acu\u00e9rdate","tono":"C","estilo":"0","le":"Acu\u00e9rdate cuando t\u00fa eras nadie,\n Acu\u00e9rdate que andabas con la muerte,\n Acu\u00e9rdate que pasaron los a\u00f1os,\n \/\/Pero t\u00fa sigues vivo\/\/\n Porque Cristo te ama.\n\n Acu\u00e9rdate que no est\u00e1s derribado,\n Acu\u00e9rdate que no est\u00e1s destruido,\n Acu\u00e9rdate todo lo puedo en Cristo,\n \/\/Comienza de nuevo\/\/\n Porque Cristo te ama.\n\n Acu\u00e9rdate cuando andabas sufriendo,\n Acu\u00e9rdate qui\u00e9n te extendi\u00f3 la mano,\n Acu\u00e9rdate, no te olvides de Cristo\n Porque si no es por \u00c9l\u2026\n Ya estuvi\u00e9ramos muertos"},
{"id":12,"ti":"Agradecimiento","tono":"C","estilo":"0","le":" I\n Al meditar, Dios m\u00edo,\n En las cosas que me has dado,\n Mi coraz\u00f3n se inflama \/ turbado de emoci\u00f3n;\n Pues no encuentro palabras\n Con que expresar, mi Cristo,\n El agradecimiento \/ de mi alma para Ti:\n\n Cambiaste T\u00fa mi vida,\n Me diste esperanza,\n Y desde aquel instante \/ mi alma recibi\u00f3\n Un gozo tan sublime,\n Que al pasar de los a\u00f1os\n Ha sido cual la fuente \/ de mi felicidad.\n\n Coro\n Agradecimiento \/ hay en mi coraz\u00f3n,\n Canto de alegr\u00eda \/ elevo con mi voz;\n Muchas son las cosas \/ que mi Dios me ha dado,\n Y en agradecimiento \/ le sirvo a mi Se\u00f1or.\n\n II\n Las veces que las pruebas\n Has puesto en mi camino,\n En vez de ser derrota, \/ han sido bendici\u00f3n;\n Pues ni por un momento\n T\u00fa me has dejado solo,\n Y as\u00ed tu santa mano \/ ha sido mi sost\u00e9n.\n\n Permite que mi vida\n Yo ponga por servirte,\n Que dentro de mi mente \/ presente siempre est\u00e9n\n Tus m\u00faltiples favores\n Y tus misericordias\n Que aun sin merecerlas \/ tuviste para m\u00ed."},
{"id":13,"ti":"Ahora Mismo, Se\u00f1or","tono":"C","estilo":"0","le":"\/\/Ahora mismo, Se\u00f1or, ahora mismo,\n Yo te pido que rompas las cadenas\/\/\n\n \/\/Que se abran las puertas de los cielos\n Y con tu Esp\u00edritu mi alma sea llena\/\/"},
{"id":14,"ti":"Al Estar Ante Ti","tono":"C","estilo":"0","le":"Al estar ante Ti\n Adorando frente al mar de cristal,\n Entre la multitud\n En asombro all\u00ed me habr\u00e9 de postrar.\n\n Y mi canto unir\u00e9\n A millones proclamandote Rey.\n Y mi voz oir\u00e1s\n Entre las multitudes cantar.\n\n Digno es el cordero de Dios,\n El que fue inmolado en la cruz,\n Digno de la honra y el poder,\n La sabiduria suya es.\n\n Y al que est\u00e1 en el trono sea el honor,\n Santo, santo, santo es el Se\u00f1or\n Reina por los siglos con poder\n Todo lo que existe es por \u00c9l."},
{"id":15,"ti":"Al Estar Aqu\u00ed Reunidos","tono":"C","estilo":"0","le":"Al estar aqu\u00ed reunidos\n hoy venimos a entregarte nuestra alabanza,\n con todo el coraz\u00f3n.\n\n Al estar aqu\u00ed reunidos\n hoy venimos a postrarnos en tu presencia\n para darte loor\n\n Esp\u00edritu Santo, manda tu fuego,\n llena mi vida, con tu poder,\n Esp\u00edritu Santo, llena mi vida, con tu poder."},
{"id":16,"ti":"Al Estar En La Presencia","tono":"C","estilo":"0","le":"Al estar en la presencia de tu divinidad,\n Y al contemplar la hermosura de tu santidad,\n Mi esp\u00edritu se alegra en tu majestad,\n \/\/Te adoro a Ti\/\/\n\n Cuando veo la grandeza de tu dulce amor,\n Y compruebo la pureza de tu coraz\u00f3n,\n Mi esp\u00edritu se alegra en tu majestad,\n \/\/Te adoro a Ti\/\/\n\n Y al estar aqu\u00ed, delante de Ti te adorar\u00e9,\n Postrado ante Ti mi coraz\u00f3n te adora oh Dios\n Y siempre quiero estar para adorar\n Y contemplar tu santidad,\n Te adoro a Ti Se\u00f1or, te adoro a Ti.\n"},
{"id":17,"ti":"Al Que Debo","tono":"C","estilo":"0","le":"Lo divino en lo humano cobr\u00f3 vida\n Y el reino de los cielos se acerc\u00f3,\n El misterio de los siglos revelado,\n El Mes\u00edas por mis culpas se entreg\u00f3.\n\n Coro:\n Al que debo yo servir vino a servirme,\n Al que debo yo buscar, me busc\u00f3 a m\u00ed,\n Al que debo yo amar, me am\u00f3 primero,\n Por mis culpas, por entero se entreg\u00f3.\n\n II\n Su martirio comenz\u00f3 en el pesebre,\n Donde el mundo ego\u00edsta le mand\u00f3,\n Pues no hubo un lugar de tal realeza,\n Donde pudo su cabeza recostar."},
{"id":18,"ti":"Alaba A Dios","tono":"C","estilo":"0","le":"Dios no rechaza oraci\u00f3n,\n Oraci\u00f3n es alimento.\n Nunca habido un justo sin respuesta\n quedar en sufrimiento.\n\n Basta solamente esperar\n Lo que Dios ir\u00e1 a hacer,\n Cuando \u00c9l levanta sus manos\n Es hora de vencer\u2026\n\n Oh alaba, simplemente alaba,\n Si est\u00e1s llorando alaba,\n En la prueba alaba,\n Si est\u00e1s sufriendo alaba,\n No importa alaba,\n Tu alabanza \u00c9l escuchar\u00e1\u2026\n\n Dios va al frente abriendo caminos,\n Quebrando cadenas, sacando espinas,\n Manda sus \u00c1ngeles contigo a luchar,\n \u00c9l abre puertas nadie puede cerrar.\n\n \u00c9l trabaja para los que conf\u00edan,\n Camina contigo de noche y de d\u00eda,\n Levanta tus manos tu victoria lleg\u00f3,\n Comienza a cantar y alaba a Dios\n\n \/\/\/alaba a Dios\/\/\/\n\n La gente necesita entender\n Lo que Dios est\u00e1 hablando,\n Cuando \u00c9l queda en silencio\n Es porque est\u00e1 trabajando\n\n Basta solamente esperar\n Lo que Dios ir\u00e1 a hacer,\n Cuando \u00c9l extiende sus manos\n Es hora de vencer\u2026"},
{"id":19,"ti":"Alabad A Jehov\u00e1","tono":"C","estilo":"0","le":"Alabad a Jehov\u00e1, naciones todas,\n Pueblos todos alabadle,\n Porque ha engrandecido\n Sobre nosotros su misericordia\n\n \/\/Y la verdad de Jehov\u00e1\n Es para siempre, \u00a1Aleluya!, Am\u00e9n\/\/"},
{"id":20,"ti":"Alabamos A Jehov\u00e1","tono":"C","estilo":"0","le":"\/\/Alabamos a Jehov\u00e1 porque \u00c9l es bueno\n Ypara siempre es su misericordia\/\/\n\n \/\/\/Porque \u00c9l es bueno\/\/\/ con nosotros\n Y para siempre es su misericordia"},
{"id":21,"ti":"Alabar\u00e9","tono":"C","estilo":"0","le":"\/\/Alabar\u00e9, alabar\u00e9, alabar\u00e9 a mi Se\u00f1or\/\/\n\n Juan vio el n\u00famero de los redimidos\n Y todos alababan al Se\u00f1or.\n Unos cantaban, otros oraban\n Y todos alababan al Se\u00f1or."},
{"id":22,"ti":"Aleluya, Aleluya","tono":"C","estilo":"0","le":"\/\/Aleluya, aleluya...\n Reinas T\u00fa poderoso Dios\/\/\n\n Aleluya, \/\/Santo\/\/\n El Se\u00f1or Dios poderoso\n \/\/Digno eres T\u00fa\/\/\n T\u00fa eres \/\/Santo\/\/\n El Se\u00f1or Dios poderoso\n \/\/Digno eres T\u00fa, Santo eres T\u00fa\/\/\n Am\u00e9n"},
{"id":23,"ti":"Aleluya","tono":"C","estilo":"0","le":"Aleluya, \/\/Gloria, Aleluya\/\/\n Gloria a mi Se\u00f1or.\n\n Te adoramos, \/\/Cristo te adoramos\/\/\n Cristo mi Se\u00f1or.\n\n T\u00fa eres Santo, \/\/s\u00f3lo T\u00fa eres Santo\/\/\n Santo mi Se\u00f1or"},
{"id":24,"ti":"Algo Est\u00e1 Cayendo Aqu\u00ed","tono":"C","estilo":"0","le":"Algo est\u00e1 cayendo aqu\u00ed,\n Es tan fuerte sobre m\u00ed,\n Mis manos levantar\u00e9\n Y su gloria tocar\u00e9.\n\n Est\u00e1 cayendo su gloria sobre m\u00ed,\n Sanando heridas, levantando al ca\u00eddo,\n Su gloria est\u00e1 aqu\u00ed."},
{"id":25,"ti":"Algo Est\u00e1 Descendiendo","tono":"C","estilo":"0","le":"\/\/\/Algo est\u00e1 descendiendo\/\/\/\n De all\u00e1 arriba de los cielos\n\n \/\/Es poder del Esp\u00edritu Santo\/\/\n \/\/Oh gloria, Aleluya,\n Aleluya, Gloria a Dios\/\/"},
{"id":26,"ti":"Alguien Est\u00e1 Aqu\u00ed","tono":"C","estilo":"0","le":"Alguien est\u00e1 aqu\u00ed yo s\u00e9 que es Cristo,\n alguien est\u00e1 aqu\u00ed yo s\u00e9 que es el Se\u00f1or.\n\n \/\/\u00c9l est\u00e1 aqu\u00ed t\u00fa no lo ves\/\/\n Ora por m\u00ed, ora por ti,\n Ora por todos al Se\u00f1or."},
{"id":27,"ti":"Alguien Necesita Aqu\u00ed","tono":"C","estilo":"0","le":"Alguien necesita aqu\u00ed de Ti, Jes\u00fas,\n Alguien quiere entregarse a Ti, Jes\u00fas,\n Alguien quiere tener un amigo con quien hablar,\n Alguien necesita aqu\u00ed de Ti, Jes\u00fas,\n\n \/\/Oh yo sigo am\u00e1ndole, sigo am\u00e1ndole,\n Sigo am\u00e1ndole a \u00c9l\/\/\n\n Porque dulce, dulce cada d\u00eda es,\n Oh que amor entre mi Dios y yo,\n Oh yo \/\/\/sigo am\u00e1ndole\/\/\/ a \u00c9l.\n\n Y si vivimos para \u00c9l vivimos,\n si morimos para \u00c9l morimos,\n Sea que vivamos o que muramos,\n \/\/Somos del Se\u00f1or\/\/"},
{"id":28,"ti":"Alza Tus Ojos Y Mira","tono":"C","estilo":"0","le":"Alza tus ojos y mira la cosecha est\u00e1 lista,\n El tiempo ha llegado, la mies est\u00e1 madura.\n Esfu\u00e9rzate y se valiente, lev\u00e1ntate y predica\n A todas las naciones que Cristo es la vida.\n\n \/\/Y ser\u00e1 llena la tierra de su gloria,\n Se cubrir\u00e1 como las aguas cubren la mar\/\/\n \/\/No\/\/ hay otro nombre dado a los hombres,\n Jesucristo es el Se\u00f1or."},
{"id":29,"ti":"Ama Si Quieres Ser Feliz","tono":"C","estilo":"0","le":"Ama si quieres ser feliz,\n Ama y todo cambiar\u00e1,\n Ama y as\u00ed comprender\u00e1s,\n la alegr\u00eda de vivir.\n\n \/\/\/Yo te amo hermano\/\/\/\n \u00c1mame t\u00fa tambi\u00e9n.\n\n \/\/Yo te amo con el amor Del Se\u00f1or\/\/\n Porque veo en ti la gloria del Se\u00f1or,\n Yo te amo con el amor del Se\u00f1or."},
{"id":30,"ti":"Amante De Ti","tono":"C","estilo":"0","le":"Bendito Salvador, has conquistado mi coraz\u00f3n,\n has enamorado todo lo que soy;\n Bendito Redentor, amado Rey y Dios\n Mu\u00e9strame tu rostro te quiero conocer.\n\n Amante de Ti, Se\u00f1or, amante de tu amor;\n Yo quiero ser amante de tu amor.\n Amante de Ti, Se\u00f1or, amante de tu amor;\n Yo quiero ser amante de Ti, Se\u00f1or."},
{"id":31,"ti":"Amigo Ideal (Devia)","tono":"C","estilo":"0","le":"Andando en el mundo buscaba\n Un amigo que fuera ideal,\n Que estuviera conmigo en las buenas,\n En las malas compartir un pan.\n\n Pero todo parec\u00eda in\u00fatil\n Ese amigo jam\u00e1s lo encontr\u00e9\n \/\/y segu\u00eda\/\/ buscando\n Desde el d\u00eda hasta el atardecer.\n\n \/\/D\u00f3nde est\u00e1\/\/ ese amigo que quiero encontrar,\n Que me ayude a calmar estas penas\n Y que encuentre un poquito de paz.\n\n \/\/Y segu\u00eda\/\/ buscando\n Por las calles de la gran ciudad\n Y un buen d\u00eda escuch\u00e9 que cantaban\n Alabanzas de amor y de paz.\n\n Yo busqu\u00e9 presuroso la iglesia\n Y llegando pude contemplar\n Al pastor que extasiado dec\u00eda:\n \u00abJesucristo es tu amigo ideal\u00bb\n\n \/\/D\u00f3nde est\u00e1\/\/ ese amigo que quiero encontrar,\n Que me ayude a calmar estas penas\n Y que encuentre un poquito de paz.\n\n Con mis ojos cubiertos en llanto\n Camin\u00e9 y me postr\u00e9 en el altar\n Y al pastor pregunt\u00e9 con el alma\n D\u00f3nde est\u00e1 ese amigo especial.\n\n El impuso sobre m\u00ed sus manos\n Y me dijo con seguridad\n Desde ahora tienes un amigo\n En el cual siempre confiar\n\n \/\/Encontr\u00e9\/\/ ese amigo que tanto anhele\n Y feliz seguir\u00e9 pregonando\n Que Jes\u00fas es mi amigo ideal."},
{"id":32,"ti":"Amo A Mi Dios","tono":"C","estilo":"0","le":"\/\/Amo a mi Dios\/\/ porque \u00c9l me ama,\n \/\/Amo a mi Dios\/\/ porque \u00c9l me am\u00f3 primero\n\n Le am\u00e9 ayer, le amo hoy y a\u00fan ma\u00f1ana\n \/\/Y yo le amar\u00e9, con todo el coraz\u00f3n\/\/"},
{"id":33,"ti":"Amor Inmensurable","tono":"C","estilo":"0","le":"I\n Amor inmensurable, amor puro y bendito;\n El amor de Cristo \u00a1qu\u00e9 incomparable amor!\n Que aunque el mar se secare y se esfumen los montes\n Y all\u00e1 en el horizonte no brille m\u00e1s el sol.\n\n Que aunque en el infinito los astros no titilen\n Y aun cuando se terminen las tardes de arrebol\n Y aun cuando sus criaturas no le honren ni le admiren;\n Tan grande y tan sublime, su amor siempre es su amor.\n\n CORO\n \u00bfQui\u00e9n me separar\u00e1 de este amor tan grande?\n Ni temores ni hambres me podr\u00e1n separar,\n Porque el amor de Dios, aun cuando todo cambie,\n Aunque el mundo se acabe, su amor es eternal\n\n II\n A ese amor tan glorioso, a ese amor tan sublime,\n Que quiso redimirme siendo yo un pecador,\n Hoy con toda mi alma a \u00c9l quiero dirigirme,\n Y en mi canci\u00f3n decirle tu amor es mucho amor.\n\n Porque puedo sentirle muy dentro de mi alma,\n Y me ha dado esa calma que el mundo no me dio.\n Ese amor tan bendito que al hombre solitario,\n Le brinda luz y amparo es el amor de Dios."},
{"id":34,"ti":"Anhelo Tu Presencia","tono":"C","estilo":"0","le":"Quiero entrar a ese lugar\n Donde tu rostro puedo contemplar\n Quiero entrar al santo lugar\n Donde tu voz puedo escuchar.\n\n Anhelo tu presencia, necesito de tu fuego\n No hay nada m\u00e1s hermoso que poderte adorar\n Derrama de tu gloria eres todo lo que quiero\n Llena con tu poder este lugar\n Anhelo tu presencia."},
{"id":35,"ti":"Aprend\u00ed A Vivir","tono":"C","estilo":"0","le":"Aprend\u00ed a vivir, a so\u00f1ar, a re\u00edr,\n Aprend\u00ed a aceptar de la vida del sufrir,\n Conoc\u00ed tu amor que penetr\u00f3 en mi coraz\u00f3n,\n Aprend\u00ed a sentir tu presencia dentro de m\u00ed.\n\n Es que no s\u00e9 vivir sin Ti, yo no s\u00e9 vivir sin Ti,\n Si tu amor faltara morir\u00eda mi coraz\u00f3n,\n Es que no s\u00e9 vivir sin Ti, yo no s\u00e9 vivir sin Ti,\n Porque de mi vida T\u00fa eres la raz\u00f3n,\n Se\u00f1or Jes\u00fas"},
{"id":36,"ti":"Aquel Fuego Que Cay\u00f3","tono":"C","estilo":"0","le":"\/\/Aquel fuego que cay\u00f3 a ciento veinte una vez\n Me hizo pentecostal de la cabeza a los pies\/\/\n\n \/\/\/\/Fuego pentecostal\/\/\/\/\n \/\/Nadie lo podr\u00e1 apagar, ya est\u00e1 encendido\/\/\n\n \/\/Ya est\u00e1 encendido, encendido\/\/\n Ya est\u00e1 encendido y nadie lo podr\u00e1 apagar."},
{"id":37,"ti":"Aqu\u00ed En Esta Iglesia","tono":"C","estilo":"0","le":"\/\/Aqu\u00ed en esta iglesia de fe y de poder,\n Se va a derramar su bendici\u00f3n\/\/\n\n \/\/El Esp\u00edritu Santo aqu\u00ed se va a derramar,\n Hablaremos en nuevas lenguas,\n Los enfermos sanar\u00e1n\/\/\n\n \/\/Como la primera vez, Am\u00e9n, Am\u00e9n\/\/\n\n \/\/En un aposento alto mucha gente se goz\u00f3,\n Porque all\u00ed hab\u00eda llegado la presencia del Se\u00f1or\/\/\n\n \/\/Ya lleg\u00f3, ya est\u00e1 aqu\u00ed, el Esp\u00edritu de Dios\/\/\n \/\/Si quieres estar alegre ven y canta como yo\n Y veraz como se siente la presencia del Se\u00f1or\/\/\n\n \/\/Como la primera vez, Am\u00e9n, Am\u00e9n\/\/"},
{"id":38,"ti":"Aqu\u00ed Est\u00e1 El Poderoso","tono":"C","estilo":"0","le":"Aqu\u00ed est\u00e1 el Poderoso,\n Aqu\u00ed est\u00e1n los redimidos,\n Aqu\u00ed est\u00e1n todos los hijos de Jesucristo.\n\n Jes\u00fas es Dios yle exaltamos,\n Jes\u00fas es Rey a \u00c9l sea la gloria,\n Aqu\u00ed est\u00e1n todos los hijos de Jesucristo.\n\n \/\/Adoremos al rey\/\/\n Poder y gloria, unci\u00f3n y victoria,\n Salen de su trono.\n\n \/\/Adoremos al Rey\/\/\n Levanten las manos los hijos de Dios,\n Ll\u00e9nense de poder."},
{"id":39,"ti":"Aqu\u00ed Est\u00e1s","tono":"C","estilo":"0","le":"Aqu\u00ed est\u00e1s, te vemos mover\n \/\/Te adorar\u00e9\/\/\n Aqu\u00ed est\u00e1s obrando en m\u00ed\n \/\/Te adorar\u00e9\/\/\n\n Milagroso,\n Abres camino,\n Cumples promesas,\n Luz en tinieblas,\n Mi Dios, as\u00ed eres T\u00fa.\n\n Aqu\u00ed est\u00e1s tocando mi coraz\u00f3n\n \/\/Te adorar\u00e9\/\/\n Aqu\u00ed est\u00e1s sanando mi coraz\u00f3n\n \/\/Te adorar\u00e9\/\/\n\n \/\/Aunque no pueda ver est\u00e1s obrando\/\/\n \/\/Siempre est\u00e1s, siempre est\u00e1s obrando\/\/"},
{"id":40,"ti":"Aqu\u00ed Estoy","tono":"C","estilo":"0","le":"Aqu\u00ed estoy te ofrezco todo lo que soy,\n Aqu\u00ed estoy, un sacrificio quiero ser,\n Toma mi ser mi vida entrego a Ti\n\n \/\/Porque T\u00fa eres mi Dios,\n Eres digno de adoraci\u00f3n,\n Una ofrenda de amor ser\u00e9 para Ti\/\/"},
{"id":41,"ti":"Aqu\u00ed Estoy (Verbo Y Vida)","tono":"C","estilo":"0","le":"I\n Al que vive por los siglos, al eterno Dios real,\n yo me humillo y me entrego ante tu altar,\n necesito de tu mano Jesucristo poderoso,\n mi alabanza y mi canci\u00f3n es para Ti.\n\n CORO\n Aqu\u00ed estoy ante tu presencia oh Dios,\n purif\u00edcame Se\u00f1or, yo soy de Ti;\n lev\u00e1ntame porque entre la ceniza estoy,\n s\u00f3lo el fuego de tu amor me encender\u00e1.\n\n II\n T\u00fa me tomas en tus brazos, tu calor me da la paz,\n Jesucristo Dios del cielo tu presencia es ideal;\n \u00c1ngeles y Serafines, Arc\u00e1ngeles y Querubines\n se humillan ante el trono celestial.\n Hoy tu pueblo te alaba en esp\u00edritu y verdad,\n diciendo: Santo, Santo, Santo\n porque \u00c9l es digno, digno, digno,\n \u00c9l es la fuente inagotable \/\/de nuestro ser\/\/"},
{"id":42,"ti":"Aqu\u00ed Se Canta","tono":"C","estilo":"0","le":"Aqu\u00ed se canta, aqu\u00ed se adora,\n Aqu\u00ed le damos la gloria al Se\u00f1or,\n Aqu\u00ed sentimos su gloria santa,\n Aqu\u00ed sentimos la presencia del Se\u00f1or.\n\n Donde est\u00e1 el Esp\u00edritu de Dios\n All\u00ed siempre hay libertad,\n Donde est\u00e1 el Esp\u00edritu de Dios,\n Podemos testificar.\n\n Aqu\u00ed se canta, aqu\u00ed se adora,\n Aqu\u00ed le damos la gloria al Se\u00f1or,\n Aqu\u00ed sentimos su gloria santa,\n Aqu\u00ed sentimos la presencia del Se\u00f1or.\n\n Los cojos andan, los mudos hablan,\n Porque en el nombre de Jes\u00fas s\u00f3lo hay poder,\n En ese nombre fui bautizado\n Y he recibido el Esp\u00edritu de Dios."},
{"id":43,"ti":"Aqu\u00ed Se Siente La Presencia De Dios","tono":"C","estilo":"0","le":"\/\/Aqu\u00ed se siente la presencia de Dios\/\/\n \/\/Derrama el fuego del esp\u00edritu santo\/\/\n\n Yo siento gozo, yo siento paz,\n Yo siento el amor que Dios me da."},
{"id":44,"ti":"Ardiendo En Fuego","tono":"C","estilo":"0","le":"\/\/Ardiendo en fuego mi alma est\u00e1\/\/\n Gloriosa llama me limpiar\u00e1,\n \u00a1Oh Aleluya!, mi alma ardiendo est\u00e1.\n\n Oh Se\u00f1or quiero que ardas en mi ser,\n Como la zarza quiero arder con tu poder,\n En nuevas lenguas quiero hablar como se\u00f1al,\n Estoy ardiendo en el fuego celestial.\n\n Quiero alabarte y adorarte s\u00f3lo a Ti,\n Como se adora en esp\u00edritu y verdad\n \/\/Oh Se\u00f1or quiero que ardas en mi ser,\n Como la zarza quiero arder con tu poder\/\/"},
{"id":45,"ti":"Ardiendo En Mi Interior","tono":"C","estilo":"0","le":"I\n Poder siento, lo siento\n En este \/\/momento\/\/\n Estamos \/\/unidos\/\/\n Deseando un despertar\n\n CORO\n Ooh, Se escucha desde el cielo\n Ooh, Un fuerte viento recio\n Ooh, Ven con tu avivamiento\n Quiero tu fuego tener\n\n \/\/Ardiendo en mi interior\/\/\n\n II\n Y tus hijos, tus hijas\n So\u00f1ando los sue\u00f1os del Padre\n Viendo milagros, se\u00f1ales\n El Reino de Dios\n\n III\n Nada detendr\u00e1 este fuego en m\u00ed.\n Nada apagar\u00e1 esta luz que hay en m\u00ed.\n Nada estorbar\u00e1 tu Presencia en m\u00ed. \n Ardiendo en mi interior.\n\n Ooh, Se escucha desde el cielo..."},
{"id":46,"ti":"As\u00ed Como David Danzaba","tono":"C","estilo":"0","le":"\/\/Cuando el se\u00f1orhiciere volver la cautividad,\n Seremos como los que sue\u00f1an\/\/\n\n \/\/Mi boca llenar\u00e1 de risa,\n Mis labios de alabanza;\n Entonces dir\u00e1n las naciones:\n \u00a1Grandes cosas ha hecho el Se\u00f1or!\/\/\n\n \/\/\/\/Me gozar\u00e9\/\/\/\/ En Jehov\u00e1 (g\u00f3zate)\n Pues ha llevado todo mi dolor\n Me ha hecho libre\u2026\n\n \/\/As\u00ed como David cantaba,\n As\u00ed como David danzaba,\n As\u00ed como David flu\u00eda en su presencia\/\/\n\n Yo cantar\u00e9, yo danzar\u00e9\n Y en tu presencia me gozar\u00e9\n Y s\u00f3lo a Ti adorar\u00e9,\n Porque T\u00fa eres mi Dios y mi Rey\n \/\/Santo, santo, santo es el Se\u00f1or\/\/"},
{"id":47,"ti":"Aunque Otros Canten","tono":"C","estilo":"0","le":"Aunque otros canten para otros dioses,\n Hechos de metal, de madera o de bronce,\n Yo alabar\u00e9 el nombre de Jes\u00fas,\n El nombre de Jes\u00fas alabar\u00e9.\n\n Porque soy un sacerdote,\n Llamado a ministrar en su presencia\n Y ahora alabar\u00e9\n El Santo nombre Bendito de Jehov\u00e1."},
{"id":48,"ti":"Aunque Tenga Que Cruzar","tono":"C","estilo":"0","le":"Aunque tenga que cruzar montes y valles\n Predicando tu palabra oh se\u00f1or,\n Aunque guerra me declare el enemigo,\n Si T\u00fa vas conmigo, nada temer\u00e9.\n\n No temer\u00e9 se\u00f1or si vas conmigo,\n No temer\u00e9 se\u00f1or si voy contigo,\n No temer\u00e9 se\u00f1or al enemigo,\n Porque el \u00e1ngel de Jehov\u00e1 anda conmigo."},
{"id":49,"ti":"Aunque Un Ej\u00e9rcito","tono":"C","estilo":"0","le":"I\n Aunque un ej\u00e9rcito acampe contra m\u00ed,\n No temer\u00e9,\n Aunque haya guerra hoy alrededor de m\u00ed,\n En Ti confiar\u00e9.\n\n No temer\u00e9 a diez mil gentes\n Que hagan sitio contra m\u00ed,\n Aunque la tierra se estremezca\n Mi salvaci\u00f3n est\u00e1 en Ti.\n\n CORO\n \/\/Porque T\u00fa eres mi escudo,\n T\u00fa mi fortaleza,\n T\u00fa eres mi gloria,\n y quien levanta mi cabeza\/\/\n\n II\n Aunque afligido est\u00e9, T\u00fa pensar\u00e1s en m\u00ed,\n No temer\u00e9,\n Aunque mi coraz\u00f3n estremecido est\u00e9,\n En Ti confiar\u00e9.\n\n No temer\u00e9 a ning\u00fan hombre\n Que se junte contra m\u00ed,\n T\u00fa eres mi Dios, mi fortaleza,\n Mi salvaci\u00f3n est\u00e1 en Ti.\n\n III\n \/\/Lev\u00e1ntate y s\u00e1lvame\/\/"},
{"id":50,"ti":"Aunque Un Ej\u00e9rcito Acampe Contra M\u00ed","tono":"C","estilo":"0","le":"\/\/Aunque un ej\u00e9rcito acampe contra m\u00ed,\n No temer\u00e1 mi coraz\u00f3n\/\/\n\n \/\/Aunque contra m\u00ed se levanten guerras,\n Yo estar\u00e9 confiado en mi Salvador\/\/\n\n \/\/\u00c9l salva y libra y hace se\u00f1ales\n Y maravillas en el cielo y en la tierra.\n \u00c9l ha librado a Daniel de los leones,\n Tambi\u00e9n ha librado mi alma del seol\/\/"},
{"id":51,"ti":"Av\u00edvame","tono":"C","estilo":"0","le":"Haz tu voluntad en este lugar,\n Derrama de tu esp\u00edritu en mi ser;\n Nos humillamos, nos postramos,\n Queremos ver tu gloria Dios.\n\n Av\u00edvame con tu poder Se\u00f1or,\n Pon fuego en mi coraz\u00f3n;\n Que todo mi ser arda en tu calor,\n \/\/Av\u00edvame\/\/\n\n \/\/\/\/Clamaremos hasta ver tu gloria\/\/\/\/"},
{"id":52,"ti":"Basta Que Me Toques","tono":"C","estilo":"0","le":"Basta que me toques Se\u00f1or,\n Mi alma en prueba fortalece.\n Si la noche oscura est\u00e1,\n Tu presencia me guiar\u00e1,\n B\u00e1stame tu mano Se\u00f1or."},
{"id":53,"ti":"Baut\u00edzame","tono":"C","estilo":"0","le":"I\n Se\u00f1or haz de mi vida,\n Un instrumento afinado,\n Quiero servirte Se\u00f1or,\n Con poder, con entusiasmo;\n\n Pero me falta Se\u00f1or\n Que me arropes con tu manto,\n Derrama en m\u00ed tu poder\n Y dame tu Esp\u00edritu Santo.\n\n CORO\n \/\/\/Baut\u00edzame\/\/\/ con tu Esp\u00edritu Santo,\n Quiero sentir tu presencia\n Que descienda de lo alto.\n \/\/\/Baut\u00edzame\/\/\/ con tu Esp\u00edritu Santo\n Llena mi copa Se\u00f1or\n Hasta que est\u00e9 rebosando.\n\n II\n Yo he prometido Se\u00f1or\n Servirte todos los a\u00f1os,\n Quiero anunciarles a las gentes,\n De c\u00f3mo me has transformado,\n\n A la iglesia decir que T\u00fa vuelves,\n Los enfermos en tu nombre sanar,\n Dame tu gloria Se\u00f1or\n Y dame tu Esp\u00edritu Santo."},
{"id":54,"ti":"Bendecir\u00e9 A Jehov\u00e1","tono":"C","estilo":"0","le":"\/\/Bendecir\u00e9 a Jehov\u00e1 por siempre\n Su diestra es todo poder\/\/\n\n \/\/Ech\u00f3 a la mar quien los persegu\u00edan,\n Jinete y caballo, ech\u00f3 a la mar\/\/\n\n Ech\u00f3 a la mar, los carros del fara\u00f3n,\n Oh, oh, oh, oh, oh, oh, oh, oh Jes\u00fas\n\n \/\/Gloria, gloria al Se\u00f1or\/\/\n Gloria, gloria, gloria al Se\u00f1or\n\n \/\/Mi padre es Dios y yo le exalto,\n Mi padre es Dios y le exaltar\u00e9\/\/"},
{"id":55,"ti":"Bendito Sea El Se\u00f1or","tono":"C","estilo":"0","le":"Padre del cielo te adoramos,\n Alzamos hoy tu Nombre en alto,\n Que tu reino se establezca en alabanza,\n Que tu pueblo te proclame tu poder\n\n \/\/Bendito sea el Se\u00f1or, Dios poderoso\n Quien fue, quien es y quien vendr\u00e1\/\/\n Por siempre reinar\u00e1."},
{"id":56,"ti":"Bueno Es Alabarte Jehov\u00e1","tono":"C","estilo":"0","le":"\/\/Bueno es alabarte oh Jehov\u00e1;\n Y cantar salmos a tu nombre\/\/\n \/\/anunciar por la ma\u00f1ana tu misericordia\n Y tu fidelidad de noche\/\/\n\n \u00bfQui\u00e9n es el que vive?,\n Cristo es el que vive\n\n \u00bfQui\u00e9n es el que sana?,\n Cristo es el que sana\n\n \u00bfQui\u00e9n es el que salva?,\n Cristo es el salva\n\n \u00bfQui\u00e9n es el que viene?,\n Cristo es el que viene.\n\n \/\/\/Y si Cristo viene a su nombre gloria\/\/\/\n Anunciar por la ma\u00f1ana su misericordia\n Y tu fidelidad de noche."},
{"id":57,"ti":"Bueno Es Alabarte Se\u00f1or","tono":"C","estilo":"0","le":"Bueno es alabarte Se\u00f1or,\n A tu nombre darle gloria, honra y honor,\n Por siempre bueno es alabarte Se\u00f1or,\n Y Gozarme en tu poder.\n\n Porque grande eres T\u00fa,\n Grandes son tus obras,\n Porque grande eres T\u00fa,\n grande es tu amor,\n Grande es tu gloria."},
{"id":58,"ti":"Busca La Bendici\u00f3n De Dios","tono":"C","estilo":"0","le":"\/\/\/Busca la bendici\u00f3n de Dios\/\/\/\n \u00c9l te la dar\u00e1.\n\n B\u00fascala en la ma\u00f1ana,\n b\u00fascala al mediod\u00eda,\n B\u00fascala por la noche,\n b\u00fascala al otro d\u00eda."},
{"id":59,"ti":"Cada D\u00eda Me Siento M\u00e1s Alegre","tono":"C","estilo":"0","le":"\/\/Cada d\u00eda me siento m\u00e1s alegre,\n Aunque tenga que cruzar montes y valles\/\/\n\n \/\/Pero yo s\u00e9 que mi Se\u00f1or ha prometido,\n Estar conmigo y no dejarme desmayar\/\/\n\n \/\/Yo no estoy solo no; oigo al Se\u00f1or decir:\n \u201cSi fueres fiel estar\u00e9 contigo hasta el Fin\u201d\/\/"},
{"id":60,"ti":"Cansado Del Camino","tono":"C","estilo":"0","le":"Cansado del camino sediento de Ti,\n Un desierto he cruzado\n Sin fuerzas he quedado, vengo a Ti,\n\n Luch\u00e9 como un soldado y a veces sufr\u00ed\n Y aunque la lucha he ganado,\n Mi armadura he desgastado, vengo a Ti\n\n \/\/Sum\u00e9rgeme, en el r\u00edo de tu Esp\u00edritu,\n Necesito refrescar este seco coraz\u00f3n\n Sediento de ti\/\/"},
{"id":61,"ti":"Cantad A Jehov\u00e1","tono":"C","estilo":"0","le":"\/\/\/Cantad a Jehov\u00e1, un c\u00e1ntico nuevo\/\/\/\n \/\/\/\/Cantad a Jehov\u00e1\/\/\/\/\n\n Y que hizo Dios, hizo maravillas,\n Y que hace Dios, hace maravillas,\n Y que har\u00e1 Dios, har\u00e1 maravillas\n \/\/Cantad a Jehov\u00e1\/\/\n\n \/\/\/El mar les abri\u00f3, pasaron en seco\/\/\/\n \/\/\/\/Cantad a Jehov\u00e1\/\/\/\/\n\n \/\/Man\u00e1 \u00c9l les dio, enviado del cielo\/\/\/\n \/\/Cantad a Jehov\u00e1\/\/\n\n \/\/\/La pe\u00f1a toc\u00f3, las aguas salieron\/\/\/\n \/\/cantad a Jehov\u00e1\/\/"},
{"id":62,"ti":"Cantad Con Gozo","tono":"C","estilo":"0","le":"Cantad con gozo a nuestro Dios,\n Fortaleza nuestra es.\n Al Dios de Jacob aclamad con j\u00fabilo.\n\n Entonad canci\u00f3n, tocad el pandero,\n El arpa deliciosa y el salterio.\n"},
{"id":63,"ti":"Cantar\u00e9 De Tu Amor","tono":"C","estilo":"0","le":"Por mucho tiempo busqu\u00e9 una raz\u00f3n de vivir,\n En medio de mil preguntas tu amor me respondi\u00f3,\n Ahora veo la luz y ya no tengo temor,\n Tu reino vino a mi vida y ahora vivo para Ti.\n\n Cantar\u00e9 de tu amor,\n rendir\u00e9 mi coraz\u00f3n ante Ti,\n T\u00fa ser\u00e1s mi pasi\u00f3n\n Y mis pasos se guiar\u00e1n por tu voz,\n Mi Jes\u00fas y mi rey de tu gran amor cantar\u00e9."},
{"id":64,"ti":"C\u00e1ntico Nuevo Cantar\u00e9 A Jehov\u00e1","tono":"C","estilo":"0","le":"\/\/C\u00e1ntico nuevo cantar\u00e9 a Jehov\u00e1,\n C\u00e1ntico nuevo cantar\u00e9 a su Majestad\/\/\n\n \/\/Dile que \u00c9l es grande porque \u00c9l es grande,\n Dile que \u00c9l es fuerte porque as\u00ed lo es \/\/\n\n \/\/\/Grande\/\/\/ es Jehov\u00e1\n \/\/\/Fuerte\/\/\/ es Jehov\u00e1 "},
{"id":65,"ti":"Celebrad A Cristo Celebrad","tono":"C","estilo":"0","le":"\/\/\/\/Celebrad a Cristo celebrad\/\/\/\/\n \/\/\u00c9l vive\/\/ y por siempre reinara.\n \/\/Cristo vive\/\/\n \/\/Vamos a celebrar\/\/\n Que nuestro se\u00f1or resucit\u00f3."},
{"id":66,"ti":"Celebremos Y Adoremos","tono":"C","estilo":"0","le":"Celebremos y adoremos\n La majestad, el imperio y el poder;\n Con alabanza y regocijo\n Cantar\u00e9 a Jes\u00fas mi Rey.\n\n Porque \u00c9l ha hecho grandes obras,\n Y su grandeza es poderosa,\n Venci\u00f3 las fuerzas que me ataban\n Y por su gracia yo soy libre."},
{"id":67,"ti":"Cerca De Ti","tono":"C","estilo":"0","le":"Si decidiera negar mi fe;\n Y no confiar nunca m\u00e1s en \u00c9l,\n \/\/No tengo a donde ir\/\/\n\n Si despreciara en mi coraz\u00f3n,\n La santa gracia que me salvo\n \/\/No tengo a donde ir\/\/\n\n Convencido estoy que sin tu amor,\n Se acabar\u00edan mis fuerzas,\n Y sin Ti mi coraz\u00f3n sediento,\n Se muere, se seca.\n\n \/\/Cerca de Ti yo quiero estar,\n De tu presencia no me quiero alejar\/\/"},
{"id":68,"ti":"Cercano Est\u00e1 Jehov\u00e1","tono":"C","estilo":"0","le":"\/\/\/Cercano est\u00e1 Jehov\u00e1\/\/\/\n a los quebrantados\n\n \/\/\/Y sana tambi\u00e9n\/\/\/\n a los contritos del esp\u00edritu;\n Clama a m\u00ed en el d\u00eda de la angustia,\n Yo te oir\u00e9 y t\u00fa me honrar\u00e1s"},
{"id":69,"ti":"Clamando Estoy","tono":"C","estilo":"0","le":"\/\/Clamando estoy a Ti Se\u00f1or,\n Clamando estoy como el pueblo de Israel,\n Que tu poder descienda sobre m\u00ed\n Y que me cubras con la nube de tu amor\/\/\n\n \/\/Que tu presencia nunca me falte\n Y que tu gozo sea mi fortaleza,\n Clamando estoy confiando en tu promesa:\n \u00abClama a m\u00ed y yo te responder\u00e9\u00bb\/\/"},
{"id":70,"ti":"Clamar\u00e9","tono":"C","estilo":"0","le":"Quiero entregar lo que impide acercarme a Ti\n Quiero entrar sin reservas y adorarte Cristo\n Amarte m\u00e1s, conocerte, En tu gloria estar;\n Deseo m\u00e1s\u2026 tu presencia\n\n Oh clamo a Ti, ll\u00e9name\n Rindo todo a tus pies\n Quiero amarte y adorarte\n por siempre\n\n Vengo ante Ti,\n Dios hoy te necesito,\n Este sentir es tan real, te anhelo.\n\n \/\/Clamo a Ti\/\/\n Necesito m\u00e1s y m\u00e1s y m\u00e1s de Ti."},
{"id":71,"ti":"Como El Ciervo","tono":"C","estilo":"0","le":"Como el ciervo busca por las aguas,\n As\u00ed clama mi alma por Ti Se\u00f1or,\n D\u00eda y noche yo tengo sed de Ti\n Y s\u00f3lo a Ti buscar\u00e9.\n\n \/\/ll\u00e9name\/\/ Se\u00f1or\n Dame m\u00e1s, m\u00e1s de tu amor,\n Yo tengo sed, s\u00f3lo de Ti,\n Ll\u00e9name Se\u00f1or."},
{"id":72,"ti":"C\u00f3mo He De Expresar","tono":"C","estilo":"0","le":"Como he de expresar la gratitud\n que hay en mi ser para Dios mi Redentor,\n \u00c9l me restaur\u00f3.\n\n Yo era nada cuando \u00c9l me encontr\u00f3\n Y ahora yo soy \/\/\/Un pr\u00edncipe de su pueblo\/\/\/\n \/\/\/No hay dios\/\/\/ Como mi Dios\n \/\/\/Maravilloso\/\/\/ Es nuestro Dios."},
{"id":73,"ti":"Como La Brisa","tono":"C","estilo":"0","le":"Abro el coraz\u00f3n y las ventanas,\n Cuando empieza la ma\u00f1ana,\n Por si quieres hoy venir.\n\n Eres como el viento que no avisa,\n Cuando sopla y trae la brisa,\n Ven y sopla sobre m\u00ed.\n\n Y mi coraz\u00f3n vuelve a latir\n Y se renueva si est\u00e1s aqu\u00ed.\n Y mi coraz\u00f3n vela por Ti,\n Porque te espera vuelve a venir.\n\n Esp\u00edritu de Dios ven a mi vida\n Como lluvia que tard\u00f3 y al desierto vida dio;\n Desciende sobre m\u00ed como la brisa,\n Que destile sobre m\u00ed,\n Tu poder en mi haz fluir."},
{"id":74,"ti":"Con Gratitud","tono":"C","estilo":"0","le":"Con gratitud estoy aqu\u00ed,\n Por la raz\u00f3n que me inspiras T\u00fa,\n Que siendo yo un vil pecador,\n Tu sacrificio me levant\u00f3.\n\n No encuentro yo c\u00f3mo pagar\n Lo que tu amor pudo alcanzar,\n Dispuesto estoy ante tu altar,\n Quiero hacer tu voluntad.\n\n Necesito, anhelo m\u00e1s de Ti,\n No ir\u00e9, Se\u00f1or, sin tu presencia.\n \u00dasame, env\u00edame a m\u00ed,\n Tu nombre, Se\u00f1or, levantar\u00e9."},
{"id":75,"ti":"Con Manos Vac\u00edas","tono":"C","estilo":"0","le":"Con manos vac\u00edas vengo a Ti,\n No tengo nada que darte,\n No hay nada de valor en m\u00ed,\n No puedo impresionarte.\n\n Te puedo entregar mi coraz\u00f3n,\n Pero est\u00e1 quebrantado,\n Rec\u00edbelo mi buen Pastor,\n T\u00fa puedes restaurarlo.\n\n Pongo mi vida a tu servicio Se\u00f1or,\n No ser\u00e1 mucho pero la entrego hoy\n Y si mis manos hoy vac\u00edas est\u00e1n\n T\u00fa puedes llenarlas con tu gran poder y amor\u2026\n Usa mis manos Se\u00f1or."},
{"id":76,"ti":"Con Mi Dios Yo Asaltar\u00e9 Los Muros","tono":"C","estilo":"0","le":"\/\/Con mi Dios yo saltar\u00e9 los muros,\n Con mi Dios ej\u00e9rcitos derribar\u00e9\/\/\n\n \u00c9l adiestra mis manos para la batalla,\n Puedo tomar con mis manos el arco de bronce\n \u00c9l es escudo, la roca m\u00eda,\n \u00c9l es la fuerza de mi salvaci\u00f3n,\n Mi alto refugio y mi fortaleza.\n \u00c9l es mi libertador.\n ******\n \/\/Con mi Dios yo asaltar\u00e9 los muros,\n Con mi Dios ej\u00e9rcitos derribar\u00e9\/\/\n\n \u00c9l adiestra mis manos para la batalla,\n Para entesar con mis brazos el arco de bronce\n \u00c9l es escudo, la roca m\u00eda,\n \u00c9l es la fuerza de mi salvaci\u00f3n,\n Mi alto refugio y mi fortaleza.\n \u00c9l es mi libertador."},
{"id":77,"ti":"Con Mis Manos Levantadas","tono":"C","estilo":"0","le":"Con mis manos levantadas hacia el cielo\n Me presento ante Ti hoy mi Se\u00f1or,\n Para recibir de Ti la fuerza y el poder\n Para vivir junto a Ti.\n\n Llenas hoy mi coraz\u00f3n con tu presencia,\n Llenas de alegr\u00eda y paz todo mi ser,\n En cualquier necesidad T\u00fa me responder\u00e1s\n Porque me amas, me amas."},
{"id":78,"ti":"Con Mis Ojos Te Ver\u00e9","tono":"C","estilo":"0","le":"Puedo sentir que est\u00e1s aqu\u00ed,\n Que est\u00e1s entre tu pueblo,\n Nos llenas con el gran poder,\n De tu Santo Esp\u00edritu.\n\n Hoy yo te veo por la fe,\n Siento tu Esp\u00edritu muy dentro de m\u00ed ser,\n Pero mi m\u00e1s grande esperanza es saber\n Que con mis ojos te ver\u00e9."},
{"id":79,"ti":"Con \u00d3leo De Alegr\u00eda","tono":"C","estilo":"0","le":"Con oleo de alegr\u00eda me has ungido,\n Con gozo y con pandero danzar\u00e9,\n Delante de tu pueblo redimido,\n La gloria de tu nombre cantar\u00e9,\n Con el pandero\u2026\n\n Toda la noche sin parar,\n Cantando alabanzas al Se\u00f1or,\n Diciendo desu gloria y majestad,\n T\u00fa eres el Rey de Israel."},
{"id":80,"ti":"Conozco Que Todo Lo Puedes","tono":"C","estilo":"0","le":"Conozco que todo lo puedes,\n Que mi pensamiento no lo puedo esconder,\n Hablaba lo que no entend\u00eda\n Y de o\u00eddas te hab\u00eda o\u00eddo.\n\n Mas ahora mis ojos te ven\n Yo te preguntar\u00e9 y T\u00fa me ense\u00f1ar\u00e1s,\n Mas ahora mis ojos te ven,\n Yo me rindo a tus pies y me arrepiento Se\u00f1or."},
{"id":81,"ti":"Consume Con Tu Fuego","tono":"C","estilo":"0","le":"Consume con tu fuego\n Todo lo que hay en m\u00ed\n Que no sea agradable a Ti\n Y que cada d\u00eda que pase te pueda yo servir\n Con un coraz\u00f3n limpio mi Dios.\n\n No te detengas Se\u00f1or\n Hasta haber acabado tu obra en mi vida;\n No te detengas Se\u00f1or\n Hasta haber transformado mi coraz\u00f3n."},
{"id":82,"ti":"Creo En Ti","tono":"C","estilo":"0","le":"Quiero levantar a Ti mis manos,\n Maravilloso Jes\u00fas, milagroso Se\u00f1or.\n Llena este lugar de tu presencia\n Y has descender tu poder\n A los que estamos aqu\u00ed.\n\n \/\/Creo en Ti Jes\u00fas,\n Y en lo que har\u00e1s en mi\/\/\n en mi.... en mi\n\n Recibe toda la gloria,\n Recibe toda la honra,\n Precioso Rey y Se\u00f1or."},
{"id":83,"ti":"Cristo Es La Pe\u00f1a De Horeb","tono":"C","estilo":"0","le":"\/\/Cristo es la pe\u00f1a de Horeb que est\u00e1 brotando\n agua de vida saludable para ti\/\/\n\n Ven a tomarla que es m\u00e1s dulce que la miel,\n Refresca el alma, refresca todo tu ser.\n Cristo es la pe\u00f1a de Horeb que est\u00e1 brotando\n agua de vida saludable para ti.\n\n Cristo es el lirio del valle de las flores;\n \u00c9l es la rosablanca pura de Sar\u00f3n.\n Cristo es la vida y amor de los amores;\n \u00c9l es la eterna Fuente de la Salvaci\u00f3n."},
{"id":84,"ti":"Cristo Es Mi Se\u00f1or","tono":"C","estilo":"0","le":"Cristo es mi Se\u00f1or,\n no me da temor de mostrar con mis acciones\n que \u00c9l puede reinar en la vida\n de cualquiera que se quiere entregar. \n Cristo es mi Se\u00f1or,\n no me da temor de mostrar\n al mundo entero de tu gran poder,\n en mi vida permitir que \u00c9l se deje ver.\n\n Jesucristo no me detendr\u00e9 de doblar\n mi rodilla y mi ser ante tu majestad.\n Jesucristo te confesar\u00e9 \n con mis labios declarar\u00e9\n que T\u00fa eres Se\u00f1or."},
{"id":85,"ti":"Cristo Ha Mandado","tono":"C","estilo":"0","le":"Cristo ha mandado de ir por todo el mundo\n Y en su nombre predicar la salvaci\u00f3n.\n Y anunciarles que Cristo salva\n De tan terrible y sin fin condenaci\u00f3n."},
{"id":86,"ti":"Cristo Me Dijo","tono":"C","estilo":"0","le":"\/\/Cristo me dijo que ven\u00eda otra vez,\n Que ven\u00eda otra vez, que ven\u00eda otra vez\/\/\n\n \/\/Que no me desesperara, sino que tuviera fe\/\/\n\n Y yo le estoy, y yo le estoy esperando\n y t\u00fa le est\u00e1s, y t\u00fa le est\u00e1s esperando\n \/\/Al\u00e1bale, al\u00e1bale, al\u00e1bale de coraz\u00f3n\/\/"},
{"id":87,"ti":"Cristo No Est\u00e1 Muerto","tono":"C","estilo":"0","le":"\/\/\/Cristo no est\u00e1 muerto, \u00c9l est\u00e1 vivo\/\/\/\n\n Lo siento en mis manos,\n Lo siento en mis pies,\n Lo siento en todo mi ser.\n\n La tengo, la tengo, la tengo, sila tengo,\n La unci\u00f3n est\u00e1 sobre m\u00ed\n \u00a1Gloria a Dios porque la tengo!"},
{"id":88,"ti":"Cristo Nuestro Rey","tono":"C","estilo":"0","le":"\/\/Cristo nuestro Rey est\u00e1 aqu\u00ed\/\/\n Por su grande amor\n \/\/\u00c9l te llama a ti\/\/\n \/\/Quieres ser feliz ven a \u00c9l\/\/\n Ven a \u00c9l si quieres ser feliz."},
{"id":89,"ti":"Cristo Rompe Las Cadenas","tono":"C","estilo":"0","le":"\/\/Cristo rompe las cadenas\/\/\n Las cadenas del pecado y nos da seguridad\n\n \u00bfC\u00f3mo es posible yo vivir sin mi Jes\u00fas?\n Si el fundamento de mi vida eres T\u00fa\n T\u00fa me has librado del infierno y de la muerte\n \u00bfC\u00f3mo es posible yo vivir sin mi Jes\u00fas?"},
{"id":90,"ti":"Cristo Vive","tono":"C","estilo":"0","le":"\/\/\/Cristo vive\/\/\/\n\n \/\/Mi salvador no est\u00e1 muerto,\n \u00c9l no est\u00e1 en una tumba.\n Mi salvador no est\u00e1 muerto,\n Pues \u00c9l resucit\u00f3\/\/"},
{"id":91,"ti":"Cristo Yo Te Amo","tono":"C","estilo":"0","le":"\/\/Cristo, yo te amo\/\/\n No hay nadie como T\u00fa, Jes\u00fas.\n\n Y no s\u00e9 d\u00f3nde estuviera\n Si yo a Ti no te tuviera,\n Si no hubiera conocido\n Al Dios que me ama."},
{"id":92,"ti":"Cu\u00e1n Gloriosa Ser\u00e1 La Ma\u00f1ana","tono":"C","estilo":"0","le":"\n \u00a1Cu\u00e1n gloriosa ser\u00e1 la ma\u00f1ana!,\n Cuando venga Jes\u00fas el Salvador.\n Las naciones unidas como hermanas,\n bienvenida daremos al Se\u00f1or.\n\n CORO\n No habr\u00e1 necesidad de la Luna el resplandor,\n Ni el Sol dar\u00e1 su luz, ni tampoco su calor,\n All\u00ed llanto no habr\u00e1, ni tristeza, ni dolor,\n Porque entonces Jes\u00fas el Rey del cielo,\n Para siempre ser\u00e1 el consolador.\n\n II\n Esperamos la ma\u00f1ana gloriosa,\n Para dar la bienvenida al Dios de amor,\n Donde todo ser\u00e1 color de rosa,\n En la santa fragancia del Se\u00f1or.\n\n III\n El cristiano fiel y verdadero\n Y tambi\u00e9n el obrero de valor\n Y la iglesia esposa del Cordero,\n Estar\u00e1n en los brazos del Se\u00f1or."},
{"id":93,"ti":"Cuando Cristo Vino","tono":"C","estilo":"0","le":"Cuando Cristo vino a mi coraz\u00f3n,\n Mi vida entera cambi\u00f3,\n Su paz y su amor alejaron de m\u00ed,\n Las dudas, las sombras y el temor.\n\n \/\/Mi vida comenz\u00f3 cuando el Se\u00f1or lleg\u00f3\n Y hoy puedo cantar de su amor\/\/\n\n Deja que Cristo te transforme a ti,\n Que cambie tu vida tambi\u00e9n,\n Piensa en Jes\u00fas el que muri\u00f3 por ti.\n Y \u00e1brele tu coraz\u00f3n."},
{"id":94,"ti":"Cuando El Pueblo Alaba A Dios","tono":"C","estilo":"0","le":"Cuando el pueblo alaba a Dios\n \/\/suceden cosas\/\/ maravillosas\n \/\/hay sanidad, liberaci\u00f3n\n Se siente la bendici\u00f3n\/\/"},
{"id":95,"ti":"Cuando Fara\u00f3n","tono":"C","estilo":"0","le":"\/\/Cuando fara\u00f3n dej\u00f3 ir al pueblo\n Jehov\u00e1 les gui\u00f3 por el desierto\/\/\n\n \/\/\u00c9l iba delante de ellos\/\/\n \/\/De d\u00eda en columna de nube,\n De noche en columna de fuego\/\/\n \/\/De d\u00eda y de noche\n Jehov\u00e1 iba con ellos\/\/"},
{"id":96,"ti":"Cuando Jes\u00fas Caminaba","tono":"C","estilo":"0","le":"\/\/Cuando Jes\u00fas caminaba\n Sobre las olas del mar\/\/\n \/\/Pedro le dijo voy Cristo le dijo ven\/\/\n\n \/\/Cuando Pedro caminaba, la duda le visit\u00f3\/\/\n \/\/Ahora le toca a Pedro clamar al Se\u00f1or\/\/\n \/\/S\u00e1lvame maestro, s\u00e1lvame que perezco\/\/"},
{"id":97,"ti":"Cuando Los Profetas Clamaron A Baal","tono":"C","estilo":"0","le":"\/\/Cuando los profetas clamaron a Baal,\n Baal, Baal no les respondi\u00f3\/\/\n\n \/\/Y cuando El\u00edas clam\u00f3 a su Dios,\n Se quem\u00f3 la le\u00f1a, se quem\u00f3 el cordero,\n Esp\u00edritu Santo bajando del cielo\/\/"},
{"id":98,"ti":"Cuando Perdido Yo Me Hallaba","tono":"C","estilo":"0","le":"\/\/Cuando perdido yo me hallaba,\n Dios me busc\u00f3 y me encontr\u00f3\/\/\n\n \/\/Cuando me hall\u00f3\/\/\n \/\/gozo sent\u00ed\/\/\n Y al instante salvo fui\n\n \/\/Agua de la vida ven a beber\/\/\n \/\/Sacia tu sed en Cristo Jes\u00fas,\n Sacia tu sed en el Salvador\/\/"},
{"id":99,"ti":"Cuando Pienso En Lo Lindo","tono":"C","estilo":"0","le":"\/\/Cuando pienso en lo lindo que es,\n Estar en la presencia de Dios\/\/\n\n \/\/Quisiera dejar mi cuerpo\n Y volar al cielo con mi Salvador\/\/"},
{"id":100,"ti":"Cuando Pienso En Tu Santidad","tono":"C","estilo":"0","le":"Cuando pienso en tu santidad\n Y te veo en tu majestad,\n Cuando todo alrededor es sombra,\n Allado de tu luz.\n\n Cuando tu coraz\u00f3n logre alcanzar\n Y mi voluntad se rinde a Ti,\n Cuando todo alrededor es sombra\n Al lado de tu luz\n\n \/\/\/\/Te adoro a Ti\/\/\/\/\n La raz\u00f3n por la cual yo vivo es para adorarte."},
{"id":101,"ti":"Cuando Pronuncio Su Nombre","tono":"C","estilo":"0","le":"Cuando pronuncio su nombre,\n \u00c9l se muestra con poder,\n Jehov\u00e1 Nissi levanta banderas,\n Los ej\u00e9rcitos del cielo de inmediato bajar\u00e1n\n Con caballos y carros de guerra.\n\n Los cojos y los ciegos se sanan en su nombre,\n A los presos se les grita \u00a1libertad!\n A nosotros nos ha sido revelado ese nombre,\n \u00bfQui\u00e9n es \u00c9l?\n\n \/\/ \u00bfCu\u00e1l es su nombre? \u00a1Jes\u00fas!\n Dilo de nuevo \u00a1Jes\u00fas!\n Gr\u00edtalo fuerte \u00a1Jes\u00fas!\n Proclama siempre\/\/\n \u00bfCu\u00e1l es su nombre? \u00a1Jes\u00fas!"},
{"id":102,"ti":"Cuando Venga De Los Cielos","tono":"C","estilo":"0","le":"\/\/Cuando venga de los cielos el Se\u00f1or\n Si est\u00e1s vivo o est\u00e1s muerto,\n Qu\u00e9 cuentas t\u00fa le dar\u00e1s\/\/\n\n Amigo no lo pienses m\u00e1s,\n Cristo te dice ven a mi \n \/\/Recuerda que este tu Salvador\n Nunca se olvidar\u00e1 de ti\/\/"},
{"id":103,"ti":"Cu\u00e1nto Te Amo","tono":"C","estilo":"0","le":"Vengo a decirte que agradecido estoy,\n Pues transformaste todo mi coraz\u00f3n,\n Cuanto te amo, Cristo, cuanto te amo.\n\n Se\u00f1or yo te amo y tengo cantar,\n Porque en tus manos siento seguridad,\n cuanto te amo, Cristo, cuanto te amo.\n\n Quiero abrigarme bajo tus alas\n Y habitar en tus moradas,\n A la sombra de tu majestad,\n Alzo mi vida, alzo mi voz,\n Alzo mis manos hoy al cielo,\n Porque grande es tu fidelidad."},
{"id":104,"ti":"Dale Tu Ofrenda Al Se\u00f1or","tono":"C","estilo":"0","le":"Dale tu ofrenda al Se\u00f1or\n D\u00e1sela de coraz\u00f3n\n Que cuando al cielo t\u00fa vayas\n Te reciba con amor.\n\n Que no te quede dolor\n Despu\u00e9s de haber ofrendado\n \/\/Dios bendice al dador alegre\n Y da doble a los que han dado\/\/"},
{"id":105,"ti":"Dame Un Coraz\u00f3n","tono":"C","estilo":"0","le":"Dame un coraz\u00f3n limpio para amarte,\n Dame un coraz\u00f3n d\u00f3cil para servirte,\n Dame un coraz\u00f3n como el que tienes T\u00fa,\n Dame un coraz\u00f3n nuevo Se\u00f1or Jes\u00fas."},
{"id":106,"ti":"Damos Gracias Al Se\u00f1or","tono":"C","estilo":"0","le":"\/\/Damos gracias al Se\u00f1or, damos gracias,\n Damos gracias por su amor\/\/\n\n Y en este d\u00eda sus hijos cantan,\n Las alabanzas a Cristo el salvador\n Por la ma\u00f1ana las aves cantan,\n Las alabanzas a Cristo el Salvador.\n Y t\u00fa amigo porque no cantas\n Las alabanzas de Cristo el Salvador."},
{"id":107,"ti":"Damos Honor A Ti","tono":"C","estilo":"0","le":"\/\/Damos honor a Ti\/\/\n Creador de vida eres T\u00fa\n \/\/Damos honor a Ti\/\/\n Porque no hay otro Dios como T\u00fa\n\n \/\/Rey de reyes, admirable eres,\n El principio y fin, soberano y sublime,\n Eres nuestro Salvador\/\/"},
{"id":108,"ti":"De Gloria En Gloria","tono":"C","estilo":"0","le":"De gloria en gloria te veo,\n Cuanto m\u00e1s te conozco,\n Quiero saber m\u00e1s de Ti.\n\n Mi Dios cuan buen alfarero,\n Quebr\u00e1ntame transf\u00f3rmame,\n Mold\u00e9ame a tu imagen Se\u00f1or.\n\n Quiero ser m\u00e1s como T\u00fa\n Ver la vida como T\u00fa,\n Saturarme de tu Esp\u00edritu,\n Y reflejar al mundo tu amor."},
{"id":109,"ti":"De Tal Manera Me Am\u00f3","tono":"C","estilo":"0","le":"De tal manera me am\u00f3\n Que su vida no escatim\u00f3\n Hasta el final \u00c9l se entreg\u00f3\n Y a la muerte fue porque \u00c9l me am\u00f3.\n\n De tal manera me am\u00f3,\n Que no hay forma en que podr\u00e9 pagar,\n El precio de su grande amor,\n Que con toda mi alma quiero dar.\n\n Por su amor yo vivir\u00e9,\n De su amor yo cantar\u00e9,\n Con mi Jes\u00fas caminar\u00e9,\n Porque \u00c9l me am\u00f3 a m\u00ed\u2026\n le seguir\u00e9.\n\n Por su amor yo vivir\u00e9,\n De su amor yo cantar\u00e9,\n Con mi Jes\u00fas caminar\u00e9,\n Porque \u00c9l muri\u00f3 por mi le seguir\u00e9."},
{"id":110,"ti":"Deja Tu Fuego Descender","tono":"C","estilo":"0","le":"Como en aquellos d\u00edas muestra tu poder,\n Deja tu fuego descender,\n Quema los \u00eddolos de piedra Dios,\n Deja tu fuego descender.\n\n Te damos nuestras vidas,\n En tu presencia hoy,\n En tu altar rendimos nuestro coraz\u00f3n,\n\n \/\/Deja tu fuego descender\/\/\n\n Ven y mu\u00e9stranos tu poder,\n Deja tu fuego descender,\n Santo Esp\u00edritu haz tu voluntad,\n Deja tu fuego descender.\n\n Purifica a tu pueblo y av\u00edvanos Se\u00f1or,\n Recibe hoy la gloria\n Y enciende nuestro coraz\u00f3n\n\n \/\/Deja tu fuego descender\/\/"},
{"id":111,"ti":"Delante De Tu Presencia","tono":"C","estilo":"0","le":"\/\/Delante de tu presencia,\n Quiero adorar, danzamos y exaltamos,\n Es nuestra libertad\/\/\n\n Oh \/\/manda el fuego\/\/de los cielos,\n Jesucristo, llenas hoy mi coraz\u00f3n,\n Santo Esp\u00edritu, bienvenido a este lugar\n Vamos todos a adorar."},
{"id":112,"ti":"Delante De Tu Trono","tono":"C","estilo":"0","le":"\/\/Delante de tu trono,\n Se\u00f1or yo quiero estar\n Para contemplar\n tu hermosura y santidad\/\/\n\n Y decirte te amo\n y decirte te adoro\n Y decirte te amo\n y que eres todo para m\u00ed."},
{"id":113,"ti":"Derrama De Tu Fuego","tono":"C","estilo":"0","le":"\/\/Grande, poderoso eres T\u00fa, mi Dios,\n Fuerte y poderoso eres T\u00fa mi rey\/\/\n\n \/\/Derrama de tu fuego sobrenatural,\n Derrama de tu gloria sobre este lugar\/\/\n\n Anhelamos m\u00e1s de Ti Se\u00f1or,\n Anhelamos m\u00e1s de tu amor,\n Anhelamos m\u00e1s de Ti Se\u00f1or,\n Derrama de tu fuego, Se\u00f1or."},
{"id":114,"ti":"Derrama Tu Poder","tono":"C","estilo":"0","le":"I\n Mu\u00e9veme como nunca me has movido\n Para que no me olvide de Ti,\n Gu\u00edame por este momento lindo\n Que no me quiero desviar,\n No te quiero perder\n\n CORO\n \/\/Derrama tu poder, derrama tu amor,\n Jesucristo s\u00f3lo quiero m\u00e1s de Ti\/\/\n\n II\n T\u00f3mame de la mano este d\u00eda\n Para que sepa yo que soy de Ti;\n Hoy te doy lo que queda de mi vida,\n Porque eres mi galard\u00f3n y mi inspiraci\u00f3n.\n III\n \/\/Es mi oraci\u00f3n, mi \u00fanica s\u00faplica:\n Estar junto a Ti, estar junto a Ti\/\/"},
{"id":115,"ti":"Desciende Aqu\u00ed","tono":"C","estilo":"0","le":"\/\/\/Desciende aqu\u00ed\/\/\/\n El Esp\u00edritu de Dios desciende aqu\u00ed,\n\n Si los santos se congregan a alabar a su Se\u00f1or,\n El Esp\u00edritu de Dios desciende aqu\u00ed."},
{"id":116,"ti":"Desde Mi Interior","tono":"C","estilo":"0","le":"I\n A veces te fall\u00e9 m\u00e1s T\u00fa fuiste fiel\n Tu gracia me levant\u00f3, me basta tu amor.\n\n CORO\n \/\/Dios eterno, tu luz por siempre brillar\u00e1\n Y tu gloria incomparable sin final\/\/\n\n II\n Se\u00f1or tu voluntad permanecer\u00e1,\n En ti me quiero perder en adoraci\u00f3n.\n\n III\n De mi coraz\u00f3n te doy el control\n Consume todo mi interior, Dios\u2026\n Justicia y amor me abrazan\n Se\u00f1or te amo desde mi interior."},
{"id":117,"ti":"Deseo Tu Gloria","tono":"C","estilo":"0","le":"I\n Frente a frente contigo quiero estar\n Y tu gloria contemplar.\n Un instante tu rostro quiero ver\n Y rendirme a tu pies.\n Tu grandeza y perfecci\u00f3n,\n Tu esplendor y resplandor,\n Me deslumbran y te anhelo m\u00e1s y m\u00e1s.\n\n CORO\n Deseo tu gloria en m\u00ed,\n Ver tu gloria en m\u00ed,\n Como un espejo\n Refl\u00e9jate en m\u00ed.\n\n \/\/\/Quiero tu gloria\/\/\/ en m\u00ed\n\n CORO 2\n Queremos tu gloria aqu\u00ed,\n Ver tu gloria aqu\u00ed.\n Con tu presencia\n Transf\u00f3rmanos Dios.\n\n \/\/\/M\u00e1s de tu gloria\/\/\/ aqu\u00ed"},
{"id":118,"ti":"Despierta","tono":"C","estilo":"0","le":"Hay alboroto en las calles es que algo ha pasado,\n Veo a los hombres corriendo y a muchos gritando,\n Padres que buscan sus hijos muy desesperados,\n Parece que aquello que un d\u00eda se anuncio ha pasado.\n\n Yo no me encuentro en la tierra estoy separado\n Y siento que todo mi cuerpo y mi ser han cambiado\n Y en este lugar en que estoy yo gozo de calma\n Mientras abajo en la tierra as\u00ed gritan las almas:\n\n \u00ab\u00bfPor qu\u00e9 me he quedado, Se\u00f1or\n No s\u00e9 en qu\u00e9 te fall\u00e9, en que te ofend\u00ed?\n \u00bfQu\u00e9 ser\u00e1 de mi alma?\u00bb\n\n Mi mente y mi capacidad no pueden describir,\n La gloria y el grande poder que hay en este lugar;\n Un trono que est\u00e1 rodeado de miles de \u00e1ngeles\n Mientras abajo en la tierra se alborotan las calles\n\n \/\/Despierta, pronto llegar\u00e1 el momento,\n Que no habr\u00e1 en tu vida lamentos\n \u00a1Cristo nos viene a buscar!\n Procura dar lo mejor de tu vida\n Para cuando llegue ese d\u00eda\n El cielo puedas conquistar\/\/"},
{"id":119,"ti":"Devu\u00e9lveme El Gozo","tono":"C","estilo":"0","le":"En medio del dolor,\n en medio de la aflicci\u00f3n,\n Me das paz y me ense\u00f1as amor;\n\n Todo lo que perd\u00ed,\n lo restauras Se\u00f1or en m\u00ed,\n Me das las fuerzas para seguir.\n\n Devu\u00e9lveme el gozo de tu salvaci\u00f3n\n Y tu Esp\u00edritu noble me sustente. \n Te necesito Dios, sin Ti yo soy nada;\n Te necesito Dios, dame un nuevo coraz\u00f3n."},
{"id":120,"ti":"Dicen Que No Existes","tono":"C","estilo":"0","le":"Dicen que no existes que no eres realidad,\n Pero est\u00e1s vibrando dentro de m\u00ed una vez m\u00e1s,\n Obras estupendas de amor son realidad\n Y te siento m\u00e1s y m\u00e1s.\n\n Quiero llenar tutrono de alabanza,\n Quiero llenar tu trono de adoraci\u00f3n,\n Quiero adorar, postrado en tu presencia\n Y adorarte m\u00e1s y m\u00e1s.\n\n D\u00e9jame llenar tutrono de alabanza,\n D\u00e9jame llenar tu trono de adoraci\u00f3n,\n D\u00e9jame adorar postrado en tu presencia\n Y adorartem\u00e1s y m\u00e1s."},
{"id":121,"ti":"Digno De Gloria Y De Alabanza","tono":"C","estilo":"0","le":"\/\/Digno de gloria y de alabanza\n Y digno de honor es \u00c9l\/\/\n\n Me ha redimido con su sangre s\u00ed,\n Su Esp\u00edritu vive en m\u00ed.\n\n \/\/Digno de gloria y de alabanza\n Y digno de honor es \u00c9l\/\/"},
{"id":122,"ti":"Digno De Gloria","tono":"C","estilo":"0","le":"\/\/Digno de gloria, de alabanza\n Levantemos nuestras manos\n y adoremos al Se\u00f1or\/\/\n\n \/\/Porque grande eres,\n maravillas haces T\u00fa,\n No hay otro como T\u00fa no lo hay;\n No hay nadie como T\u00fa\/\/"},
{"id":123,"ti":"Digno Eres Se\u00f1or","tono":"C","estilo":"0","le":"Digno eres Se\u00f1or,\n De recibir la honra,\n De recibir la gloria\n y todo el honor\n\n En el cielo, la tierra y el mar,\n En el aire y en todo lugar,\n Por los siglos de los siglos,\n Digno eres Se\u00f1or."},
{"id":124,"ti":"Digno Eres Se\u00f1or De Recibir El Libro","tono":"C","estilo":"0","le":"Digno eres Se\u00f1or de recibir el libro\n De abrir sus sellos porque fuiste inmolado\n Y con tu sangre T\u00fa nos has rescatado\n \/\/De todas las tribus de todas las lenguas\n De todo pueblo y naci\u00f3n\/\/\n Para traernos a Dios."},
{"id":125,"ti":"Digno Y Santo","tono":"C","estilo":"0","le":"\/\/Digno y Santo el cordero\n Inmolado en la cruz,\n Nuevo canto levantaremos\n Al que en su trono est\u00e1\/\/\n\n Santo, Santo, Santo\n Dios todo poderoso\n Quien fue, quien es y quien vendr\u00e1.\n\n La creaci\u00f3n te canta\n Hosanna al gran Yo soy,\n T\u00fa eres mi todo y yo te adorar\u00e9.\n\n De un arco iris, est\u00e1 vestido\n Tu voz resuena como los truenos.\n Recibe Honor y Gloria\n Poder y Majestad\n A ti el \u00danico Rey\n\n Tan grandioso, asombroso\n Con solo decir Jes\u00fas,\n Cristo tu Nombre es grande\n Fuente inagotable\n Tu misterio glorioso es."},
{"id":126,"ti":"Dios De Esta Ciudad","tono":"C","estilo":"0","le":"T\u00fa eres Rey de este pueblo,\n Eres Dios en esta ciudad,\n El Se\u00f1or de esta naci\u00f3n,\n Eres Dios.\n\n Eres nuestra esperanza,\n Eres luz en la oscuridad,\n Eres paz al cansado,\n Eres Dios.\n\n \/\/No hay otro como T\u00fa\/\/\n\n \/\/Grandes cosas vienen ya,\n Grandes cosas Dios har\u00e1 en este pueblo\/\/"},
{"id":127,"ti":"Dios De Los Ej\u00e9rcitos","tono":"C","estilo":"0","le":"\/\/Dios de los ej\u00e9rcitos,\n poderoso en batalla,\n \u00bfQui\u00e9n es como T\u00fa Se\u00f1or?,\n el gran YO SOY.\n Grande y temible rey,\n Tu dominio no se acabar\u00e1,\n Con tu brazo de poder gobernar\u00e1s\/\/\n\n Eres el gran yo Soy,\n eres mi protector\n Eres mi fuerza,\n mi escudo y mi salvaci\u00f3n.\n Y yo no temer\u00e9, en Ti yo confiar\u00e9\n y me levantar\u00e9 con tu fuerza y poder...\n\n \/\/Eres el todopoderoso, temible en batalla\n Y tu justicia es para siempre\n Por todos los siglos\/\/"},
{"id":128,"ti":"Dios Donde Quiera Est\u00e1","tono":"C","estilo":"0","le":"\/\/\/Dios donde quiera est\u00e1\/\/\/\n Aleluya, gloria a Dios.\n\n \/\/Si subes a los cielos y bajas a la mar,\n Debajo de las aguas all\u00ed lo encontrar\u00e1s\/\/\n\n Yo quiero andar con Cristo,\n Yo quiero andar con \u00c9l,\n \/\/\u00c9l es mi fiel amigo y yo le sirvo a \u00c9l\/\/\n\n \/\/L\u00edbrate de la ira que vendr\u00e1\/\/\n \/\/Dios est\u00e1 llamando a hombres y mujeres\n Y todo el que creyere la salvaci\u00f3n tendr\u00e1\/\/"},
{"id":129,"ti":"Dios Es Nuestro Amparo","tono":"C","estilo":"0","le":"Dios es nuestro amparo, nuestra fortaleza,\n Nuestro pronto auxilio en la tribulaci\u00f3n,\n Aunque se traspasen los montes a la mar,\n \/\/aunque la tierra tiemble tenemos que cantar\/\/"},
{"id":130,"ti":"Dios Est\u00e1 Aqu\u00ed","tono":"C","estilo":"0","le":"Dios est\u00e1 aqu\u00ed,\n Tan cierto como el aire que respiro,\n tan cierto como la ma\u00f1ana se levanta,\n Tan ciertocomo que le canto\n Y \u00c9l me puede o\u00edr.\n\n \/\/Le puedes sentir en este mismo momento,\n Le puedes sentir muy dentro de tu coraz\u00f3n,\n \u00c9l te puede ayudar en ese problema que tienes,\n Jes\u00fas est\u00e1aqu\u00ed, si t\u00fa quieres le puedessentir\/\/"},
{"id":131,"ti":"Dios Est\u00e1 Aqu\u00ed S\u00ed","tono":"C","estilo":"0","le":"\/\/Dios est\u00e1 aqu\u00ed, s\u00ed\/\/\n \/\/Dios est\u00e1\/\/ Yo lo siento en m\u00ed.\n\n \/\/\/Vivo est\u00e1\/\/\/ el se\u00f1or,\n \/\/Vivo est\u00e1\/\/ \u00c9l resucit\u00f3.\n\n \/\/Demos gloria a \u00c9l, s\u00ed\/\/\n \/\/Demos gloria\/\/ por su grande amor.\n\n \/\/Gloria a \u00c9l\/\/\n gloria a nuestro Dios.\n \/\/Gloria a \u00c9l\/\/\n por su grande amor.\n\n \/\/Rey de reyes, Se\u00f1or de se\u00f1ores,\n Gloria, aleluya\/\/\n \/\/Cristo pr\u00edncipe de paz, gloria, aleluya\/\/"},
{"id":132,"ti":"Dios Est\u00e1 Aqu\u00ed, \u00a1qu\u00e9 Precioso Es!","tono":"C","estilo":"0","le":"\/\/Dios est\u00e1 aqu\u00ed, \u00a1qu\u00e9 precioso es!\n \u00c9l lo prometi\u00f3 donde est\u00e1n dos o tres\/\/\n\n \/\/\/Qu\u00e9date Se\u00f1or\/\/\/ en cada coraz\u00f3n,\n \/\/\/qu\u00e9date Se\u00f1or\/\/\/en m\u00ed.\n\n \u00a1Oh Cristo m\u00edo haz de mi alma un altar\n Para adorarte con devoci\u00f3n!\n \u00a1Oh Cristo m\u00edo haz de mi alma un altar\n Para adorarte con todo el coraz\u00f3n!"},
{"id":133,"ti":"Dios Est\u00e1 Presente","tono":"C","estilo":"0","le":"\/\/Dios est\u00e1 presente, Dios est\u00e1 presente,\n Alabemos todos su bendito nombre\/\/\n\n \/\/Es Jes\u00fas quien alumbr\u00f3 mi vida,\n Alabemos todos su bendito nombre\/\/"},
{"id":134,"ti":"Dios Manda Lluvia","tono":"C","estilo":"0","le":"\/\/Dios manda lluvia,\n Derrama de tu Esp\u00edritu,\n Env\u00eda hoy tu fuego,\n Sana mis heridas\n Rest\u00e1urame Se\u00f1or\/\/\n\n \/\/Manda la lluvia el roc\u00edo de tu amor\n Llenando las vidas de tu pueblo oh Se\u00f1or,\n Manda la lluvia el roc\u00edo de tu amor\n Habita hoy mi vida, c\u00e1mbiame Se\u00f1or\/\/"},
{"id":135,"ti":"Dios No Nos Trajo Hasta Aqu\u00ed","tono":"C","estilo":"0","le":"\/\/Dios no nos trajo hasta aqu\u00ed para volver atr\u00e1s,\n Nos trajo aqu\u00ed a poseer la tierra que \u00c9l nos dio\/\/\n\n Y aunque gigantes encuentre all\u00e1 yo nunca temer\u00e9,\n Nos trajo aqu\u00ed a poseer la tierra que \u00c9l nos dio"},
{"id":136,"ti":"Dios Sea Exaltado","tono":"C","estilo":"0","le":"\/\/Dios sea exaltado\n Sus enemigos sean esparcidos\/\/\n\n \/\/Venciendo en el reino\n De las tinieblas,\n Con alabanza\/\/\n\n Subir\u00e9 a la monta\u00f1a,\n Gritar\u00e9 a las naciones\n Que el reino de las tinieblas,\n Est\u00e1 cayendo.\n\n \/\/Est\u00e1 cayendo ohh\/\/"},
{"id":137,"ti":"Dios Subi\u00f3 A Su Trono","tono":"C","estilo":"0","le":"Dios subi\u00f3 a su trono,\n entre aplauso y j\u00fabilo,\n Dios subi\u00f3 a su trono,\n la trompeta sonando est\u00e1.\n\n \/\/La tierra le alaba, sus hijos le adoran,\n Toda su creaci\u00f3n le canta\/\/\n\n \/\/Eres grande, eres el Se\u00f1or\n Y toda la tierra te rinde adoraci\u00f3n\/\/\n\n Tu nombre exaltamos,\n No hay otro Dios como T\u00fa, Jes\u00fas."},
{"id":138,"ti":"Divino Compa\u00f1ero","tono":"C","estilo":"0","le":"I\n Divino compa\u00f1ero del camino,\n Tu presencia siento yo al caminar,\n \u00c9l ha disipado toda sombra, ya tengo luz;\n La luz divina de su amor.\n\n CORO\n Qu\u00e9date Se\u00f1or, ya se hace tarde,\n Te ofrezco el coraz\u00f3n para morar,\n Hazlo tu morada permanente,\n \/\/Ac\u00e9ptalo\/\/ mi Salvador.\n\n II\n Contigo la jornada se hace corta\n No habr\u00e1 sed ni el sol fatigar\u00e1\n Si en el mar las olas amenazan\n T\u00fa sobre ellas majestuoso andar\u00e1s\n\n III\n La sombra de la noche se aproxima\n Y en ella el tentador acechar\u00e1,\n No me dejes solo en el camino,\n Ay\u00fadame, ay\u00fadame hasta llegar."},
{"id":139,"ti":"Dorcas De Virtud. Coro Lema Damas Dorcas 2011.","tono":"C","estilo":"0","le":"I\n \/\/Dios ha puesto en tus manos\n La virtud de ser mujer,\n Sus promesas no han faltado\n Y has visto su poder\/\/\n D\u00e1ndote la victoria porque confiaste en \u00c9l.\n\n CORO\n Y hoy como Ruth y hoy como Ester,\n Puedes decir: \u00abDios eres fiel\u00bb\n Y comprender que una mujer\n Es de valor en manos de \u00c9l\n\n II\n Alza hoy tu mirada, tu tienda ensancha m\u00e1s,\n Bendici\u00f3n eres a otras pues su amor conoces ya,\n D\u00e1ndote la victoria en la dificultad."},
{"id":140,"ti":"Dulce Refugio","tono":"C","estilo":"0","le":"Dulce refugio en la tormenta,\n Es Jesucristo el salvador.\n \u00c9l me alienta y me alimenta\n Con su palabra y su amor.\n\n Vengo a reposar en \u00c9l,\n \u00c9l es mi amigo fiel,\n Una poderosa y fresca unci\u00f3n\n Llenar\u00e1 mi coraz\u00f3n.\n Dulce refugio en la tormenta,\n Es Jesucristo el salvador."},
{"id":141,"ti":"Edifiqu\u00e9 Mi Casa","tono":"C","estilo":"0","le":"\/\/\/Edifiqu\u00e9 mi casa\/\/\/\n sobre la Roca la edifiqu\u00e9,\n \/\/\/Jesucristo es la base\/\/\/\n Y el fundamento de nuestra fe.\n\n \/\/Y esta casa no se cae\n Porque est\u00e1 sobre la Roca\/\/\n\n \/\/Sobre la roca, sobre la Roca,\n Y esta casa no se cae\/\/"},
{"id":142,"ti":"El Aire De Tu Casa","tono":"C","estilo":"0","le":"I\n Quiero respirar el aire de tu casa,\n Disfrutar de tu fragancia y llenarme de Ti.\n Quiero en tu presencia estar todos los d\u00edas\n Y llenarte de alegr\u00eda en tu jard\u00edn.\n\n CORO\n Quiero estar tan cerca que te pueda respirar\n Y un solo latido pueda yo escuchar.\n Quiero estar tan cerca que te pueda yo tocar\n Y que tu pureza pueda yo imitar.\n Quiero ser tu amigo, quiero estar contigo.\n\n II\n Quiero navegar el mar de tu mirada\n Y saber que no habr\u00e1 nada que me aparte de Ti.\n Quiero caminar sigui\u00e9ndote los pasos\n Y aprender de tu regazo lo que esperas de m\u00ed."},
{"id":143,"ti":"El Alfarero","tono":"C","estilo":"0","le":"El alfarero vio un vaso que se hab\u00eda roto\n Con el uso y del tiempo\n Y \u00e9l trato con mucha paciencia\n De hacerlo otra vez.\n\n Y yo era ese vaso que nadie crey\u00f3 que serv\u00eda,\n Clame al se\u00f1or yo soy barro\n Y T\u00fa eres el alfarero\n Mold\u00e9ame como T\u00fa quieras hoy\u2026\n\n Y Dios tom\u00f3 los pedazos de mi roto coraz\u00f3n,\n Me hizo un vaso nuevo,\n Y redimi\u00f3 mi alma otra vez."},
{"id":144,"ti":"El Amor De Dios Es Maravilloso","tono":"C","estilo":"0","le":"\/\/\/El amor de Dios es maravilloso\/\/\/\n \u00a1Cu\u00e1n grande es el amor de Dios!\n\n Tan alto que no puedo ir arriba de \u00e9l,\n Profundo que no puedo ir abajo de \u00e9l,\n Tan ancho que no puedo ir afuera de \u00e9l.\n \u00a1Cu\u00e1n grande es el amor de Dios!"},
{"id":145,"ti":"El Amor De Jes\u00fas Es Muy Grande","tono":"C","estilo":"0","le":"I\n El amor de Jes\u00fas es muy grande,\n Yo jam\u00e1s lo he podido olvidar;\n No he encontrado en mi vida una fuerza\n Que de mi alma lo pueda arrancar.\n\n Yo lo llevo esculpido en el alma\n Y en el centro de mi coraz\u00f3n,\n S\u00e9 que ya no podr\u00e1 ni la muerte\n Arrancar de mi pecho este amor.\n\n CORO\n Yo en un tiempo trat\u00e9 de olvidarlo,\n No volverme a acordar de \u00e9l jam\u00e1s,\n Pero todo lo que hice fue in\u00fatil,\n Este amor no se puede olvidar.\n\n Hoy lo siento que hierve en mi sangre\n Con m\u00e1s fuerza y m\u00e1s intensidad\n Y es cual llama encendida en el alma\n Que con nada se puede apagar.\n\n II\n No hay pecados, ni faltas, ni ofensas,\n Que Jes\u00fas no pueda perdonar,\n El amor de Jes\u00fas es muy grande,\n Yo en mi vida no he visto otro igual.\n\n Si por Cristo Jes\u00fas me desprecian\n Y de muerte me llegan a odiar,\n Ya ni el mismo terror de la muerte\n Lo podr\u00e1 de mi pecho arrancar."},
{"id":146,"ti":"El Borde De Su Manto","tono":"C","estilo":"0","le":"I\n Si tan s\u00f3lo tocare el borde de su manto.\n Si tan s\u00f3lo pudiera ver su rostro.\n Si tan s\u00f3lo pudiera tocar sus manos.\n Libre ser\u00eda, yo s\u00e9.\n\n Si tan s\u00f3lo tocare el borde de su manto.\n Si tan s\u00f3lo pudiera o\u00edr su voz.\n Si tan s\u00f3lo pudiera acercarme a \u00c9l.\n Libre ser\u00eda, yo s\u00e9\n\n CORO:\n Porque delante de Ti,\n S\u00f3lo soy alguien que necesita:\n Un toque del maestro, para ser liberado.\n\n Porque delante de Ti,\n S\u00f3lo soy alguien que necesita:\n Una mirada de mi Salvador."},
{"id":147,"ti":"El Cielo Es El Trono De Mi Dios","tono":"C","estilo":"0","le":"El cielo es el trono de mi Dios,\n La tierra el estrado de sus pies\n Y siendo tan sublime mi Se\u00f1or\n A mi peque\u00f1o coraz\u00f3n vino a morar.\n\n \u00a1Oh qu\u00e9 grandeza! \u00a1Qu\u00e9 maravilla!\n Por eso yo no quiero m\u00e1s pecar,\n Yo quiero ser su santo templo\n Donde su Esp\u00edritu pueda morar."},
{"id":148,"ti":"El Cristo De Galilea","tono":"C","estilo":"0","le":"\/\/El Cristo de Galilea aqu\u00ed est\u00e1\/\/\n \/\/\/D\u00e9jalo que te toque\/\/\/\n Y recibe la bendici\u00f3n."},
{"id":149,"ti":"El Cristo De Poder","tono":"C","estilo":"0","le":"El Cristo de poder ese es mi Cristo,\n Tiene vida en abundancia para dar\n Levanta los muertos, les da vida\n Y les prepara una patria celestial."},
{"id":150,"ti":"El D\u00eda De Pentecost\u00e9s","tono":"C","estilo":"0","le":"Todos estaban reunidos,\n De pronto lleg\u00f3 la promesa,\n El Esp\u00edritu Santo cay\u00f3.\n\n Y todos hablaron en lenguas,\n El pueblo se maravill\u00f3,\n Cumplida estaba la promesa,\n El Esp\u00edritu Santo lleg\u00f3.\n\n Al reunirnos hoy aqu\u00ed,\n Conociendo sus promesas,\n Sentimos su grande poder;\n Maravillas veremos tambi\u00e9n.\n\n Hoy todos hablamos en lenguas;\n Es d\u00eda de Pentecost\u00e9s,\n Cumpli\u00e9ndose est\u00e1 la promesa:\n El Esp\u00edritu Santo est\u00e1 aqu\u00ed."},
{"id":151,"ti":"\u00c9l Es El Gran Yo Soy","tono":"C","estilo":"0","le":"\u00c9l es el gran \u201cYO SOY\u201d el Alfa y la Omega,\n El Rey de reyes, el todopoderoso,\n \u00c9l es el Padre eterno es nuestro consejero;\n Jes\u00fas es el gran \u201cYO SOY\u201d\n\n Oh, oh qui\u00e9n dicen que soy, cu\u00e1l es mi lugar;\n El nombre de mi Padre puedes t\u00fa encontrar,\n Toda la plenitud de Dios habita en Jes\u00fas,\n Es bienaventurado el que vive en plena luz.\n\n Jesucristo es el verdadero Dios,\n Es el Padre, es el Hijo y el Esp\u00edritu tambi\u00e9n,\n \u00danico Dios que existe desde el principio,\n Es el Verbo hecho carne tambi\u00e9n.\n\n Yo no creo en tres, yo no creo en dos,\n Jesucristo es uno, Jesucristo es Dios\n \/\/\u00c9l vive en mi alma y en mi coraz\u00f3n,\n Por eso yo digo Jesucristo es Dios\/\/\n\n Yo soy el que a Mois\u00e9s habl\u00f3 en la zarza que ardi\u00f3\n Yo soy el que a Josu\u00e9 encontr\u00f3 antes de Jeric\u00f3\n Yo soy aquel que dijo en el principio sea la luz\n Yo soy el creador del mundo y mi nombre es Jes\u00fas."},
{"id":152,"ti":"\u00c9l Es El Rey","tono":"C","estilo":"0","le":"\u00c9l es el rey infinito en poder,\n \u00c9l es el rey de los cielos,\n Ser\u00e9 para \u00e9l siervo fiel,\n Pues mi vida compr\u00f3 con su amor.\n\n \u00c9l es el rey, lo confiesa mi ser,\n \u00c9l es el rey, de los siglos,\n Mi vida la rindo a sus pies,\n \u00c9l es rey sobre mi coraz\u00f3n.\n\n \/\/\/\u00c9l es el rey\/\/\/ de mi vida\n \/\/\u00c9l es el rey\/\/ Reina con autoridad,\n Su reino eterno es, su trono el cielo es,\n \u00c9l es el rey, que viene a su pueblo a llevar."},
{"id":153,"ti":"\u00c9l Es Mi Paz","tono":"C","estilo":"0","le":"\/\/\u00c9l es mi paz, \u00c9l ha roto todas mis cadenas,\n \u00c9l es mi paz, \u00c9l es mi paz\/\/\n\n \/\/ Ech\u00f3 toda mi ansiedad sobre \u00c9l,\n Porque \u00c9l cuida de m\u00ed,\n \u00c9l es mi paz, \u00c9l es mi paz\/\/"},
{"id":154,"ti":"El Esp\u00edritu De Dios Est\u00e1","tono":"C","estilo":"0","le":"El Esp\u00edritu de Dios est\u00e1 en este lugar,\n El Esp\u00edritu de Dios se mueve en este lugar\n Est\u00e1 aqu\u00ed para consolar,\n Est\u00e1 aqu\u00ed para liberar,\n Est\u00e1 aqu\u00ed para guiar,\n El Esp\u00edritu de Dios est\u00e1 aqu\u00ed.\n\n Mu\u00e9vete en m\u00ed, mu\u00e9vete en m\u00ed,\n Toma mi mente mi coraz\u00f3n\n Llena mi vida de tu amor\n Mu\u00e9vete en m\u00ed,\n Santo Esp\u00edritu, Mu\u00e9vete en m\u00ed.\n\n Qu\u00e9date en m\u00ed, qu\u00e9date en m\u00ed,\n Toma mi mente mi coraz\u00f3n\n Llena mi vida de tu amor,\n Qu\u00e9date en m\u00ed,\n Santo Esp\u00edritu, qu\u00e9date en m\u00ed."},
{"id":155,"ti":"El Esp\u00edritu De Dios Se Mueve","tono":"C","estilo":"0","le":"El Esp\u00edritu de Dios \/\/\/se mueve\/\/\/\n El Esp\u00edritu de Dios se mueve,\n Dentro de mi coraz\u00f3n.\n\n Oh hermano deja que \/\/\/se mueva\/\/\/\n Oh hermano deja que se mueva\n Dentro de tu coraz\u00f3n."},
{"id":156,"ti":"El Gozo Que Siento Yo","tono":"C","estilo":"0","le":"El gozo que siento yo\n \/\/el mundo no me lo dio\/\/\n \/\/y como no me lo dio\n No me lo puede quitar\/\/\n\n Si empezamos a cantar esta tierra tiembla\n Si empezamos a orar hablaremos nuevas lenguas\n \/\/El\u00edas or\u00f3 y el fuego cay\u00f3\n Or\u00f3 Josu\u00e9 y el sol se par\u00f3\/\/"},
{"id":157,"ti":"El Himno De Victoria","tono":"C","estilo":"0","le":"\u00c9l es el hombre que tuvo poder\n De andar sobre el mar,\n \u00c9l es el que puede hacer el mar callar.\n En el momento que la tempestad te quiera hundir,\n \u00c9l viene con toda autoridad y manda calma.\n\n \u00c9l es el hombre que tuvo poder de hacer a Israel\n Caminar por entre las aguas del mar Rojo\n Hizo un camino en medio del mar\n Para el pueblo de Israel pasar\n Y al otro lado con sus pies secos\n Pudieron cantar\u2026El Himno de Victoria.\n\n Cuando t\u00fa est\u00e9s frente al mar\n Y lo tengas que atravesar,\n Llama a este hombre con fe,\n S\u00f3lo \u00c9l abre el mar.\n\n Hermano no tengas temor si detr\u00e1s viene Fara\u00f3n,\n Al otro lado t\u00fa pasar\u00e1s y all\u00ed t\u00fa vas a entonar\u2026\n El Himno de Victoria\n\n Cada vez que el mar Rojo t\u00fa tengas que pasar,\n llama siempre a este hombre que te va a ayudar\n En la hora m\u00e1s dif\u00edcil es cuando \u00c9l te ve,\n llama siempre a este hombre que tiene el poder.\n Si t\u00fa pasas por el fuego no te vas a quemar,\n Y si pasas por las aguas no te ahogar\u00e1s,\n Pasa como Israel que el mar atraves\u00f3,\n Y en el nombre del Se\u00f1or el Himno de Victoria\n \/\/\/Del otro lado cant\u00f3\/\/\/"},
{"id":158,"ti":"El Mundo Necesita","tono":"C","estilo":"0","le":"El mundo necesita conocer a Dios,\n Conocer a Dios para la salvaci\u00f3n\n\n \/\/Prediquemos que Cristo,\n Sana a los enfermos,\n Perdona los pecados\n Y da la salvaci\u00f3n\/\/"},
{"id":159,"ti":"El Nombre De Jes\u00fas","tono":"C","estilo":"0","le":"El nombre de Jes\u00fas es poder,\n El nombre de Jes\u00fas victoria es,\n El nombre de Jes\u00fas levantado est\u00e1,\n El nombre de Jes\u00fas sublime es.\n\n Yo le canto y le alabo,\n Yo le exalto y le adoro,\n Porque el nombre de Jes\u00fas es poder."},
{"id":160,"ti":"El Poder Del Cristiano","tono":"C","estilo":"0","le":"El poder del cristiano est\u00e1 en la oraci\u00f3n,\n El que ora constante,\n Vencer\u00e1 en todo tiempo la tentaci\u00f3n.\n\n El poder del cristiano est\u00e1 en Jes\u00fas\n Y Cristo nos dijo orad \/\/siempre\/\/\n Porque la respuesta est\u00e1 en la oraci\u00f3n.\n\n Y el enemigo caer\u00e1 vencido,\n Caer\u00e1 ante tus pies,\n En toda lucha y en toda prueba,\n T\u00fa podr\u00e1s vencer\n Si oras ferviente,\n Con toda tu mente y tu coraz\u00f3n,\n Las fuerzas del mal querr\u00e1n destruirte\n Y tu fe herirte, pero no podr\u00e1n."},
{"id":161,"ti":"El Poderoso De Israel","tono":"C","estilo":"0","le":"Y de noche cantaremos celebrando su poder\n Con alegr\u00eda de coraz\u00f3n\n Como el que va con la flauta al monte de Jehov\u00e1\n Celebraremos su poder.\n\n \/\/\u00c9l es el poderoso de Israel,\n El poderoso de Israel,\n Su voz se oir\u00e1 nadie lo detendr\u00e1\n Al poderoso de Israel\/\/\n\n Y los ojos de los ciegos se abrir\u00e1n ellos ver\u00e1n,\n Los o\u00eddos de los sordos oir\u00e1n,\n El cojo saltar\u00e1 con el arpa danzar\u00e1,\n La lengua de los mudos cantar\u00e1."},
{"id":162,"ti":"\u00c9l Puede","tono":"C","estilo":"0","le":"\/\/\u00c9l puede\/\/, yo s\u00e9 que \u00e9l puede.\n Yo s\u00e9 que todo puede mi Jes\u00fas.\n\n San\u00f3 a los quebrantados, cautivos del pecado,\n A los ciegos les dio la vista y a los cojos hace andar."},
{"id":163,"ti":"El Se\u00f1or Es Mi Pastor","tono":"C","estilo":"0","le":"\/\/El Se\u00f1or es mi pastor\/\/\n Nada me faltar\u00e1\n \/\/El Se\u00f1or es mi pastor\/\/\n En pastos delicados \u00c9l me har\u00e1 descansar.\n\n Junto a aguas de reposo me pastorear\u00e1,\n Confortar\u00e1 mi alma,\n Me guiar\u00e1 por sendas de justicia,\n Por amor de su Nombre."},
{"id":164,"ti":"El Se\u00f1or Es Mi Rey","tono":"C","estilo":"0","le":"El Se\u00f1or es mi Rey, mi todo,\n El Se\u00f1or es mi luz, mi Rey,\n El que hace vibrar de gozo,\n El que gu\u00eda mis pasos,\n El que extiende sus brazos,\n El creador de los cielos."},
{"id":165,"ti":"El Se\u00f1or Est\u00e1 En Est\u00e1 Este Lugar","tono":"C","estilo":"0","le":"\/\/El Se\u00f1or est\u00e1 en este lugar\/\/\n Para sanar, para librar,\n Para romper toda obra de maldad,\n Para sanar, para librar, mi alma."},
{"id":166,"ti":"El Todopoderoso Reina","tono":"C","estilo":"0","le":"Derramando nuestros corazones delante del trono,\n cantemos como estruendo de grandes aguas.\n \/\/\/Porque el Se\u00f1or todo poderoso reina\/\/\/\n Y la tierra se estremezca con un r\u00edo de alabanza,\n cantando aleluya postrados ante el trono.\n \/\/\/Porque el Se\u00f1or todo poderoso reina\/\/\/\n\n Aleluya, aleluya, peque\u00f1os y grandes.\n Aleluya, aleluya, levanten su voz.\n Aleluya, aleluya, destruyan tinieblas.\n Aleluya, aleluya den gloria al Se\u00f1or.\n \/\/\/Porque el Se\u00f1or todo poderoso reina\/\/\/"},
{"id":167,"ti":"El Victorioso","tono":"C","estilo":"0","le":"\/\/El victorioso vive en m\u00ed\/\/\n Las circunstancias no me mueven a m\u00ed,\n El victorioso vive en m\u00ed.\n\n \/\/Yo cantar\u00e9, y danzar\u00e9,\n Celebrar\u00e9 la victoria del Se\u00f1or,\n No temer\u00e9 al pelear,\n Pues la victoria es del Se\u00f1or\/\/"},
{"id":168,"ti":"El\u00edas Oraba","tono":"C","estilo":"0","le":"\/\/El\u00edas oraba en el monte Carmelo\n Para que el fuego bajara desde el cielo\/\/\n \/\/Y cuando \u00e9l or\u00f3 el fuego baj\u00f3\n Y todo el holocausto all\u00ed se consumi\u00f3\/\/\n \/\/pero que baje el fuego que se encienda la llama,\n Se encienda la llama con su poder\/\/\n \/\/No te dejar\u00e9 si no me bendices\u2026\n No te dejar\u00e9 aunque raye el alba\/\/\n \/\/bend\u00edceme, bend\u00edceme, bend\u00edceme ahora\/\/\n \/\/Ahora, ahora bend\u00edceme ahora\/\/"},
{"id":169,"ti":"En El Altar De Dios","tono":"C","estilo":"0","le":"\/\/En el altar de Dios, En el altar de Dios\n El fuego est\u00e1 encendido\/\/\n\n \/\/Nadie lo podr\u00e1 apagar\n Nadie lo podr\u00e1 apagar\n Porque el fuego del Se\u00f1or\n En mi coraz\u00f3n est\u00e1\/\/\n\n \/\/Estar\u00e1s t\u00fa velando como las diez v\u00edrgenes\/\/\n Que a media noche lleg\u00f3 el esposo\n Y las que estaban apercibidas fueron con \u00c9l."},
{"id":170,"ti":"En El Hogar","tono":"C","estilo":"0","le":"\/\/\/En el hogar\/\/\/\n T\u00fa necesitas a Jes\u00fas\n \/\/Y veras que bien se vive\/\/\n Con Jes\u00fas en el hogar.\n\n \/\/\/Al trabajar\/\/\/\n T\u00fa necesitas a Jes\u00fas\n \/\/Y veras que bien se vive\/\/\n Con Jes\u00fas al trabajar."},
{"id":171,"ti":"En El Principio El Esp\u00edritu De Dios","tono":"C","estilo":"0","le":"\/\/En el principio el Esp\u00edritu de Dios,\n Se mov\u00eda sobre las aguas\/\/\n\n \/\/Pero ahora se est\u00e1 moviendo,\n Dentro de mi coraz\u00f3n\/\/"},
{"id":172,"ti":"En Ese Nombre Hay Poder","tono":"C","estilo":"0","le":"\/\/En ese nombre hay poder,\n En ese nombre hay poder,\n En el nombre de Jes\u00fas\/\/\n\n \/\/S\u00ed, somos salvos y bautizados\n En el nombre de Jes\u00fas\/\/"},
{"id":173,"ti":"En Esta Reuni\u00f3n","tono":"C","estilo":"0","le":"En esta reuni\u00f3n Cristo est\u00e1\n Pues \u00c9l ha prometido estar,\n Donde dos o tres en mi Nombre est\u00e9n\n \/\/\/all\u00ed estar\u00e9\/\/\/\n\n \/\/Yo lo siento en m\u00ed, yo lo siento en m\u00ed,\n Por su Esp\u00edritu puedo cantar\/\/"},
{"id":174,"ti":"En Israel Es Grande Su Nombre","tono":"C","estilo":"0","le":"\/\/En Israel es grande su nombre,\n Dios es conocido en Jud\u00e1\/\/\n\n \/\/\u00a1Cu\u00e1n glorioso eres T\u00fa!\n \u00a1Majestuoso es tu nombre!\n Temible en toda la tierra,\n Su nombre santo es\/\/\n\n \/\/\/\/\/\/\/Digno\/\/\/\/\/\/\/ \n Eres T\u00fa Jehov\u00e1,\n \/\/Jehov\u00e1 es la fortaleza de mi vida\n De qui\u00e9n he de temer\/\/"},
{"id":175,"ti":"En La Presencia De Dios","tono":"C","estilo":"0","le":"En la presencia de Dios,\n se quita todo dolor,\n Se quita todo temor,\n en la presencia de Dios.\n\n \/\/Y un d\u00eda estaremos,\n para siempre con Jes\u00fas,\n en la presencia de Dios\/\/"},
{"id":176,"ti":"En Lo Secreto","tono":"C","estilo":"0","le":"I\n En lo secreto contigo quiero estar,\n Quiero tener intimidad con tu verdad.\n En lo secreto all\u00ed en tu altar,\n Puedes abrir mi coraz\u00f3n y trabajar.\n\n Restaura mi interior,\n Con tus manos de amor.\n Solo busco ser m\u00e1s como T\u00fa.\n\n CORO\n En mi habitaci\u00f3n o en la multitud, te adoro.\n En lo secreto te adoro.\n En mi habitaci\u00f3n o en la multitud, me rindo.\n Solo t\u00fa eres digno.\n\n II\n Solo en mi habitaci\u00f3n\n Puedo ver tu coraz\u00f3n\n Y la respuesta a mi oraci\u00f3n.\n\n Solo quiero estar contigo,\n Solo T\u00fa eres mi abrigo,\n Solo T\u00fa, Jes\u00fas."},
{"id":177,"ti":"En Los Montes, En Los Valles","tono":"C","estilo":"0","le":"\/\/Oh, oh, oh, oh, oh, oh, oh\/\/\n\n En los montes, en los Valles\n Exaltamos al que es digno de alabanza,\n En las costas de los mares\n Levantamos un sonido de esperanza,\n Aclamamos, aclamamos\n Hacemos o\u00edr la voz de su alabanza,\n Con las manos en lo alto\n Exaltamos el que reina para siempre.\n\n Subamos a adorar en el monte de Sion,\n Es el gozo de toda naci\u00f3n,\n Donde la tristeza es gozo, el llanto es alegr\u00eda\n Subamos a adorar al gran Rey."},
{"id":178,"ti":"En Mi Coraz\u00f3n Hay Banderas","tono":"C","estilo":"0","le":"En mi coraz\u00f3n hay \/\/\/Banderas de amor\/\/\/\n En mi coraz\u00f3n, hay banderas de amor,\n Pues Cristo ya vive en m\u00ed.\n\n \u00c1lzalas bien arriba, \/\/\/Que todos vean\/\/\/\n \u00c1lzalas bien arriba, que todos vean,\n Que Cristo ya vive en ti."},
{"id":179,"ti":"En Tus Manos Se\u00f1or","tono":"C","estilo":"0","le":"\/\/En tus manos Se\u00f1or pongo mi vida ahora,\n Habla conmigo en esta hora\n En que mi coraz\u00f3n anhela o\u00edr tu voz\/\/\n\n \/\/\/Se\u00f1or habla conmigo ahora\/\/\/\n En que mi coraz\u00f3n anhela o\u00edr tu voz."},
{"id":180,"ti":"Enamorarme De Ti","tono":"C","estilo":"0","le":"Quiero entregarte mis sue\u00f1os,\n Tu voluntad has en ellos,\n Mi coraz\u00f3n te lo entrego,\n Enam\u00f3rame de Ti\u2026\n\n Quiero aprender a escucharte,\n Quiero saber qu\u00e9 es amarte,\n De tu verdad yo saciarme,\n Enam\u00f3rame de Ti Se\u00f1or.\n\n Que tu presencia me inunde,\n Haz de m\u00ed un odre nuevo,\n C\u00e1mbiame, renu\u00e9vame\n \/\/Enam\u00f3rame\/\/ de Ti Se\u00f1or"},
{"id":181,"ti":"Enciende Una Luz","tono":"C","estilo":"0","le":"Enciende una luz d\u00e9jala brillar,\n La luz de Jes\u00fas que brille en todo lugar,\n No la puedes esconder no te puedes callar\n Ante tal necesidad enciende una luz en la oscuridad.\n\n C\u00f3mo pues invocaran a aquel en quien no han cre\u00eddo\n Y c\u00f3mo creer\u00e1n en aquel de quien no han o\u00eddo\n Y como oir\u00e1n sin nadie les predica,\n Hermosos son los pies de los que anuncia la paz\n las buenas nuevas de Jes\u00fas."},
{"id":182,"ti":"Ens\u00e9\u00f1ame","tono":"C","estilo":"0","le":"Ens\u00e9\u00f1ame tu camino se\u00f1or\n Y andar\u00e9 en tu luz,\n Dame un coraz\u00f3n entregado a Ti\n Para honrarte oh Dios.\n\n Purif\u00edcame, l\u00edmpiame Se\u00f1or\n Y l\u00edbrame de lo que impida\n El fluir de tu amor."},
{"id":183,"ti":"Entra En La Presencia","tono":"C","estilo":"0","le":"Entra en la presencia del Se\u00f1or con gratitud\n Y ad\u00f3rale de coraz\u00f3n.\n Entra en la presencia del Se\u00f1or con gratitud\n Y alza tu voz con j\u00fabilo.\n\n \/\/Dad gloria y honra y alabanza al Se\u00f1or\n \u00a1Jesucristo nombre sin igual!\/\/"},
{"id":184,"ti":"Enviado Soy De Dios","tono":"C","estilo":"0","le":"\/\/Enviado soy de Dios, mi mano lista est\u00e1,\n Para construir con \u00c9l un mundo fraternal\/\/\n\n Los \u00e1ngeles no son enviados a cambiar\n Un mundo de dolor por un mundo de paz,\n Me ha tocado a m\u00ed hacerlo realidad,\n Dispuesto estoy se\u00f1or a hacer tu voluntad."},
{"id":185,"ti":"Era Una Escalera","tono":"C","estilo":"0","le":"\/\/Era una escalera que Jacob ve\u00eda\/\/\n \/\/\u00c1ngeles bajaban, \u00e1ngeles sub\u00edan\/\/\n\n \/\/Pero era la Gloria de Dios,\n Pero era la Gloria de Dios,\n Pero era la Gloria de Dios\n Lo que Jacob ve\u00eda\/\/\n\n \/\/En el salmo 22 la biblia lo testifica\/\/\n \/\/\u00c9l habita en la alabanza,\n En la alabanza \u00c9l habita\/\/\n\n \/\/Y si le alabas te gozas, y si le alabas\/\/\n\n \/\/Aquel que camin\u00f3 sobre las aguas\/\/\n Est\u00e1 aqu\u00ed, aqu\u00ed caminando.\n \u00c9l est\u00e1 aqu\u00ed, aqu\u00ed caminando.\n Est\u00e1 a tu lado, est\u00e1 a mi lado,\n Lo sientes t\u00fa, lo siento yo,\n Aqu\u00ed, aqu\u00ed est\u00e1 Jes\u00fas,\n Aqu\u00ed, aqu\u00ed caminando.\n\n \/\/Ya viene mi Jes\u00fas a levantar su pueblo\n Seguro que con \u00c9l, elevar\u00e9 mi vuelo\/\/\n \/\/Me voy con \u00c9l, con \u00c9l me voy\/\/\n Yo no me qued\u00f3 aqu\u00ed sufriendo en este suelo,\n Seguro que con \u00c9l elevar\u00e9 mi vuelo. "},
{"id":186,"ti":"Eres Mi Respirar","tono":"C","estilo":"0","le":"\/\/Eres mi respirar\/\/\n Dios tu presencia vive en m\u00ed.\n\n \/\/Eres mi pan Se\u00f1or\/\/\n Dios tus palabras fluyen en m\u00ed.\n\n Y yo te anhelo Se\u00f1or;\n Estoy perdido sin Ti."},
{"id":187,"ti":"Eres Mi Roca","tono":"C","estilo":"0","le":"Eres mi luz Se\u00f1or que alumbra mi ser;\n Eres T\u00fa mi amor que conmueves mi vida hasta sentirte.\n Eres refugio Se\u00f1or, castillo fuerte a mi alrededor;\n Fortaleces mi vida, ahora soy fuerte.\n\n La oscuridad lleg\u00f3, pero no hay temor,\n Todo lo puedo ver, porque T\u00fa me has ayudado.\n Viene la tentaci\u00f3n, pero aqu\u00ed est\u00e1s Se\u00f1or,\n Contigo soy \/\/vencedor\/\/\n\n Eres mi roca, eres mi fuerza,\n Donde corre el justo y levantado ser\u00e1."},
{"id":188,"ti":"Eres T\u00fa","tono":"C","estilo":"0","le":"Jes\u00fas T\u00fa eres el amigo que me ama,\n Jes\u00fas T\u00fa eres la esperanza de mi vida\n \/\/\/eres\/\/\/ T\u00fa,\n \/\/eres\/\/ T\u00fa\n\n Jes\u00fas T\u00fa eres el camino y la vida,\n Jes\u00fas T\u00fa eres salvaci\u00f3n y alegr\u00eda\n \/\/\/eres\/\/\/ T\u00fa,\n \/\/eres\/\/ T\u00fa\n\n \/\/T\u00fa eres Rey, eres Se\u00f1or\n Y en una cruz fuiste a vencer;\n Engrandecido eres Dios,\n Te levantaste con poder\/\/"},
{"id":189,"ti":"Eres T\u00fa La \u00danica Raz\u00f3n","tono":"C","estilo":"0","le":"Eres T\u00fa la \u00fanica raz\u00f3n de mi adoraci\u00f3n \u00a1Oh Jes\u00fas!\n Eres T\u00fa la esperanza que anhele tener \u00a1Oh Jes\u00fas!\n\n Confi\u00e9 en Ti me has ayudado,\n tu salvaci\u00f3n me has regalado\n Hoy hay gozo en mi coraz\u00f3n,\n con mi canto te alabar\u00e9.\n\n Te alabar\u00e9, te glorificar\u00e9\n Te alabar\u00e9 mi buen Jes\u00fas."},
{"id":190,"ti":"Es Hora De Alabar A Dios","tono":"C","estilo":"0","le":"\/\/Es hora de alabar a Dios,\n Es hora de glorificarle\n Es hora de decirle te amo\n Es hora de invocar su Nombre\/\/\n\n Y con las manos levantadas\n Te adoramos y te bendecimos,\n Hoy todos juntos te amamos\n E invocamos tu glorioso Nombre."},
{"id":191,"ti":"Es Hora De Cantar. Canci\u00f3n Lema: Ipuc 80 A\u00f1os","tono":"C","estilo":"0","le":"\/\/Es hora de celebrar,\n Es hora de cantar:\n Ya son ochenta a\u00f1os\n Que cumple la Iglesia Pentecostal\/\/\n\n\/\/Es hora de recordar\n Que Dios nos quiso salvar.\n Y a Colombia un misionero\n Lleno de su gloria, envi\u00f3 a predicar\/\/\n\n Lo supieron ayer,\n Que lo sepan hoy\n Y tambi\u00e9n ma\u00f1ana.\n Que lo sepa el mundo\n Y la generaci\u00f3n que ha de venir.\n\n Predicaron ayer,\n Predicamos hoy,\n Y lo har\u00e1n ma\u00f1ana.\n Que lo sepa el mundo\n Y la generaci\u00f3n que ha de venir.\n\n Que Jesucristo es el Se\u00f1or,\n Que Jesucristo es el Salvador,\n Que Jesucristo es el Rey de la gloria\n Y nos dio salvaci\u00f3n.\n\n Que Jesucristo es el Se\u00f1or,\n Que Jesucristo es el Salvador,\n Que Jesucristo es el Rey de la gloria\n El que da salvaci\u00f3n."},
{"id":192,"ti":"Es Jesucristo, Jehov\u00e1 La Roca","tono":"C","estilo":"0","le":"Es Jesucristo, Jehov\u00e1 la Roca,\n Por toda la eternidad,\n Mi escondedero y mi refugio,\n Eres T\u00fa bendito Jehov\u00e1,\n En tu palabra esperar\u00e9,\n Y mi confianza en Ti pondr\u00e9,\n Oh gloria, gloria, oh aleluya, \/\/\/\/am\u00e9n\/\/\/\/"},
{"id":193,"ti":"Es Necesario Que T\u00fa Crezcas","tono":"C","estilo":"0","le":"Es necesario que T\u00fa crezcas\n Y que yo meng\u00fce Se\u00f1or,\n Que te entregue a Ti mi vida\n Y que T\u00fa seas mi Se\u00f1or.\n\n Que no quede nada, que todo te entregue,\n Que no quede nada para m\u00ed,\n Porque es necesario que T\u00fa crezcas\n Y que yo meng\u00fce Se\u00f1or."},
{"id":194,"ti":"Es Un Canto De Libertad","tono":"C","estilo":"0","le":"Es un canto de libertad\n Que sus melod\u00edas resuenan,\n Es un canto de libertad\n Que de paz el alma llena,\n Es un canto de libertad\n Proclamarlo \u00c9l me ordena,\n Aleluya, aleluya es un canto de libertad.\n\n Libre \/\/T\u00fa me hiciste libre\/\/ libre Se\u00f1or,\n Rotas fueron las cadenas\n Que estaban atando a mi coraz\u00f3n.\n\n Donde est\u00e1 el Esp\u00edritu de Dios\n Hay libertad, hay libertad,\n Donde est\u00e1 el Esp\u00edritu de Dios,\n All\u00ed siempre hay libertad.\n\n \/\/\/\/Libertad\/\/\/\/\n Donde est\u00e1 el Esp\u00edritu de Dios,\n All\u00ed siempre hay libertad."},
{"id":195,"ti":"Escalando Pelda\u00f1os","tono":"C","estilo":"0","le":"\/\/Vamos escalando pelda\u00f1os,\n Vamos llevando la cruz,\n Seguimos el camino angosto\n Con Cristo es mucho mejor\/\/\n\n Ya viene la recompensa,\n Ya no voy a llorar,\n Tengo a Cristo en mi vida\n Por eso puedo escalar.\n\n \/\/A veces me siento d\u00e9bil\n Ya no puedo escalar,\n Levanto mis manos al cielo\n Y Cristo fuerzas me da\/\/"},
{"id":196,"ti":"Esc\u00f3ndete En La Mano Del Se\u00f1or","tono":"C","estilo":"0","le":"Esc\u00f3ndete en la mano del Se\u00f1or,\n Y deja que su amor llene tu vida,\n \u00bfY qui\u00e9n podr\u00e1 arrancarte de su mano de poder?\n Ni diablo, ni hombre, ni nada creado.\n\n Esc\u00f3ndete en la mano del Se\u00f1or,\n Y deja que los vientos y los r\u00edos,\n Destruyan lo que encuentren a su paso,\n Pero tranquilo t\u00fa, t\u00fa est\u00e1s en las manos de Jes\u00fas.\n\n \/\/\u00bfQui\u00e9n me separar\u00e1 de ti?\/\/\n Si yo en tu mano me escond\u00ed,\n \u00bfQui\u00e9n me separar\u00e1 de ti?"},
{"id":197,"ti":"Esperar En Ti","tono":"C","estilo":"0","le":"Esperar en Ti, dif\u00edcil s\u00e9 que es\n Mi mente dice no, no es posible\n Pero mi coraz\u00f3n confiado esta en Ti,\n T\u00fa siempre has sido fiel me has sostenido.\n\n Y esperar\u00e9 pacientemente,\n Aunque la duda me atormente,\n Yo no confi\u00f3 con la mente,\n Lo hago con el coraz\u00f3n\n\n Y esperar\u00e9 en la tormenta\n Aunque tardare tu respuesta\n Yo confiar\u00e9 en tu providencia,\n T\u00fa siempre tienes el control."},
{"id":198,"ti":"Espero Por Ti","tono":"C","estilo":"0","le":"Aunque la visi\u00f3n tardare, siempre en Ti he de esperar,\n Aunque muchos tengan dudas, mi confianza en Ti estar\u00e1;\n Si las fuerzas me faltaran, fortaleza T\u00fa me das,\n Aunque llueva y haga fr\u00edo he de esperar.\n\n Espero por Ti, vivo por Ti,\n T\u00fa volver\u00e1s, s\u00e9 que vendr\u00e1s.\n Espero por Ti, vivo por Ti,\n T\u00fa volver\u00e1s, no fallar\u00e1s.\n\n \/\/Vuelve, oh vuelve, te anhelo, te espero\/\/"},
{"id":199,"ti":"Esp\u00edritu De Dios","tono":"C","estilo":"0","le":"\/\/Esp\u00edritu de Dios, llena mi vida,\n Llena mi alma, llena mi ser\/\/\n\n \/\/ll\u00e9name\/\/ de tu presencia,\n \/\/ll\u00e9name\/\/ de tu poder,\n \/\/ll\u00e9name\/\/ de tu amor."},
{"id":200,"ti":"Esp\u00edritu De Dios Desciende Sobre M\u00ed","tono":"C","estilo":"0","le":"\/\/Esp\u00edritu de Dios desciende sobre m\u00ed\n Y dame tu poder para poder vencer\/\/\n\n \/\/Yo s\u00e9 que Cristo viene y espero su venida\/\/\n Y el que est\u00e9 preparado con \u00c9l se ir\u00e1\n \/\/\/\/para arriba\/\/\/\/ y no para abajo\n \/\/\/Subiendo\/\/\/ y no bajando."},
{"id":201,"ti":"Esp\u00edritu Divino Ven A Mi Coraz\u00f3n","tono":"C","estilo":"0","le":"I\n \/\/Esp\u00edritu divino ven a mi coraz\u00f3n,\n Ven que te estoy llamando, escucha mi clamor\/\/\n\n CORO\n \/\/Si tus fuerzas quieres darme no te apartes de m\u00ed\n Te necesito Esp\u00edritu de Dios\/\/\n\n II\n \/\/T\u00fa eres mi fortaleza y mi ayudador,\n Ay\u00fadame en las pruebas y en la tribulaci\u00f3n\/\/"},
{"id":202,"ti":"Esta Alabanza Es","tono":"C","estilo":"0","le":"Esta alabanza es para alabar a Dios,\n Si t\u00fa le alabas tambi\u00e9n sientes lo mismo que yo.\n \/\/Siento que el Esp\u00edritu Santo\n Se est\u00e1 derramando en mi coraz\u00f3n\n Y que una luz desde el cielo\n Est\u00e1 vislumbrando en la casa de Dios\/\/\n\n \/\/Estaban todos un\u00e1nimes en ruego y oraci\u00f3n\/\/\n \/\/Y desde el cielo baj\u00f3 el Esp\u00edritu Santo\/\/\n Esp\u00edritu Santo \/\/\/ll\u00e9name\/\/\/\n Esp\u00edritu Santo ll\u00e9name, ll\u00e9name de tu amor.\n\n \/\/Yo siento que Cristo est\u00e1\n Llen\u00e1ndome de poder\/\/\n \/\/Llen\u00e1ndome de poder\n Yo siento que Cristo est\u00e1\/\/"},
{"id":203,"ti":"Esta Es La Iglesia Del Se\u00f1or","tono":"C","estilo":"0","le":"Esta es la iglesia del Se\u00f1or,\n Casa de Dios, puerta del cielo,\n \u00c9l la llam\u00f3 su casa de oraci\u00f3n\n Porque esta es la Iglesia del Se\u00f1or.\n\n Ven, ven, ven, Cristo a ti te llama;\n Ven, ven, ven, no tardes ma\u00f1ana,\n No te olvides que por ti muri\u00f3\n Para darte vida paz eterna y salvaci\u00f3n."},
{"id":204,"ti":"Estamos De Fiesta Con Jes\u00fas","tono":"C","estilo":"0","le":"Estamos de fiesta con Jes\u00fas,\n Al cielo queremos ir\n Y todos reunidos en la fiesta,\n Es Cristo que va a venir.\n\n \/\/\/\/Poderoso es nuestro Dios\/\/\/\/\n \u00c9l sana, \u00c9l salva,\n \/\/\/\/\/Poderoso es nuestro Dios\/\/\/\/\/"},
{"id":205,"ti":"Estamos Juntos Otra Vez","tono":"C","estilo":"0","le":"\/\/Estamos juntos otra vez alabando al Se\u00f1or\n Estamos juntos otra vez en unidad\/\/\n\n Algo nuevo va suceder el Se\u00f1or lo prepar\u00f3,\n Estamos juntos otra vez alabando al Se\u00f1or."},
{"id":206,"ti":"Estamos Reunidos","tono":"C","estilo":"0","le":"Estamos reunidos hoy aqu\u00ed Se\u00f1or,\n Porque hemos conocido tu amor\n Traemos en nuestros labios\n Un nuevo c\u00e1ntico de loor\n Pues tu gloria ha llenado este lugar."},
{"id":207,"ti":"Este Avivamiento","tono":"C","estilo":"0","le":"Este avivamiento \/\/\/\u00bfqui\u00e9n lo apagar\u00e1?\/\/\/\n S\u00ed, el se\u00f1or lo ha dado \/\/\/permanecer\u00e1\/\/\/\n Ni la prueba ni la lucha,\n Nada lo podr\u00e1 apagar,\n Manda el fuego santif\u00edcanos Se\u00f1or\n\n No vivo yo, mas Cristo vive en m\u00ed\n \/\/\/Para m\u00ed el vivir es \u00c9l\/\/\/\n Para m\u00ed el vivir es Cristo."},
{"id":208,"ti":"Este Culto","tono":"C","estilo":"0","le":"\/\/Este culto est\u00e1 maravilloso\n Porque Dios va a derramar de su poder\/\/\n\n \/\/Derrama Se\u00f1or, derrama Se\u00f1or\n Derrama de tu Esp\u00edritu Se\u00f1or\/\/"},
{"id":209,"ti":"Este Es Mi Deseo","tono":"C","estilo":"0","le":"Este es mi deseo: honrarte a Ti,\n Con todo mi ser te adoro a Ti,\n Con todas mis fuerzas te alabar\u00e9,\n Mi adoraci\u00f3n eres T\u00fa.\n\n \/\/Hoy te rindo mi ser, te doy mi coraz\u00f3n,\n Yo vivo para Ti en cada palpitar,\n Mientras haya aliento en m\u00ed,\n Dios, haz tu obra en m\u00ed\/\/"},
{"id":210,"ti":"Estoy Alegre","tono":"C","estilo":"0","le":"Estoy \/\/alegre\/\/ muy alegre,\n Jes\u00fas llev\u00f3 mis cargas las sepult\u00f3 en la mar.\n\n \/\/Las sepult\u00f3 en la mar\/\/\n Jes\u00fas llev\u00f3 mis cargas las sepult\u00f3 en la mar."},
{"id":211,"ti":"Estoy Alegre Porque Cristo Me Salv\u00f3","tono":"C","estilo":"0","le":"Estoy alegre, alegre, muy alegre,\n Estoy alegre, alegre estoy yo,\n Estoy alegre, alegre, muy alegre,\n Estoy alegre porque Cristo me salv\u00f3.\n Oh \u00a1gloria a Dios!\n\n Por eso canto, yo canto aleluya,\n Por eso canto, yo canto gloria a Dios,\n Por eso canto yo canto aleluya\n Por eso canto porque Cristo me salv\u00f3\n Oh \u00a1gloria a Dios!"},
{"id":212,"ti":"Exaltado Sea Dios","tono":"C","estilo":"0","le":"Yo te doy las gracias\n Oh se\u00f1or entre los pueblos\n Y te canto alabanzas\n Entre naciones.\n\n Pues tu amor es fiel y grande\n Es grande hasta el cielo\n Y tu lealtad tu fidelidad hasta las nubes.\n\n Exaltado sea Dios sobre los cielos\n Y su gloria est\u00e9 sobre la tierra.\n\n Exaltado sea Dios sobre los cielos\n \/\/\/Y su gloria\/\/\/ est\u00e9 sobre la tierra."},
{"id":213,"ti":"Exquisita Presencia","tono":"C","estilo":"0","le":"\/\/Exquisita presencia, presencia de Dios\n Llena mi vida de tu amor\/\/\n\n \/\/Llena mi vida, \u00a1oh Se\u00f1or! ll\u00e9nala de Ti,\n Exquisita presencia, presencia de Dios\/\/"},
{"id":214,"ti":"Fe Que Mueve Monta\u00f1as","tono":"C","estilo":"0","le":"Mi vida doy por Ti,\n Tratando de alcanzar el objetivo real,\n Es por quien vivo.\n\n Nada me apartar\u00e1 de poder recibir\n Lo que me has dado a mi vivo para Ti\n M\u00e1s grande es el que vive en m\u00ed,\n Que el que en el mundo est\u00e1\n\n Fe que mueve las monta\u00f1as,\n Yo lo puedo en Jes\u00fas,\n Lo s\u00e9,\n Fe, firme y creyendo,\n Yo lo puedo en Jes\u00fas\n \u00c9l vive en m\u00ed... Fe"},
{"id":215,"ti":"Fiesta","tono":"C","estilo":"0","le":"Los ni\u00f1os danzan, los j\u00f3venes y viejos declaramos:\n \u00abQue en este lugar hay fiesta\u00bb\n\n Hay \/\/fiesta\/\/ en el pueblo santo\n Hay \/\/fiesta\/\/ en los esforzados\n Los ni\u00f1os danzan, los j\u00f3venes y viejos declaramos:\n \u00abQue en este lugar hay fiesta\u00bb\n\n \/\/Quiero alabarle, quiero gozarme,\n Con alegr\u00eda quiero danzarle,\n Mi Dios es bueno, todo el tiempo\n Quiero danzar y alabar sin parar\/\/\n\n Quiero alabarle\u2026 Vivo en victoria cada d\u00eda\n Quiero alabarle\u2026 Llen\u00f3 mi vida de alegr\u00eda\n Quiero alabar con acciones de gracias\n Con danza, con j\u00fabilo y gozo a mi Rey\n Quiero alabarle\u2026\n\n \/\/\/A poseer\/\/ la tierra que \u00c9l nos dio\n \/\/\/A poseer\/\/ la tierra que \u00c9l nos dio\n La victoria es nuestra en el nombre de Jes\u00fas\n Tomaremos naciones en el nombre de Jes\u00fas\n Ning\u00fan gigante nos podr\u00e1 frenar."},
{"id":216,"ti":"Fue Clavado En La Cruz","tono":"C","estilo":"0","le":"\/\/Fue clavado en la cruz por mi\/\/\n En la cruz do muri\u00f3, mis pecados llev\u00f3,\n fue clavado en la cruz por mi."},
{"id":217,"ti":"Fuego Es Lo Que Quiero","tono":"C","estilo":"0","le":"\/\/\/Fuego\/\/\/ es lo que quiero\n \/\/\/M\u00e1ndalo\/\/\/ Se\u00f1or\n Todas las promesas que me des, yo quiero\n Que me des el fuego consolador."},
{"id":218,"ti":"Fuego, La Iglesia Pide Fuego","tono":"C","estilo":"0","le":"\/\/Fuego\/\/ la Iglesia pide fuego\n \/\/Fuego\/\/ la Iglesia pide fuego\n \/\/Hermano querido, p\u00eddelo t\u00fa tambi\u00e9n\/\/\n \/\/Porque mi Cristo viene a llevar su Iglesia a Jerusal\u00e9n\/\/"},
{"id":219,"ti":"Goc\u00e9monos Y Alegr\u00e9monos","tono":"C","estilo":"0","le":"\/\/Goc\u00e9monos y alegr\u00e9monos,\n D\u00e9mosle gloria a aquel que nos am\u00f3\/\/\n\n Porque muri\u00f3 pero s\u00e9 que \u00c9l vive,\n Por los siglos de los siglos \u00a1aleluya!\n\n \/\/\u00c9l es el alfa, \u00c9l es la omega,\n Es el principio y es el fin\/\/\n\n \u00a1Aleluya! porque el Se\u00f1or nuestro Dios todopoderoso,\n Reina para siempre reina."},
{"id":220,"ti":"Golpe De Espada","tono":"C","estilo":"0","le":"Golpe de espada es la alabanza,\n Golpe de guerra que sale de Dios,\n Canto de gloria trae la victoria\n De la batalla del pueblo de Dios\n\n \/\/Y cada golpe de la espada de Dios,\n Es con pandero, con trompeta y tambor\/\/\n \/\/Ser\u00e1 con cantos de j\u00fabilo,\n Cantos de j\u00fabilo\/\/"},
{"id":221,"ti":"G\u00f3zate Delante Del Se\u00f1or","tono":"C","estilo":"0","le":"\/\/G\u00f3zate Delante Del Se\u00f1or,\n Porque \u00c9l es tu Rey\/\/\n \/\/\/\/\u00c9l es\/\/\/\/ Tu Rey.\n\n \/\/G\u00f3zate Delante Del Se\u00f1or,\n Porque \u00c9l es tu Escudo\/\/\n \/\/\/\/\u00c9l es\/\/\/\/ Tu Escudo.\n\n \/\/G\u00f3zate Delante Del Se\u00f1or,\n Porque \u00c9l es tu Roca\/\/\n \/\/\/\/\u00c9l es\/\/\/\/ Tu Roca."},
{"id":222,"ti":"Gozo Yo Quer\u00eda","tono":"C","estilo":"0","le":"\/\/Gozo, gozo, gozo yo quer\u00eda,\n Pero lo buscaba, donde no lo hab\u00eda\/\/\n\n \/\/Pero vino Cristo el dador de la vida,\n Me llen\u00f3 de gozo del que yo quer\u00eda\/\/"},
{"id":223,"ti":"Gracias (Me Has Tomado)","tono":"C","estilo":"0","le":"Me has tomado en tus brazos\n Y me has dado salvaci\u00f3n,\n De tu amor has derramado en mi coraz\u00f3n,\n No podr\u00e9 agradecerte lo que has hecho por m\u00ed,\n S\u00f3lo puedo darte ahora mi canci\u00f3n.\n\n Gracias, gracias Se\u00f1or,\n Gracias mi Se\u00f1or Jes\u00fas,\n Gracias muchas gracias Se\u00f1or,\n Gracias mi se\u00f1or Jes\u00fas.\n\n En la cruz diste tu vida lo entregaste todo all\u00ed,\n Vida eterna regalaste al morir,\n Por tu sangre tengo entrada ante el trono celestial,\n Puedo entrar confiadamente ante Ti"},
{"id":224,"ti":"Gracias Cristo Bendito","tono":"C","estilo":"0","le":"T\u00fa me encontraste a m\u00ed Se\u00f1or no te buscaba\n Y me diste consuelo cuando en penas vagu\u00e9,\n Sent\u00ed la paz del cielo, que mi alma deseaba,\n \/\/Sent\u00ed que la llenabas\/\/ con tu santo poder.\n\n Gracias Cristo bendito,\n Gracias porque me amas,\n Gracias te da mi alma,\n Por la paz que me das;\n Gracias por este c\u00e1ntico,\n Con que puedo alabarte\n Y gracias por las fuerzas,\n Que me das para amarte,\n Cada d\u00eda m\u00e1s y m\u00e1s.\n\n Hacia un profundo abismo del lodo cenagoso,\n S\u00f3lo me conduc\u00eda su diario caminar,\n Mas el Cristo triunfante se cruz\u00f3 en mi camino\n \/\/Y cambi\u00f3 mi destino\/\/ por su senda de paz."},
{"id":225,"ti":"Gracias Por Tus Favores","tono":"C","estilo":"0","le":"Gracias por tus favores,\n Por tus \/\/muchas\/\/ bondades\n\n \/\/Mi alma, mi alma te alaba\/\/\n \/\/porque has hecho maravillas\/\/\n\n \/\/Aleluya, Oh aleluya\/\/\n \/\/porque has hecho maravillas\/\/"},
{"id":226,"ti":"Gracias Se\u00f1or Por El D\u00eda Tan Lindo De Hoy","tono":"C","estilo":"0","le":"\/\/Gracias, Se\u00f1or, por el d\u00eda tan lindo de hoy,\n Gracias, Se\u00f1or, por la vida y la salud\/\/\n\n \/\/\/\/Se\u00f1or, vengo a Ti\/\/\/\/\n Oh Se\u00f1or yo vengo a Ti,\n A expresar mi gratitud"},
{"id":227,"ti":"Grande Es El Se\u00f1or, Maravillosos Sus Prodigios","tono":"C","estilo":"0","le":"Grande es el Se\u00f1or maravillosos sus prodigios\n \/\/Y en la fuerza de su mano hay poder\/\/\n Para vencer\n\n Un rio de alabanza dar\u00e9 y s\u00f3lo ante \u00c9l danzar\u00e9\n \/\/Pues ha cambiado mi lamento en baile\/\/\n \/\/Grande es el Se\u00f1or\/\/"},
{"id":228,"ti":"Grande Es El Se\u00f1or El Rey Del Universo","tono":"C","estilo":"0","le":"\/\/\/Grande es el Se\u00f1or, el rey del Universo\/\/\/\n Porque grande es,\n\n \/\/\/Bendito es, bendito el que viene\/\/\/\n En nombre de Dios,\n\n \/\/\/oh, oh, oh, hosanna en el cielo\/\/\/ \n Porque grande es."},
{"id":229,"ti":"Grande Y Fuerte Es Nuestro Dios","tono":"C","estilo":"0","le":"\/\/\/\/Grande y fuerte es nuestro Dios\/\/\/\/\n\n Vestido en Majestad,\n Coronado con poder,\n Digno de toda la adoraci\u00f3n.\n\n Vestido en Majestad\n Coronado con poder\n Toda gloria y honra sean para Ti."},
{"id":230,"ti":"Grandes Y Maravillosas","tono":"C","estilo":"0","le":"Grandes y maravillosas son tus obras,\n Se\u00f1or Dios todopoderoso,\n Justos y verdaderos son tus caminos \n \/\/\/Rey de los santos\/\/\/\n \/\/Aleluya, am\u00e9n\/\/\n\n Temed a Dios y dadle gloria,\n Porque su juicio ha llegado,\n Y adorad a aquel que hizo:\n Los cielos y la tierra,\n El mar y las fuentes de las aguas;\n \/\/Aleluya, am\u00e9n\/\/\n\n Qui\u00e9n no te temer\u00e1 oh se\u00f1or\n Y glorificar\u00e1 tu nombre,\n Pues s\u00f3lo T\u00fa eres santo,\n Por lo cual todas las naciones vendr\u00e1n\n Y te adorar\u00e1n y te adorar\u00e1n;\n \/\/Aleluya am\u00e9n\/\/"},
{"id":231,"ti":"Hacemos Hoy","tono":"C","estilo":"0","le":"Hacemos hoy ante tu altar\n Un compromiso de vivir en santidad,\n Hacemos hoy ante tu altar\n Un pacto de hombres que te quieren agradar.\n\n Con manos limpias, coraz\u00f3n puro para Ti\n Cuidar\u00e9 mis ojos, cuidar\u00e9 mis manos,\n Cuidar\u00e9 mi coraz\u00f3n,\n De todo lo malo, de todo lo vano,\n No te quiero fallar jam\u00e1s."},
{"ti":"Hagamos Guerra Espiritual","le":"Hagamos guerra espiritual,\nContra las huestes de maldad,\nEstaremos firmes en la victoria de Dios.\nDerribaremos con potestad\nTodo argumento de iniquidad\nlevantado contra Cristo y su verdad\n\nLa potestad del aire no nos vencer,\nEl hijo nos dio la libertad,\nAplastar al maligno,\nBajo nuestros pies y su victoria,\nNos har estar de pie\n\nPertenecemos a la filas del seor,\nNo triunfar la tentacin\nPor su espritu l nos har triunfar,\nLas fortalezas de maldad destruir.","name":"Corario IPUC castilla.js","id":"232","tono":"C","estilo":"0"},
{"id":233,"ti":"Har\u00e9 Un Altar Para Ti","tono":"C","estilo":"0","le":"\/\/Har\u00e9 un altar para Ti,\n Con sacrificio de alabanza,\n Con j\u00fabilo y danza yo cantar\u00e9 a Jehov\u00e1\/\/\n\n \/\/\/Desciende el fuego\/\/\/ de Dios."},
{"id":234,"ti":"Has Cambiado Mi Lamento","tono":"C","estilo":"0","le":"\/\/T\u00fa has cambiado mi lamento en baile\n Me ce\u00f1iste todo de alegr\u00eda\/\/\n\n \/\/Por tanto a Ti cantar\u00e9\n Gloria m\u00eda, gloria m\u00eda\/\/\n\n \/\/Oh Adona\u00ed\/\/ \n Dios del universo, Se\u00f1or de la creaci\u00f3n,\n\n Los cielos cuentan tu gloria\n Tus hijos hoy te adoran\n Por todas tus maravillas\u2026 Adona\u00ed"},
{"id":235,"ti":"Hay Momentos En Que Palabras","tono":"C","estilo":"0","le":"\/\/Hay momentos en que palabras no alcanzan\n Para decirte lo que siento a Ti mi buen Se\u00f1or\/\/\n\n \/\/Te agradezco todo lo que has hecho,\n Todo lo que haces, todo lo que har\u00e1s\/\/"},
{"id":236,"ti":"Hay Momentos Que","tono":"C","estilo":"0","le":"Hay momentos que no deber\u00edan terminar\n Hay segundos que tendr\u00edan que ser eternidad\n Cuando tu Esp\u00edritu se\u00f1or se toca con el m\u00edo\n Y mi coraz\u00f3n estalla en adoraci\u00f3n.\n\n Te amo mi Se\u00f1or, se acaban las palabras,\n S\u00f3lo me queda mi alma para cantarte,\n Te adoro mi Se\u00f1or, no hay nada alrededor\n \/\/S\u00f3lo estamos T\u00fa y yo\/\/"},
{"id":237,"ti":"Hay Momentos Tan Especiales","tono":"C","estilo":"0","le":"\/\/Hay momentos tan especiales\n Junto a Ti Se\u00f1or\/\/\n\n \/\/En los que puedo sentir tu presencia,\n En los que puedo recostarme en Ti,\n En los que puedo yo tomar de tu amor\/\/"},
{"id":238,"ti":"Hay Muchas Formas","tono":"C","estilo":"0","le":"Hay muchas formas de alabar tu nombre,\n De exaltarte Jehov\u00e1,\n Hay muchas formas de glorificarte,\n Pero ahora lo har\u00e9 as\u00ed\u2026\n\n Sac\u00f3 mi vida del anonimato,\n Me dio corona, vestido real;\n As\u00ed es Jehov\u00e1 que exalta al peque\u00f1o,\n Por causa de \u00c9l yo me har\u00e9 m\u00e1s vil.\n\n \/\/Glorificando\/\/\n Celebrar\u00e9 a Jehov\u00e1\n \/\/Glorificando\/\/\n Me har\u00e9 m\u00e1s vil por causa de Jehov\u00e1."},
{"id":239,"ti":"Hay Que Clamar","tono":"C","estilo":"0","le":"Cuando sientas soledad\n Y un vac\u00edo en tu coraz\u00f3n\n Y no hay raz\u00f3n para amar,\n S\u00f3lo hay preocupaci\u00f3n.\n\n Si en tu vida espiritual\n T\u00fa no ves prosperidad\n Y haz dejado de orar,\n Todo es dif\u00edcil en ti.\n\n Cuando en pruebas t\u00fa est\u00e9s\n Y no hay valor para soportar\n Esa aflicci\u00f3n, ese dolor que hay en ti.\n\n Hay que clamar de rodillas ante Dios,\n Hay que decir: \u00abte necesito Se\u00f1or\u00bb,\n Mi coraz\u00f3n hoy siente un gran dolor;\n \/\/te necesito\/\/ en mi coraz\u00f3n."},
{"id":240,"ti":"Hay Un Motivo","tono":"C","estilo":"0","le":"Hay un motivo que es de grande gozo,\n Cristo Jes\u00fas ya mora en m\u00ed,\n Pues en mi vida Cristo es mi todo,\n Siempre feliz con \u00c9l ser\u00e9.\n\n Si estoy alegre me aumenta el gozo,\n Si pruebas tengo fuerzas me da,\n Si estoy enfermo Cristo me sana\n Y da a mi alma seguridad."},
{"id":241,"ti":"Hay Un Poder Que Consume","tono":"C","estilo":"0","le":"\/\/Hay un poder que consume,\n En mi coraz\u00f3n\n Fuego divino que quema\n Y no se puede apagar\/\/\n\n \/\/Oh aleluya, aleluya\/\/"},
{"id":242,"ti":"Hay Un Pueblo","tono":"C","estilo":"0","le":"\/\/Hay un pueblo que vive muy feliz\n Y ese pueblo es el pueblo de Dios\/\/\n\n \/\/Ese pueblo vive as\u00ed, porque un d\u00eda conoci\u00f3\n A Jes\u00fas el Salvador\/\/"},
{"id":243,"ti":"Hay Una Fiesta","tono":"C","estilo":"0","le":"Hay una \/\/\/fiesta\/\/\/\n \/\/continuamente en m\u00ed\/\/\n Hay una \/\/\/fiesta\/\/\/\n Desde que a Cristo yo conoc\u00ed.\n\n Este es el Cristo que yo predico\n Y no me canso de alabar,\n \u00c9l silenci\u00f3 los mares, ech\u00f3 fuera demonios,\n Calm\u00f3 los vientos y la tempestad.\n\n \/\/Satan\u00e1s no podr\u00e1 vencer, no podr\u00e1\/\/\n Pues le vamos a ganar con Jes\u00fas el capit\u00e1n,\n Satan\u00e1s no podr\u00e1 vencer."},
{"id":244,"ti":"Hay Una Fuente En M\u00ed","tono":"C","estilo":"0","le":"\/\/Hay una fuente en m\u00ed, que est\u00e1 brotando\n Que est\u00e1 fluyendo, dentro de mi\/\/\n\n \/\/Es un r\u00edo de alabanza y de adoraci\u00f3n\n Dirigido hacia Ti Se\u00f1or Jes\u00fas rec\u00edbelo\/\/"},
{"id":245,"ti":"Hay Una Llama","tono":"C","estilo":"0","le":"Hay una llama que arde en m\u00ed,\n Un gran poder que est\u00e1 en ti;\n Me est\u00e1 quemando su fuego santo,\n Puedo sentirlo est\u00e1 aqu\u00ed.\n\n \/\/Fuego, fuego, fuego del Se\u00f1or;\n Fuego, fuego, fuego purificador\/\/\n\n \/\/\/Fuego, fuego, fuego, fuego, fuego, fuego, fuego\/\/\/\n Fuego purificador."},
{"id":246,"ti":"Hay Una Necesidad Dentro De M\u00ed","tono":"C","estilo":"0","le":"Hay una necesidad dentro de m\u00ed,\n De adorarte d\u00eda a d\u00eda.\n De postrarme a tus pies\n Y descansar junto a ti.\n De rendirte mi coraz\u00f3n\n Cambia hoy mi vida, fluye Se\u00f1or,\n Que pueda yo estar en el Rio de tu amor,\n Mira en mi interior esa gran necesidad\n De adorarte a ti cada d\u00eda m\u00e1s."},
{"id":247,"ti":"Hay Una Patria","tono":"C","estilo":"0","le":"\/\/Hay una patria que Cristo ofrece\n Y \u00c9l quiere d\u00e1rnosla por heredad\/\/\n\n \/\/Pero sin fe no podemos tenerla,\n Pero sin fe no podemos llegar\/\/\n\n \/\/All\u00e1 cantaremos con palmas en las manos,\n All\u00e1 cantaremos por la eternidad\/\/\n\n \/\/Pero sin fe no podemos tenerla,\n Pero sin fe no podemos llegar\/\/"},
{"id":248,"ti":"Hay Una Presencia Muy Sublime","tono":"C","estilo":"0","le":"Hay una presencia muy sublime\n \/\/Que no veo\/\/\n Hay una presencia muy sublime\n Que no veo y es Jes\u00fas.\n\n \/\/\/Yo la siento\/\/\/\n que se mueve en mi ser."},
{"id":249,"ti":"Hay Una Unci\u00f3n","tono":"C","estilo":"0","le":"Hay una unci\u00f3n aqu\u00ed, cayendo sobre m\u00ed,\n Limpi\u00e1ndome, cambiando mi ser.\n\n Mi esp\u00edritu y mi alma, se est\u00e1n llenando,\n Con el Poder de tu Esp\u00edritu Santo,\n Mi vida nunca m\u00e1s, ser\u00e1 igual."},
{"id":250,"ti":"Hay Victoria","tono":"C","estilo":"0","le":"\/\/\/Hay victoria\/\/\/\n En el nombre de Jes\u00fas.\n No podr\u00e1 el enemigo vencer a nuestras almas\n \/\/Porque hay victoria, porque hay victoria,\n Porque hay victoria en el nombre de Jes\u00fas\/\/\n\n \/\/\/Hay poder\/\/\/\n En el nombre de Jes\u00fas.\n No podr\u00e1 el enemigo vencer a nuestras almas\n \/\/Porque hay poder, porque hay poder,\n Porque hay poder en el nombre de Jes\u00fas\/\/"},
{"id":251,"ti":"Haz De M\u00ed Un Instrumento","tono":"C","estilo":"0","le":"\/\/Haz de m\u00ed un instrumento,\n Un instrumento de adoraci\u00f3n\n Elevo mis manos a Ti\/\/\n\n \u00a1Oh si yo s\u00e9! \u00a1Oh si yo s\u00e9!\n Que s\u00f3lo la verdad puede liberar\n \u00a1Oh si yo s\u00e9! \u00a1Oh si yo s\u00e9!\n Que todo lo que prometi\u00f3,\n Es para nosotros hoy.\n\n \/\/Haz de m\u00ed una sinfon\u00eda,\n Una sinfon\u00eda de adoraci\u00f3n,\n Elevo mis manos a Ti\/\/\n\n \u00a1Oh si yo s\u00e9! \u00a1Oh si yo s\u00e9!\n Que s\u00f3lo la verdad puede liberar\n \u00a1Oh si yo s\u00e9! \u00a1Oh si yo s\u00e9!\n Que todo lo que prometi\u00f3,\n Es para nosotros hoy."},
{"id":252,"ti":"Haz De M\u00ed Una Ofrenda","tono":"C","estilo":"0","le":"Haz de m\u00ed una ofrenda de adoraci\u00f3n a Ti,\n Esc\u00f3geme y \u00fasame para agradarte a Ti.\n\n \/\/Yo s\u00f3lo quiero cantar para Ti Se\u00f1or\n Y mi vida entregar como ofrenda de amor\/\/\n\n M\u00ed quebrantado coraz\u00f3n lo rindo a tus pies,\n Me entrego totalmente como tu siervo fiel.\n\n \/\/Abre T\u00fa mis labios y yo te alabar\u00e9,\n En sacrificio vivo te doy todo mi ser\/\/"},
{"id":253,"ti":"Haz Un Milagro En M\u00ed","tono":"C","estilo":"0","le":"I\n Como Zaqueo yo quiero subir a lo m\u00e1s alto que yo pueda\n S\u00f3lo para verte, mirar hacia Ti y llamar tu atenci\u00f3n hacia m\u00ed.\n Necesito de Ti, Se\u00f1or. Necesito de Ti, \u00a1Oh Padre!\n Soy peque\u00f1o y nada m\u00e1s, dame de tu paz,\n Dejo todo por seguirte a Ti.\n\n CORO:\n Entra en mi casa, entra en mi vida,\n Estremece mi estructura, sana todas las heridas,\n Caminar en santidad, quiero amarte s\u00f3lo a Ti,\n En Ti encontr\u00e9 mi primer amor. Haz un milagro en m\u00ed."},
{"id":254,"ti":"Hazte Tu Casa Sobre La Roca","tono":"C","estilo":"0","le":"\/\/Hazte tu casa sobre la roca,\n Que Jesucristo te ayudar\u00e1\/\/\n\n \/\/Que vengan r\u00edos y soplen vientos,\n Pero tu casa no caer\u00e1\/\/"},
{"id":255,"ti":"He Decidido Seguir A Cristo","tono":"C","estilo":"0","le":"\/\/\/He decidido seguir a Cristo\/\/\/\n \/\/No vuelvo atr\u00e1s\/\/\n\n \/\/\/Cristo adelante y el mundo atr\u00e1s de m\u00ed\/\/\/\n \/\/No vuelvo atr\u00e1s\/\/"},
{"id":256,"ti":"He Llegado A Este Lugar","tono":"C","estilo":"0","le":"\/\/He llegado a este lugar,\n Con el prop\u00f3sito de estar junto a Ti\/\/\n\n Porque soy una oveja, oveja de tu prado,\n Necesitada de tu amor,\n T\u00f3mame en tus brazos y venda mis heridas,\n Porque s\u00f3lo T\u00fa sabes consolar."},
{"id":257,"ti":"Heme Aqu\u00ed","tono":"C","estilo":"0","le":"\/\/Heme aqu\u00ed yo ir\u00e9 Se\u00f1or\/\/\n Env\u00edame a m\u00ed que dispuesto estoy,\n Llevar\u00e9 tu gloria a las naciones."},
{"id":258,"ti":"Heme Aqu\u00ed (La Mies Es Mucha)","tono":"C","estilo":"0","le":"La mies es mucha, hay gran necesidad\n Y pocos obreros al campo van,\n Hoy muchos se pierden, viven sin direcci\u00f3n,\n Vagan como ovejas sin pastor.\n\n \/\/Heme aqu\u00ed, env\u00edame a m\u00ed\/\/\n Yo ir\u00e9 por aquellos, que vagan sin Ti,\n Env\u00edame a m\u00ed, yo ir\u00e9."},
{"id":259,"ti":"Hemos Venido A Este Lugar","tono":"C","estilo":"0","le":"\/\/\/Hemos venido a este lugar juntos,\n A su nombre a adorar\/\/\/\n Cristo, nuestro Dios y Rey\n \/\/\/Las manos altas levantad, glorificad,\n Su nombre adorad\/\/\/\n Cristo, nuestro Dios y Rey."},
{"id":260,"ti":"Hermoso Eres","tono":"C","estilo":"0","le":"\/\/En mi coraz\u00f3n hay una canci\u00f3n,\n Que demuestra mi pasi\u00f3n,\n Para mi Rey y mi Se\u00f1or,\n Para aquel que me am\u00f3\/\/\n\n Hermoso eres mi Se\u00f1or,\n Hermoso eres T\u00fa amado m\u00edo,\n T\u00fa eres la fuente de mi vida\n Y el anhelo de mi coraz\u00f3n\/\/"},
{"id":261,"ti":"Hombres De Valor","tono":"C","estilo":"0","le":"\u00bfQui\u00e9n ir\u00e1 abriendo caminos, forjando mejores destinos,\n Pautas de amor, para la humanidad?\n \u00bfQui\u00e9n dir\u00e1: \u00abasumo este reto, me entrego completo\n Y me uno a la causa de Dios que cambia el coraz\u00f3n\u00bb?\n\n \u00bfQui\u00e9n ir\u00e1 a esos hombres tan desesperados?\n \u00bfQui\u00e9n ir\u00e1 a esos matrimonios acabados?\n \u00bfO a ese ni\u00f1o que est\u00e1, solo y sin hogar,\n Esperando que alguien le ame hoy?\n\n Hombres de valor necesita Dios,\n Hombres de valor esforzados.\n Hombres de valor que cumplan promesas,\n Que sigan la ruta trazada con la mirada en su Salvador.\n\n Heme aqu\u00ed se\u00f1or rindo mis derechos\n Hoy vengo dispuesto a trazar pautas de amor para la humanidad.\n Hoy aqu\u00ed asumo este reto,\n Me entrego completo y me uno a la causa de Dios que cambia el coraz\u00f3n.\n\n Hombres de valor necesita Dios,\n Hombres de valor esforzados.\n Hombres de valor que cumplan promesas,\n Que sigan la ruta trazada con la mirada en su Salvador.\n Hombres de valor...\n Hombres entregados, fieles al llamado,\n Todo por la causa del Se\u00f1or."},
{"id":262,"ti":"Honra Y Gloria","tono":"C","estilo":"0","le":" \/\/\/Honra y gloria\/\/\/ Te damos Se\u00f1or,\n Todo es puesto debajo de tus pies,\n Honra y gloria te damos Se\u00f1or."},
{"id":263,"ti":"Hosanna","tono":"C","estilo":"0","le":"Veo al Rey degloria de los cielos descender\n \/\/todos ver\u00e1n\/\/\n Veo su amor y gracia, mi pecado perdon\u00f3\n \/\/le alabar\u00e9\/\/\n\n \/\/Hosanna\/\/ en las alturas.\n\n Veo como se levanta una gran generaci\u00f3n,\n Un solo Dios, una verdad,\n Veo avivamiento, al buscarte y orar\n \/\/me postrar\u00e9\/\/\n\n \/\/Hosanna\/\/ en las alturas.\n S\u00e1name y l\u00edmpiame,\n Con mis ojos tus obras quiero ver,\n Quiero amarte como T\u00fa me amas.\n Quiebra hoy mi coraz\u00f3n,\n Todo lo que soy por tu reino doy,\n Contigo quiero estar por la eternidad."},
{"id":264,"ti":"Hosanna. Marco Barrientos","tono":"C","estilo":"0","le":"Levantamos un clamor por sanidad y redenci\u00f3n\n Mu\u00e9stranos lo que T\u00fa ves, los secretos de Tu coraz\u00f3n.\n\n Un pueblo unido pide hoy tu libertad y salvaci\u00f3n,\n \u00c1rmanos con tu valor lo que deseamos es su bendici\u00f3n.\n\n Que el cielo se parta en dos... In\u00fandanos\n Que en el desierto broten r\u00edos... vida sopla hoy\n\n \/\/Hosanna al Rey de Salvaci\u00f3n\n Hosanna al Dios Alt\u00edsimo\n Hosanna\n Jesucristo, Jesucristo es Rey\/\/\n\n \/\/Hosanna, hosanna,\n Hosanna al Rey\/\/"},
{"id":265,"ti":"Hoy Quiebro Mi Alabastro","tono":"C","estilo":"0","le":"\/\/No hay nada mejor que estar con Cristo,\n No hay nada mejor que buscar de su presencia\/\/\n\n Hoy quiebro mi alabastro lo derramo ante Ti\n Y el perfume llena este lugar,\n Que suba este aroma con un c\u00e1ntico a Ti,\n Cristo mi Rey, mi Salvador."},
{"id":266,"ti":"Hoy Venimos","tono":"C","estilo":"0","le":" Hoy venimos, a la casa del Se\u00f1or de gloria,\n Cantaremos y nos gozaremos,\n En la presencia del gran rey.\n\n Cantaremos, daremos grandes saltos de alegr\u00eda,\n Celebraremos a su santo Nombre,\n Haremos fiesta \/\/para \u00c9l\/\/\n\n \/\/\u00c9l se alegrara y nos gozaremos,\n Nos bendecir\u00e1\n Y para siempre estaremos junto a \u00c9l\/\/"},
{"id":267,"ti":"Impactante","tono":"C","estilo":"0","le":"El impacto de la voz de Dios hizo los cielos y la tierra,\n El impacto de la mano de Dios libert\u00f3 a Israel,\n El impacto del poder de Dios hizo caer al enemigo,\n El impacto de su amor hizo nacer a su hijo.\n\n \u00c9l impact\u00f3 en el ciego, y el ciego vi\u00f3,\n \u00c9l impact\u00f3 en el cojo y camin\u00f3,\n \u00c9l impact\u00f3 en el sordo y el sordo oy\u00f3,\n \u00c9l impact\u00f3 en el agua en vino se torn\u00f3,\n \u00c9l impact\u00f3 en L\u00e1zaro y revivi\u00f3,\n Impact\u00f3 en panes y peces multiplic\u00f3,\n El impact\u00f3 en la cruz, por nosotros muri\u00f3,\n El impacto en la muerte y resucit\u00f3.\n\n Coro:\n Impactante, la gloria de Jes\u00fas es algo impresionante,\n Es inimaginable su poder,\n Y como \u00e9l no lo hay,\n Y jam\u00e1s lo habr\u00e1.\n\n Impactante, lo que est\u00e1 haciendo Dios en este mismo instante,\n La gloria de Jes\u00fas lleg\u00f3 aqu\u00ed,\n Te va a tocar, te va curar y restaurar, te va impactar."},
{"id":268,"ti":"Intercesi\u00f3n","tono":"C","estilo":"0","le":"I\n Cuando todos r\u00eden lloro y en el silencio sollozo,\n Es que est\u00e1 mi ser completo con agon\u00eda intercediendo...\n D\u00eda de luto d\u00eda de sombra, por las cargas de mi pueblo,\n Que lo \u00fanico que anhelo es: tener victoria intercediendo...\n \u00bfPor qu\u00e9 ya no tienen fuerzas? \u00bfPor qu\u00e9 la oraci\u00f3n no cuenta?\n Vuelvo a Ti mi rostro en oraci\u00f3n pidi\u00e9ndote Se\u00f1or misericordia.\n\n CORO\n \/\/La intercesi\u00f3n que da el amor,\n La intercesi\u00f3n es un clamor\n Es un gemido en oraci\u00f3n que da la vida...\n Que ruega por mi hermano en aflicci\u00f3n,\n Por mi pa\u00eds en luto y en dolor,\n Ella es el puente que al altar de Dios nos gu\u00eda\/\/\n\n II\n Es mi \u00fanico deseo: poder traspasar el velo,\n En mi c\u00e1mara secreta hasta que obtenga tu respuesta...\n \u00bfPor qu\u00e9 el pueblo de mi tierra hace opresi\u00f3n, hace violencia?\n Vu\u00e9lvenos el coraz\u00f3n a Ti y con incienso rebosa las copas.\n Se\u00f1or levanta intercesores en las c\u00e1maras secretas\n Que hablen contigo y nadie sepa, pero que la unci\u00f3n sea la evidencia."},
{"id":269,"ti":"Jacob Luch\u00f3 Con El \u00c1ngel","tono":"C","estilo":"0","le":"\/\/Jacob luch\u00f3 con el \u00e1ngel por una bendici\u00f3n\/\/\n \/\/D\u00e1mela Se\u00f1or por tu gran poder\/\/\n \/\/Yo la vine a buscar y sin ella no me voy\/\/"},
{"id":270,"ti":"Jacob Luch\u00f3 Con El \u00c1ngel","tono":"C","estilo":"0","le":"Jacob luch\u00f3 con el \u00e1ngel por una bendici\u00f3n\n \/\/Y le dijo de aqu\u00ed no me muevo\n Hasta que vea la gloria de Dios\/\/\n\n \/\/Y luchaba Jacob con el \u00e1ngel de Jehov\u00e1\/\/\n \/\/Y luchando le dec\u00eda:\n \u00abSi no me bendices no te vas\u00bb\/\/\n\n \/\/\/\/\u00abSi no me bendices no te vas\u00bb\/\/\/\/"},
{"id":271,"ti":"Jashem Es Var\u00f3n De Guerra","tono":"C","estilo":"0","le":"\/\/Jashem es var\u00f3n de guerra,\n Jashem es su nombre,\n Jashem es mi fortaleza y mi c\u00e1ntico\/\/\n\n \u00c9l es mi Dios y lo alabar\u00e9,\n Dios de mis padres y lo enaltecer\u00e9."},
{"id":272,"ti":"Jehov\u00e1 Es Mi Guerrero","tono":"C","estilo":"0","le":"\/\/Jehov\u00e1 es mi guerrero oh, oh, oh\/\/\n\n Con mi alabanza pelear\u00e9,\n Pues no es mi guerra sino la de Dios,\n\n Danza y pandero yo dar\u00e9,\n Pues no es mi guerra sino la de Dios,\n\n C\u00edmbalo y trompeta sonar\u00e9,\n Pues no es mi guerra sino la de Dios,\n\n Con fuerte y alta voz yo gritar\u00e9."},
{"id":273,"ti":"Jehov\u00e1 Es Vencedor","tono":"C","estilo":"0","le":"\/\/Los enemigos de Jehov\u00e1,\n Son tenidos por vanidad,\n Sus adversarios tambi\u00e9n\n Son como el tamo ante \u00c9l\/\/\n\n Pues Jehov\u00e1 es vencedor,\n Jehov\u00e1 es el Se\u00f1or,\n Jehov\u00e1 es el Dios de los dioses.\n\n Decapit\u00f3 a Dag\u00f3n, dios de los filisteos,\n Cort\u00e1ndole las dos manos, lo redujo a vanidad;\n Avergonz\u00f3 a Baal y a todos sus profetas.\n Fue grande la victoria que Jehov\u00e1 nos dio\n\n \/\/\/Jehov\u00e1, Jehov\u00e1, Jehov\u00e1 es vencedor\/\/\/"},
{"id":274,"ti":"Jehov\u00e1 Est\u00e1 Conmigo","tono":"C","estilo":"0","le":"\/\/Jehov\u00e1 est\u00e1 conmigo como poderoso gigante,\n Los que me persiguen no prosperar\u00e1n\/\/\n\n \/\/\/Oh gloria\/\/\/ Aleluya,\n \/\/Oh gloria\/\/ aleluya am\u00e9n."},
{"id":275,"ti":"Jehov\u00e1 Est\u00e1 En Su Templo","tono":"C","estilo":"0","le":"\/\/Jehov\u00e1 est\u00e1 en su templo,\n Al\u00e1bale que \u00c9l vive\/\/\n\n \/\/Al\u00e1bale, al\u00e1bale,\n Al\u00e1bale que \u00c9l vive\/\/"},
{"id":276,"ti":"Jerusal\u00e9n","tono":"C","estilo":"0","le":"\/\/Jerusal\u00e9n que bonita eres\n Calles de oro mar de Cristal\/\/\n\n \/\/Por esas calles yo voy a caminar,\n Calles de oro, mar de Cristal\/\/"},
{"id":277,"ti":"Jesucristo Es El Motivo","tono":"C","estilo":"0","le":"Jesucristo es el motivo de mi canci\u00f3n,\n Otra raz\u00f3n yo no tengo por qu\u00e9 cantar,\n La melod\u00eda es \u00c9l, toda mi vida est\u00e1 en \u00c9l,\n Jesucristo es el motivo de mi canci\u00f3n."},
{"id":278,"ti":"Jesucristo Es Real","tono":"C","estilo":"0","le":"Jesucristo es real, es real en m\u00ed,\n \u00c9l me ha lavado con su sangre carmes\u00ed,\n Su dulce amor es para m\u00ed,\n Jesucristo es real porque lo siento en mi ser.\n\n Hay cosas que yo no comprendo\n Lugares hay do yo no ir\u00e9\n Pero si s\u00e9 y es verdad\n Que mi Cristo es real porque lo siento en mi ser.\n\n Su Esp\u00edritu da a mi vida\n La plenitud para triunfar\n Y s\u00f3lo s\u00e9 y puedo compartir\n Que mi Cristo es real porque lo siento en mi ser."},
{"id":279,"ti":"Jesucristo Es Tan Grande","tono":"C","estilo":"0","le":"\/\/Jesucristo es tan grande,\n No hay otro como \u00c9l;\n Es el Dios de lo imposible\n Que todo lo puede hacer\/\/\n\n Yo soy tu Dios que te amo\n C\u00f3mo me voy a olvidar yo de ti.\n\n Si en mis manos te llevo grabado,\n Si mi sangre por ti he derramado,\n C\u00f3mo me voy a olvidar yo de ti\n\n \/\/No te dejar\u00e9 ni te abandonar\u00e9\n Contigo estar\u00e9 hasta el fin\/\/"},
{"id":280,"ti":"Jes\u00fas Es Digno","tono":"C","estilo":"0","le":"Jes\u00fas es digno de toda gloria\n De mi alabanza y adoraci\u00f3n,\n \/\/porque \u00c9l me ha dado la vida eterna,\n Hoy quiero darle mi coraz\u00f3n\/\/\n\n \/\/Yo necesito alabarte,\n Me es necesario adorarte,\n Si T\u00fa buscas adoradores,\n Hoy me ofrezco a Ti Se\u00f1or\/\/"},
{"id":281,"ti":"Jes\u00fas Est\u00e1 Aqu\u00ed Aleluya","tono":"C","estilo":"0","le":"\/\/Jes\u00fas est\u00e1 aqu\u00ed, \u00a1Aleluya!\n Pide lo que quieras\/\/\n \u00c9l tiene poder, \u00c9l te lo dar\u00e1,\n Jes\u00fas est\u00e1 aqu\u00ed, \u00a1Aleluya!\n Pide lo que quieras.\n\n Y nosotros por la fe,\n nos acercamos hacia \u00c9l,\n Aunque su rostro no se ve,\n Pero sabemos que est\u00e1 aqu\u00ed."},
{"id":282,"ti":"Jes\u00fas Mi Fiel Amigo","tono":"C","estilo":"0","le":"Ll\u00e9vame all\u00e1, donde s\u00e9 que habr\u00e1 paz,\n Donde tengo que callar, para escucharte hablar,\n Donde todo es realidad, el tiempo no existe m\u00e1s.\n\n Una y otra vez, al estar yo junto a Ti,\n No me puedo contener, cuando me miras as\u00ed,\n Ya no hay nada que decir, eres todo para m\u00ed.\n\n \/\/Jes\u00fas mi fiel amigo, mi dulce caminar,\n Qu\u00e9date conmigo, no quiero volver atr\u00e1s\/\/\n \/\/no quiero volver atr\u00e1s\/\/"},
{"id":283,"ti":"Jes\u00fas T\u00fa Est\u00e1s Aqu\u00ed","tono":"C","estilo":"0","le":"\/\/Otra vez estoy aqu\u00ed para adorarte Jesucristo.\n Mi coraz\u00f3n te anhela m\u00e1s\n quiero rendirme a tus pies Se\u00f1or\/\/\n\n Estoy sintiendo tu esp\u00edritu en m\u00ed,\n Siento correr la unci\u00f3n aqu\u00ed,\n Me est\u00e1 tocando tu fuego celestial\n Y en tu presencia yo quiero adorar.\n\n \/\/Jes\u00fas T\u00fa est\u00e1s aqu\u00ed,\n Siento que me lleno de Ti,\n No puedo parar de adorar,\n Pues me das libertad\/\/"},
{"id":284,"ti":"Jes\u00fas, Eres Mi Buen Pastor","tono":"C","estilo":"0","le":"Cerca de Ti yo quiero estar\n Para escuchar tu voz y aprender de Ti;\n Quiero ser un reflejo de tu amor,\n Quiero vivir solo en tu voluntad\n\n Jes\u00fas, eres mi buen pastor,\n T\u00fa conoces mi camino.\n Jes\u00fas, puedo confiar en Ti,\n \u00a1Oh, mi Dios! me rindo hoy."},
{"id":285,"ti":"Jes\u00fas, Se\u00f1or De La Creaci\u00f3n","tono":"C","estilo":"0","le":"Jes\u00fas se\u00f1or de la creaci\u00f3n,\n Siendo en forma de Dios se despoj\u00f3 de s\u00ed mismo,\n Tom\u00f3 la semejanza de hombre\n Y siendo puro y sin mancha\n Entre nosotros vivi\u00f3.\n\n Y a s\u00ed mismo se humill\u00f3 tomando forma de siervo\n Hasta su vida entregar y en una cruz terminar.\n\n \/\/Mas Dios a lo sumo lo exalt\u00f3\n Y su nombre engrandeci\u00f3\n Para que ante su autoridad\n Toda rodilla se doble y toda lengua confiese\n Que Jes\u00fas es el Se\u00f1or\/\/"},
{"id":286,"ti":"Juventud Acu\u00e9rdate De Jehov\u00e1","tono":"C","estilo":"0","le":"\/\/Esta vida es pasajera,\n Peregrina en esta tierra,\n Como toda flor del campo\n Que ma\u00f1ana se marchita\/\/\n\n \/\/Juventud\/\/\n Acu\u00e9rdate de Jehov\u00e1 ahora que eres joven\n Y dale tu coraz\u00f3n para amarle y adorarle\n \/\/Juventud busca a Dios\/\/\n\n \/\/Nuestros d\u00edas son muy cortos,\n A\u00f1os vienen y se vuelan,\n Unos nacen y otros mueren,\n Vanidad de vanidades\/\/\n"},
{"id":287,"ti":"La Biblia No Dice El D\u00eda","tono":"C","estilo":"0","le":"\/\/La Biblia no dice el d\u00eda ni tampoco dice el mes,\n Tampoco dice la hora cuando Cristo ha de volver\/\/\n\n \/\/Pero s\u00e9 que volver\u00e1, pero s\u00e9 que volver\u00e1,\n Pero s\u00e9 que volver\u00e1, porque es Cristo de poder\/\/"},
{"id":288,"ti":"La Fortaleza De Mi Vida","tono":"C","estilo":"0","le":"\/\/La fortaleza de mi vida es Jesucristo,\n Si me agobian los problemas \u00c9l me ayuda,\n Si en el lodo he ca\u00eddo, vuelve a elevarme\n Y si llegan las angustias me fortalece con poder\/\/\n\n \/\/Yo voy a sentir que su poder me da las fuerzas para vencer\/\/\n\n \/\/Y volar\u00e9\/\/ A las alturas yo me ir\u00e9\n \/\/Y volar\u00e9\/\/ Como las \u00e1guilas muy alto ir\u00e9."},
{"id":289,"ti":"La Fuente De Arriba","tono":"C","estilo":"0","le":"\/\/La fuente de arriba fluyendo est\u00e1,\n El agua de vida que sacia tu sed,\n Si tomas de ella jam\u00e1s sed tendr\u00e1s;\n Mas gozo en el cielo tu puedes tener\/\/"},
{"id":290,"ti":"La Gloria Es Para Ti","tono":"C","estilo":"0","le":"\/\/La gloria es para Ti,\n Todo el reconocimiento es para Ti,\n En un canto reverente unimos nuestras voces\n Para adorarte\/\/\n\n \/\/Eres digno\/\/ oh cordero digno eres,\n \/\/Eres digno\/\/ oh cordero digno eres T\u00fa."},
{"id":291,"ti":"La Iglesia Del Se\u00f1or","tono":"C","estilo":"0","le":"\/\/La iglesia del Se\u00f1or se tiene que mover,\n Con el poder de Cristo para poder vencer\/\/\n\n \/\/Levanto mis manos para pedir poder,\n Porque soy cristiano, y quiero vencer\/\/"},
{"id":292,"ti":"La Iglesia Es Tuya","tono":"C","estilo":"0","le":"La iglesia es tuya Se\u00f1or te pedimos\n Tu santa presencia deseamos tener;\n El tiempo vuela y nosotros dormimos\n Por eso te pedimos tu santo poder;\n Aviva tu obra en medio de los tiempos,\n Porque a paso lento vas por doquier.\n\n \/\/Derrama oh Cristo bueno un gran avivamiento\n Que sienta tu iglesia tu santo poder\/\/"},
{"id":293,"ti":"La Ni\u00f1a De Tus Ojos","tono":"C","estilo":"0","le":"Me viste a m\u00ed, cuando nadie me vio,\n Me amaste a m\u00ed, cuando nadie me am\u00f3\n\n \/\/Y me diste nombre, yo soy tu ni\u00f1a,\n La ni\u00f1a de tus ojos porque me amaste a m\u00ed\/\/\n\n \/\/\/Me amaste a m\u00ed\/\/\/\n\n \/\/\/Te amo m\u00e1s que a mi vida\/\/\/ m\u00e1s."},
{"id":294,"ti":"La Oraci\u00f3n De Un Alma","tono":"C","estilo":"0","le":"\/\/La oraci\u00f3n de un alma arrepentida,\n Abre los cielos para hablar con Dios\/\/\n\n \/\/Cristo manda que se aparten del pecado,\n Porque dice en su palabra,\n Que \u00c9l no oye al pecador\/\/"},
{"id":295,"ti":"La Paz Del Se\u00f1or","tono":"C","estilo":"0","le":"\/\/Shalom Adonai Shalom\/\/\n \/\/\/Shalom Adonai\/\/\/ Shalom.\n\n \/\/La paz del Se\u00f1or, la paz\/\/\n \/\/\/la paz del se\u00f1or\/\/\/ la paz."},
{"id":296,"ti":"La Presencia De Dios Est\u00e1 Aqu\u00ed","tono":"C","estilo":"0","le":"\/\/La presencia de Dios est\u00e1 aqu\u00ed\n Yo la siento en m\u00ed\/\/\n\n Y me gozo en su luz\n Porque en ella hay vida en s\u00ed,\n La presencia de Dios est\u00e1 aqu\u00ed\n Yo la siento en m\u00ed."},
{"id":297,"ti":"La Sangre De Cristo","tono":"C","estilo":"0","le":"\/\/La sangre de Cristo lav\u00f3 mi coraz\u00f3n\n Acude a la sangre que en ella hay salvaci\u00f3n\/\/\n\n \/\/Gloria al Nombre de mi Se\u00f1or,\n \u00c9l es quien perdona al pecador\/\/\n\n \/\/Derrama en nosotros el fuego de tu amor,\n Para que seamos la luz de la naci\u00f3n\/\/\n\n \/\/Gloria al Nombre de mi Se\u00f1or,\n \u00c9l es quien perdona al pecador\/\/"},
{"id":298,"ti":"La Sola Presencia De Cristo Jes\u00fas","tono":"C","estilo":"0","le":"La sola presencia de Cristo Jes\u00fas,\n La sola presencia quema,\n La sola presencia de Cristo Jes\u00fas,\n Al diablo lo quema.\n\n Y ya \/\/\/se quema\/\/\/ todo yugo de maldad,\n Se desatan ligaduras, se rompen cadenas,\n Si la presencia de Cristo est\u00e1.\n Porque el Se\u00f1or es fuego purificador."},
{"id":299,"ti":"La \u00danica Raz\u00f3n","tono":"C","estilo":"0","le":"La \u00fanica raz\u00f3n de mi adoraci\u00f3n,\n Eres T\u00fa mi Jes\u00fas,\n El \u00fanico motivo para vivir\n Eres T\u00fa mi Se\u00f1or\n\n Mi \u00fanica verdad est\u00e1 en Ti,\n Eres mi luz y mi salvaci\u00f3n,\n Mi \u00fanico amor eres T\u00fa Se\u00f1or\n Y por siempre te alabar\u00e9.\n\n T\u00fa eres todopoderoso,\n Eres grande y majestuoso,\n Eres fuerte, invencible\n Y no hay nadie como T\u00fa\n\n \/\/Poderoso, poderoso Oh, oh, oh\/\/"},
{"id":300,"ti":"La Victoria Est\u00e1 En Jes\u00fas","tono":"C","estilo":"0","le":"La victoria est\u00e1 en Jes\u00fas,\n S\u00f3lo tienes que saber,\n Que mayor es el poder de Dios\n Que el poder de Satan\u00e1s.\n\n La victoria est\u00e1 en Jes\u00fas\n S\u00f3lo tienes que pensar:\n Que aunque pases malos tiempos,\n Aunque el mundo se destruya\n Y aunque est\u00e9s pasando pruebas,\n El Se\u00f1or te ayudar\u00e1\n Te dar\u00e1 una salida para poder continuar,\n Extender\u00e1 su mano amiga,\n Te dir\u00e1 por d\u00f3nde andar,\n Multiplicar\u00e1 tus fuerzas\n Y te consolar\u00e1."},
{"id":301,"ti":"Las Aguas Del R\u00edo Del Jord\u00e1n","tono":"C","estilo":"0","le":"\/\/Las aguas del r\u00edo del Jord\u00e1n\n Limpiaron la lepra de Naam\u00e1n\/\/\n\n \/\/Y si t\u00fa vienes a las aguas, la sangre,\n La sangre de Cristo te puede limpiar\/\/"},
{"id":302,"ti":"Levantad La Voz Y Aplaudid","tono":"C","estilo":"0","le":"\/\/Cantad a Jehov\u00e1 c\u00e1ntico nuevo\n Porque ha hecho grandes maravillas\/\/\n\n \/\/Levantad la voz y aplaudid\n Cantemos salmos al Se\u00f1or\/\/"},
{"id":303,"ti":"Lev\u00e1ntate Pueblo","tono":"C","estilo":"0","le":"Lev\u00e1ntate pueblo, ya viene tu Rey,\n Viene en una nube, con grande poder\n Cristo viene pronto por segunda vez\n Y nos llevar\u00e1 a la gran Jerusal\u00e9n."},
{"id":304,"ti":"Lev\u00e1ntate Se\u00f1or","tono":"C","estilo":"0","le":"\/\/\/\/Lev\u00e1ntate, lev\u00e1ntate Se\u00f1or\/\/\/\/\n\n Huyan delante de ti tus enemigos,\n Se dispersen delante de Ti\n Todos aquellos que aborrecen tu presencia.\n\n Tu presencia reinar\u00e1 sobre todo imperio,\n Tu presencia reinar\u00e1, gobernar\u00e1 sobre todo principado.\n\n Esp\u00edritu de temor... \u00a1huye!\n Esp\u00edritu de maldad... \u00a1huye!\n Esp\u00edritu de rencor... \u00a1huye!\n Esp\u00edritu de divisi\u00f3n... \u00a1huye!\n Esp\u00edritu de enfermedad... \u00a1huye!\n Esp\u00edritu de rebeli\u00f3n... \u00a1huye!\n Esp\u00edritu inmoral... \u00a1huye!\n Esp\u00edritu de oscuridad... \u00a1huye!\n Esp\u00edritu de perversi\u00f3n... \u00a1huye!\n Esp\u00edritu de ambici\u00f3n... \u00a1huye!\n Esp\u00edritu profanador... \u00a1huye!\n Esp\u00edritu de vanidad... \u00a1huye!\n Esp\u00edritu de murmuraci\u00f3n... \u00a1huye!\n Esp\u00edritu de contenci\u00f3n... \u00a1huye!\n Esp\u00edritu hechicer\u00eda... \u00a1huye!\n Esp\u00edritu de mortandad... \u00a1huye!"},
{"id":305,"ti":"Lev\u00e1ntate Y S\u00e1lvame","tono":"C","estilo":"0","le":"I\n Aunque un ej\u00e9rcito acampe contra m\u00ed, no temer\u00e9;\n Aunque haya guerra hoy alrededor de m\u00ed, en Ti confiar\u00e9.\n No temer\u00e9 a diez mil gentes que hagan sitio contra m\u00ed;\n Aunque la tierra se estremezca, mi salvaci\u00f3n est\u00e1 en Ti.\n\n CORO\n \/\/Porque T\u00fa eres mi escudo, T\u00fa mi fortaleza,\n T\u00fa eres mi gloria y quien levanta mi cabeza\/\/\n\n II\n Aunque afligido est\u00e9, T\u00fa pensar\u00e1s en m\u00ed, no temer\u00e9;\n Aunque mi coraz\u00f3n estremecido est\u00e9, en Ti confiar\u00e9.\n No temer\u00e9 a ning\u00fan hombre que se junte contra m\u00ed,\n T\u00fa eres mi Dios, mi fortaleza, mi salvaci\u00f3n est\u00e1 en Ti.\n\n III\n \/\/\/\/\/\/Lev\u00e1ntate y s\u00e1lvame\/\/\/\/\/\/"},
{"id":306,"ti":"Levanto Mis Manos","tono":"C","estilo":"0","le":"Levanto mis manos aunque no tenga fuerzas,\n Levanto mis manos aunque tenga mil problemas,\n\n Cuando levanto mis manos comienzo a sentir,\n Una unci\u00f3n que me hace cantar,\n Cuando levanto mis manos comienzo a sentir el fuego\n Cuando levanto mis manos mis cargas se van\n Nuevas fuerzas t\u00fa me das\n \/\/todo esto es posible\/\/\n Cuando levanto mis manos."},
{"id":307,"ti":"Ll\u00e9name Con Tu Esp\u00edritu","tono":"C","estilo":"0","le":"\/\/\/Ll\u00e9name con tu Esp\u00edritu\/\/\/ Se\u00f1or\n \/\/Ll\u00e9name con tu Esp\u00edritu\/\/\n Ll\u00e9name de ese fuego pulidor.\n\n \/\/Oh fuego ven\/\/\n Prometido don,\n Ven al coraz\u00f3n,\n Ll\u00e9nalo Se\u00f1or."},
{"id":308,"ti":"Ll\u00e9vame A Tus Atrios","tono":"C","estilo":"0","le":"Se\u00f1or ll\u00e9vame a tus atrios,\n Al lugar santo, al altar de bronce,\n Se\u00f1or tu rostro quiero ver.\n\n Pasar\u00e9 la muchedumbre,\n Por donde el sacerdote canta.\n Tengo hambre y sed de justicia\n Y s\u00f3lo encuentro un lugar.\n\n Ll\u00e9vame al lugar sant\u00edsimo,\n Por la sangre del Cordero Redentor,\n Ll\u00e9vame al lugar sant\u00edsimo,\n T\u00f3came, l\u00edmpiame \u00a1Heme aqu\u00ed!"},
{"id":309,"ti":"Llorando Ir\u00e1n","tono":"C","estilo":"0","le":"\/\/Llorando ir\u00e1n los que llevan la precios\u00edsima semilla\/\/\n \/\/M\u00e1s con regocijo volver\u00e1n trayendo sus gavillas\/\/\n\n \/\/Yo s\u00e9 que hay un Dios en los cielos que mirando est\u00e1\/\/\n \/\/En las pruebas en las luchas, yo s\u00e9 que \u00c9l me ayudar\u00e1\/\/\n\n \/\/Los campos est\u00e1n blancos y los obreros pocos\/\/\n \/\/Oh Gloria, aleluya, env\u00edame a m\u00ed\/\/"},
{"id":310,"ti":"Loor A Ti Mi Dios","tono":"C","estilo":"0","le":"Loor a Ti mi Dios en esta noche\n Por todas las bondades de este d\u00eda;\n Oh gu\u00e1rdame y que tus potentes alas\n Sean por siempre la defensa m\u00eda.\n\n De cuantas faltas hoy he cometido;\n Contigo, con el pr\u00f3jimo y conmigo;\n Perd\u00f3name mi Dios por tu hijo amado\n Y haz que mi sue\u00f1o pueda ser tranquilo.\n\n Ens\u00e9\u00f1ame a vivir que no me espante\n La tumba m\u00e1s que el lecho del reposo,\n Ens\u00e9\u00f1ame a morir para que pueda\n El d\u00eda del juicio despertar glorioso.\n\n Y pueda reposar en Ti mi vida,\n Mis p\u00e1rpados los cierre en dulce sue\u00f1o,\n Un sue\u00f1o en que vigor puedas prestarme,\n Para servirte al despertar mi due\u00f1o."},
{"id":311,"ti":"Los \u00cddolos No Tienen Poder","tono":"C","estilo":"0","le":"\/\/\/\/Los \u00eddolos no tienen poder\/\/\/\/\n\n \/\/\/\/Jehov\u00e1 tiene poder\/\/\/\/\n \/\/\u00a1Aleluya! \u00e9l es mi Rey\/\/\n Ojos tiene no pueden ver,\n O\u00eddos tienen no pueden o\u00edr,\n Boca tienen no pueden hablar,\n Manos tienen no pueden palpar.\n\n \/\/\/\/No tienen poder\/\/\/\/\n \/\/\/\/Jehov\u00e1 tiene poder\/\/\/\/"},
{"id":312,"ti":"Los Muros Caen","tono":"C","estilo":"0","le":"\/\/Los muros caen\/\/\n Y se rompen las cadenas\n \/\/Los muros caen\/\/\n Se derrumban fortalezas\n\n \/\/Jehov\u00e1 entrego en mis manos Jeric\u00f3\n Y canten suenan las trompetas\/\/"},
{"id":313,"ti":"Los Que Esperan","tono":"C","estilo":"0","le":"\/\/Los que esperan, los que esperan en Jehov\u00e1\/\/\n\n \/\/Nuevas fuerzas tendr\u00e1n, nuevas fuerzas tendr\u00e1n,\n Sus alas levantar\u00e1n\/\/\n\n Correr\u00e1n y no se cansar\u00e1n,\n Caminar\u00e1n y no se fatigar\u00e1n\n \/\/Como las \u00e1guilas, como las \u00e1guilas sus alas levantar\u00e1n\/\/"},
{"id":314,"ti":"Majestuoso","tono":"C","estilo":"0","le":"Majestuoso, poderoso digno de loor\n Proclamemos su grandeza hoy\n \/\/Jesucristo es rey\/\/\n Postrado estoy ante sus pies\n Jesucristo es Rey."},
{"id":315,"ti":"Majestuoso, Victorioso","tono":"C","estilo":"0","le":"Majestuoso, Victorioso, Vida Eterna y Salvador,\n Dios Todopoderoso, eres T\u00fa mi Gran Se\u00f1or.\n Grandes son tus maravillas, tu palabra es poder,\n Eres la luz de mi vida, en Ti siempre confiar\u00e9.\n\n Yo me regocijar\u00e9 en tu presencia,\n Tu Esp\u00edritu Santo se mueve en mi ser.\n Humillado a tus pies exaltar\u00e9 tu nombre\n Con todas mis fuerzas lo declarar\u00e9:\n\n Jes\u00fas, Jes\u00fas, Jes\u00fas, Jes\u00fas\n Rey Soberano, \u00a1Cu\u00e1n grande es tu Nombre!"},
{"id":316,"ti":"Maravilloso Es El Se\u00f1or","tono":"C","estilo":"0","le":"Maravilloso esel Se\u00f1or Jes\u00fas,\n \u00c9l reina con \/\/\/\/\/poder\/\/\/\/\/\n\n \/\/\u00c9l es mi Rey\/\/\n \/\/Y en su casa danzar\u00e9\/\/"},
{"id":317,"ti":"Marchad Oh Juventud","tono":"C","estilo":"0","le":"Marchad oh juventud\n De Jesucristo nunca pierdas la visi\u00f3n\n Luchad contra sat\u00e1n\n Ese es el lema del cristiano en la oraci\u00f3n\n\n Confiad en el Se\u00f1or\n Por cada triunfo cantar\u00e9 nueva canci\u00f3n.\n Marchad oh juventud\n En pos del galard\u00f3n.\n\n Adelante vamos juventud\n Adelante a la perfecci\u00f3n\n Adelante vamos juventud\n Y una corona Jesucristo nos dar\u00e1\n\n \/\/\/Y si triunfar\u00e9 aqu\u00ed, all\u00e1 tendr\u00e9\/\/\/\n Una corona por toda la eternidad."},
{"id":318,"ti":"M\u00e1s Que Nunca","tono":"C","estilo":"0","le":"M\u00e1s que nunca Se\u00f1or yo te amo,\n M\u00e1s que nunca Se\u00f1or te necesito,\n M\u00e1s que nunca Se\u00f1or quiero decirte:\n \u201cQue hoy te amo m\u00e1s que nunca Se\u00f1or\u201d"},
{"id":319,"ti":"Me Gozar\u00e9","tono":"C","estilo":"0","le":"\/\/Me gozar\u00e9, me alegrar\u00e9 y cantar\u00e9 al Se\u00f1or,\n Porque han llegado las bodas del cordero de Dios\/\/\n\n \/\/Y a su esposa se le ha concedido,\n Que se vista de lino fino,\n Lino limpio y resplandeciente\n Para recibir al Rey\/\/"},
{"id":320,"ti":"Me Gozar\u00e9 En Tu Presencia","tono":"C","estilo":"0","le":"Me gozar\u00e9 en tu presencia Jehov\u00e1\n Con todas mis fuerzas gritar\u00e9 \u00a1hey!\n Me gozar\u00e9 en tu presencia Jehov\u00e1\n Con todas mis fuerzas gritar\u00e9.\n\n Ante Ti con gozo cantar\u00e9,\n Con alegre danza celebrar\u00e9,\n Danzar\u00e9 y me gozar\u00e9."},
{"id":321,"ti":"Me Ha Tocado","tono":"C","estilo":"0","le":"Me ha tocado, s\u00ed me ha tocado.\n Y ahora s\u00e9 que el salvador\n Sana, salva, viene por m\u00ed;\n Me ha tocado Cristo el Se\u00f1or."},
{"id":322,"ti":"Merecedor De Alabanza","tono":"C","estilo":"0","le":"Merecedor de alabanza,\n Aquel que vino a salvarme,\n Merecedor de alabanza\n Que siendo yo un pecador,\n No estim\u00f3 su linaje al morir en la cruz,\n Merecedor de alabanza\n Por los siglos sea Jes\u00fas.\n\n El d\u00eda que no le alabo\n El alma se me entristece,\n Pues donde no hay alabanza\n \u00c9l no est\u00e1 presente,\n Un sacrificio tan grande\n No debe pasar por alto,\n A Cristo le digo santo\n Aunque crean que estoy loco.\n\n \/\/\/Santo\/\/\/"},
{"id":323,"ti":"Mi Alma Anhela Estar","tono":"C","estilo":"0","le":"Mi alma anhela estar postrada ante tu altar\n Y siempre adorar tu santo nombre\n Tu gloria levantar tu belleza contemplar\n Y siempre exaltar tu santo nombre.\n\n En tu presencia quiero habitar,\n Mi vida consagrarte, de coraz\u00f3n amarte,\n Bajo tu sombra quiero morar,\n Mi vida consagrarte, de coraz\u00f3n Se\u00f1or amarte."},
{"id":324,"ti":"Mi Anhelo","tono":"C","estilo":"0","le":"\/\/Mi anhelo es buscarde d\u00eda y noche\n De tu amor y la ternura de tu Esp\u00edritu Se\u00f1or\/\/\n\n En tu presencia hay plenitud de gozo,\n En tu presencia delicias a tu diestra\n Por siempre y para siempre,\n Me gozo en tu presencia."},
{"id":325,"ti":"Mi Dios","tono":"C","estilo":"0","le":"Dios de milagros y amor,\n Sanas y das Salvaci\u00f3n,\n Incomparable eres T\u00fa.\n\n Brillas en la oscuridad,\n Clamamos por tu libertad,\n Incomparable eres T\u00fa.\n\n Mi Dios es grande, mi Dios es fuerte,\n Nadie es igual, nadie le hace frente;\n Dios sana y salva, con gloria se exalta\n Mi Dios, mi Dios.\n\n \/\/Y si Dios con nosotros,\n \u00bfQui\u00e9n pues contra nosotros?\n Y si Dios nos levanta,\n \u00bfQui\u00e9n pues nos detendr\u00e1?\/\/\n \u00bfQui\u00e9n pues nos detendr\u00e1?"},
{"id":326,"ti":"Mi Dios Es Bueno","tono":"C","estilo":"0","le":"\/\/\/Mi Dios es bueno\/\/\/\n \u00c9l es bueno para m\u00ed\n\n \/\/\/Aleluya\/\/\/\n \u00c9l es bueno para m\u00ed."},
{"id":327,"ti":"Mi Ofrenda Doy","tono":"C","estilo":"0","le":"\/\/Mi ofrenda doy\/\/\n Aleluya, mi ofrenda doy\n Y as\u00ed contribuyendo el evangelio extiendo,\n Aleluya, mi ofrenda doy."},
{"id":328,"ti":"Mi Pan, Mi Luz","tono":"C","estilo":"0","le":"Al entrar a tu santo lugar,\n Me asombra que me pueda acercar,\n Para ver tu gloria y tu belleza\n Y adorarte en intimidad.\n\n En confianza yo me puedo acercar,\n En tu mesa quiero participar,\n Todo lo que puedo hacer es postrarme\n Y con mis labios proclamar.\n\n Mi pan, mi luz, mi oraci\u00f3n,\n Eres T\u00fa Jes\u00fas,\n Mi Dios, mi amor y mi canci\u00f3n,\n Eres T\u00fa Jes\u00fas, s\u00f3lo T\u00fa\n \/\/Me cuidas, me abrazas,\n Me cantas, me amas\/\/"},
{"id":329,"ti":"Mi Pensamiento Eres T\u00fa","tono":"C","estilo":"0","le":"\/\/Mi pensamiento eres T\u00fa Se\u00f1or\/\/\n\n Porque T\u00fa me has dado la vida,\n Porque T\u00fa me has dado el sentir,\n Porque T\u00fa me has dado cari\u00f1o,\n Me has dado amor.\n\n Por la ma\u00f1ana pienso en Ti, Se\u00f1or.\n Al mediod\u00eda pienso en Ti, Se\u00f1or.\n Y por la noche pienso en Ti, Se\u00f1or.\n Mi pensamiento eres T\u00fa. "},
{"id":330,"ti":"Mi Vida Est\u00e1 Cerca De Ti","tono":"C","estilo":"0","le":"Mi vida est\u00e1 cerca de Ti Jes\u00fas,\n Mi vida se esconde en tu mirar,\n Todo lo que soy lo entrego a Ti,\n T\u00f3malo, porque sin Ti no s\u00e9 vivir,\n Porque sin Ti no ser\u00eda m\u00e1s;\n Consolador, refugio y paz eres T\u00fa\n Tu nombre poderoso es,\n Incomparable eterno es,\n El nombre exaltado aqu\u00ed es Jes\u00fas,\n Mi alabanza te dar\u00e9\n Pues t\u00fa mereces toda honra y poder,\n Eres T\u00fa el Dios de todo poder.\n Yo aprend\u00ed de tu vivir, yo aprend\u00ed de tu existir,\n Me ense\u00f1aste c\u00f3mo amar,\n Gu\u00edame como guiaste a Israel,\n Le diste promesa eterna y fiel,\n Ahora Jes\u00fas somos tu pueblo tambi\u00e9n."},
{"id":331,"ti":"Mirad Bendecid A Jehov\u00e1","tono":"C","estilo":"0","le":"\/\/Mirad bendecid a Jehov\u00e1,\n Vosotros los hijos de Dios\/\/\n\n \/\/Alzad vuestras manos batidlas a \u00c9l\n Y decidle que s\u00f3lo \u00c9l es Rey\/\/"},
{"id":332,"ti":"Mu\u00e9strame Tu Gloria","tono":"C","estilo":"0","le":"\/\/Mu\u00e9strame tu Gloria, tu Gloria\n T\u00fa voz yo quiero o\u00edr\/\/\n\n Aunque el mundo se olvide de tu ley\n De Ti me acordar\u00e9,\n La llama encendida mantendr\u00e9\n T\u00f3came con brasas de tu altar,\n Pur\u00edficame\n Porque yo siempre anhelar\u00e9 o\u00edrte\n\n Habla que tu siervo te oir\u00e1\n Yo fui consagrado en tu altar\n \u00abHeme aqu\u00ed\u00bb dir\u00e9 a tu llamar\n Porque yo naci para adorarte\n\n Cuando se levanten gigantes\n Y la multitud se disperse\n Y aunque nadie quiera obedecerte\n Se\u00f1or \/\/ven a buscarme\/\/\n\n \/\/M\u00faestrame tu gloria\/\/"},
{"id":333,"ti":"M\u00fasica Del Cielo","tono":"C","estilo":"0","le":"Vamos a cantar con la m\u00fasica del cielo,\n Vamos a cantar alegres porque escuchas\n Cuando cantamos para exaltar tu Nombre.\n\n Amamos todo de Ti, tu creaci\u00f3n te adora,\n Los reinos se rinden, Hijo de Dios eres porque...\n Eres porque vivimos hoy\n Eres quien nos liberta, eres la luz que gu\u00eda,\n Y con un fuego ardiente, Hijo de Dios eres porque...\n Eres porque vivimos hoy."},
{"id":334,"ti":"Nada Es Imposible Para Dios","tono":"C","estilo":"0","le":"Nada es imposible para Dios\n La lepra de Naam\u00e1n cur\u00f3,\n Nada es imposible para Dios\n El vientre de la est\u00e9ril fruto dio\n\n A L\u00e1zaro resucit\u00f3 a muchos \u00c9l san\u00f3,\n S\u00f3lo tienes que creer\n Que nada es imposible para Dios."},
{"id":335,"ti":"No Basta","tono":"C","estilo":"0","le":"No basta s\u00f3lo con cantar,\n No basta s\u00f3lo con decir,\n No es suficiente s\u00f3lo con querer hacer,\n Es necesario morir.\n\n No basta s\u00f3lo con so\u00f1ar,\n No basta s\u00f3lo con pedir,\n No es suficiente s\u00f3lo con querer tener\n Es necesario morir.\n\n Dame tu vida, esa clase de vida que sabes dar;\n Dame tu vida, yo quiero vivir s\u00f3lo para Ti,\n Dame tu vida, resuc\u00edtame en Ti,\n Yo quiero vivir s\u00f3lo para Ti."},
{"id":336,"ti":"No Dar\u00e9 Mi Vida A Nadie M\u00e1s","tono":"C","estilo":"0","le":"\/\/No dar\u00e9 mi vida a nadie m\u00e1s que a Ti\/\/\n \/\/No dar\u00e9 mi vida a nadie m\u00e1s\/\/\n Porque s\u00f3lo T\u00fa me puedes sostener.\n\n \/\/No dar\u00e9 mi amor a nadie m\u00e1s que a Ti\/\/\n \/\/No dar\u00e9 mi amor a nadie m\u00e1s\/\/\n Porque s\u00f3lo T\u00fa me puedes sostener.\n\n \/\/No dar\u00e9 mi canto a nadie m\u00e1s que a Ti\/\/\n \/\/No dar\u00e9 mi canto a nadie m\u00e1s\/\/\n Porque s\u00f3lo T\u00fa me puedes sostener.\n\n \/\/No dar\u00e9 la gloria a nadie m\u00e1s que a Ti\/\/\n \/\/No dar\u00e9 mi gloria a nadie m\u00e1s\/\/\n Porque s\u00f3lo T\u00fa me puedes sostener."},
{"id":337,"ti":"No Hay Dios Tan Grande Como T\u00fa","tono":"C","estilo":"0","le":"No hay Dios tan grande como T\u00fa\n \/\/no lo hay\/\/\n \/\/No hay Dios que pueda hacer las obras\n Como las que haces T\u00fa\/\/\n\n \/\/No es con espada ni con ej\u00e9rcito,\n Mas con su Santo Esp\u00edritu\/\/\n \/\/\/y esta iglesia se mover\u00e1\/\/\/\n Con su Santo Esp\u00edritu."},
{"ti":"No Hay Lugar Ms Alto","le":"A tus pies, arde mi corazn.\n A tus pies, entrego lo que soy.\n Es el lugar, de mi seguridad\n Donde nadie, me puede sealar.\n\n Me perdonaste,\n Me acercaste a tu presencia,\n Me levantaste,\n Hoy me postro adorarte.\n\n \/\/No hay lugar ms alto, ms grande\n Que estar a tus pies.\n Que estar a tus pies.\/\/\n\n \/\/Y aqu permanecer\n Postrado a tus pies.\n Y aqu permanecer\n A los pies de Cristo\/\/ ","name":"Corario IPUC castilla.js","id":"338","tono":"C","estilo":"0"},
{"id":339,"ti":"No Hay Nadie Como T\u00fa","tono":"C","estilo":"0","le":"\/\/No hay nadie como T\u00fa,\n No hay nadie como T\u00fa,\n Precioso y glorioso\n Tan bello y tan hermoso\/\/\n \/\/Jes\u00fas\/\/ precioso Jes\u00fas."},
{"id":340,"ti":"No Hay Otro Tan Fiel Y Verdadero","tono":"C","estilo":"0","le":"\/\/No hay otro tan fiel y verdadero\n Como es el Cristo vivo que me salv\u00f3 a m\u00ed\/\/\n\n \/\/Que perdona, que salva y que da vida\n Como es el Cristo vivo que me salv\u00f3 a m\u00ed\/\/"},
{"id":341,"ti":"No Hay Problema Tan Grande","tono":"C","estilo":"0","le":"No hay problema tan grande que Dios no resuelva,\n No hay monta\u00f1a tan alta que Dios no mueva,\n No hay tormenta tan negra que Dios no calme,\n No hay dolor ni angustia que Dios no la sane,\n\n Si \u00c9l llev\u00f3 las cargas del mundo sobre sus hombros,\n Cristo tus cargas tambi\u00e9n la llevar\u00e1."},
{"id":342,"ti":"No Hay Santo Como Nuestro Dios","tono":"C","estilo":"0","le":"\/\/No, no puedo parar de alabarle\/\/\n No puedo parar de adorarle a \u00c9l.\n\n \/\/\/No hay Santo como nuestro Dios\/\/\/\n El Se\u00f1or."},
{"id":343,"ti":"No Me Soltar\u00e1s","tono":"C","estilo":"0","le":"I\n Aunque yo est\u00e9 en el valle de la muerte y dolor,\n Tu amor me quita todo temor.\n Y si llego a estar en el centro de la tempestad,\n No dudar\u00e9, porque est\u00e1s aqu\u00ed.\n\n Y no temer\u00e9 del mal\n Pues mi Dios conmigo est\u00e1,\n Y si Dios conmigo est\u00e1\n \u00bfDe qui\u00e9n temer\u00e9?\n\n CORO\n \/\/\/No\/\/\/ me soltar\u00e1s\n En la calma o la tormenta\n \/\/\/No\/\/\/ me soltar\u00e1s\n En lo alto, en lo bajo\n \/\/\/No\/\/\/ me soltar\u00e1s,\n Dios nunca me dejar\u00e1s.\n\n II\n Puedo ver la luz que se acerca al que busca de Ti,\n Gloriosa luz cual otra no hay.\n Y terminar\u00e1n los problemas\n Y mientras llega el fin\n Viviremos conoci\u00e9ndote a Ti.\n\n Y no temer\u00e9 del mal\n Pues mi Dios conmigo est\u00e1,\n Y si Dios conmigo est\u00e1\n \u00bfDe qui\u00e9n temer\u00e9?\n\n III\n Puedo ver la luz que se acerca al que busca de Ti\n Y terminar\u00e1n los problemas\n Y mientras llega el fin\n \/\/voy a alabarte\/\/ solo a Ti."},
{"id":344,"ti":"No Sabes T\u00fa Pecador","tono":"C","estilo":"0","le":"\/\/No sabes t\u00fa pecador\n Que Jes\u00fas su sangre derram\u00f3\/\/\n\n \/\/La derram\u00f3, la derram\u00f3 por tus pecados\n Y por los m\u00edos tambi\u00e9n la derram\u00f3\/\/"},
{"id":345,"ti":"Nos Vamos A Gozar","tono":"C","estilo":"0","le":"\/\/Nos vamos a gozar\/\/\n En las bodas del cordero nos vamos a gozar\n Y luego nos iremos a la patria celestial\n A morar con Jesucristo por toda la eternidad.\n\n Me ver\u00e1s en gloria \/\/\/me ver\u00e1s\/\/\/\n Me ver\u00e1s en gloria, me ver\u00e1s\n \/\/cantando alegre por toda la eternidad\/\/"},
{"id":346,"ti":"Oh Moradora De Sion","tono":"C","estilo":"0","le":"\/\/Oh moradora de Sion alaba a Jehov\u00e1,\n Grandes son sus maravillas\/\/\n\n Sobre los montes y collados a mi amado buscar\u00e9,\n Grande es su hermosura,\n Y al estar en su presencia gozoso danzar\u00e9,\n Al Se\u00f1or alabar\u00e9.\n\n Grande es Jehov\u00e1, digno de alabar\n Grande es Jehov\u00e1 \/\/\/digno de alabar\/\/\/\n \/\/T\u00fa eres grande Jehov\u00e1,\n Grande es tu nombre\/\/"},
{"id":347,"ti":"Oh No Sab\u00e9is","tono":"C","estilo":"0","le":"\/\/\/Oh no sab\u00e9is, oh no sab\u00e9is\n Que sois el templo\/\/\/\n Sois el templo del Esp\u00edritu de Dios.\n\n \/\/\/Lleno de poder, lleno de amor,\n Lleno de gracia\/\/\/\n Sois el templo del Esp\u00edritu de Dios.\n\n \/\/\/Aplaudid, aplaudid que sois el templo\/\/\/\n Sois el templo del Esp\u00edritu de Dios."},
{"id":348,"ti":"\u00a1oh Qu\u00e9 Alegr\u00eda!","tono":"C","estilo":"0","le":"\/\/Oh, qu\u00e9 alegr\u00eda lleg\u00f3 el pentecost\u00e9s\n El fuego santo comenzado a descender\/\/\n\n \/\/No hay tristeza que aguante,\n Toda tiene que salir;\n El fuego santo cayendo\n Hace a la iglesia subir\/\/"},
{"id":349,"ti":"Oh Se\u00f1or Te Ruego","tono":"C","estilo":"0","le":"\/\/Oh se\u00f1or te ruego no me desampares\n Quiero estar contigo all\u00e1 en el cielo\/\/\n\n \/\/Alrededor del trono y formar un coro\n Junto a mis hermanos y glorificarte\/\/"},
{"id":350,"ti":"Oh Ven","tono":"C","estilo":"0","le":"\/\/Oh ven\/\/ ven ante la majestad, del supremo Rey.\n Oh ven, postr\u00e9monos ante el Rey de los cielos,\n D\u00e9mosle gloria, d\u00e9mosle gloria.\n\n Al que es, y que siempre ser\u00e1,\n \u00c9l es digno, digno es de mi alabanza.\n Adoremos, alabemos, al Rey."},
{"id":351,"ti":"Oye Israel","tono":"C","estilo":"0","le":"\/\/Oye Israelel se\u00f1or uno es,\n No hay dos ni tres solo uno vendr\u00e1\/\/\n\n Hay un se\u00f1or, un bautismo, una fe\n Y una doctrina pentecostal,\n Y hay un nombre sobre todo nombre\n Glorioso nombre el de Jes\u00fas."},
{"id":352,"ti":"Padre Nuestro","tono":"C","estilo":"0","le":"Padre nuestro que estas en los cielos,\n De rodillas yo vengo a tus pies,\n Implorando y pidi\u00e9ndole al cielo,\n Que me ayude a sentirte otra vez.\n Es tan lindo sentir tu presencia,\n Para cantar, re\u00edr y llorar,\n \/\/Y decir gloria a Dios aleluya,\n Y tu nombre as\u00ed glorificar\/\/\n Si al sentir tu presencia yo lloro,\n No es tristeza, tampoco es dolor,\n Es un gozo que siento en el alma,\n Que de arriba me manda el Se\u00f1or."},
{"id":353,"ti":"Pandero Y Danza","tono":"C","estilo":"0","le":"\/\/Pandero y danza\/\/\n \/\/Preparados para alabar al Se\u00f1or\/\/\n\n \/\/Hosanna, hosanna al hijo de David\/\/\n\n Salgamos con palmas en las manos\n Que ya viene el Rey de gloria\n Salgamos alabando su nombre\n Porque \u00c9l vive para siempre.\n\n \/\/Hosanna, hosanna al hijo de David\/\/"},
{"id":354,"ti":"Para M\u00ed Es El Rey Del Universo","tono":"C","estilo":"0","le":"I\n Para muchos Jesucristo a quien yo amo\n No es m\u00e1s que un pobre malhechor,\n No es m\u00e1s que la burla de la gente,\n No es m\u00e1s que un profeta que muri\u00f3.\n\n CORO:\n \/\/Para m\u00ed es el rey del universo,\n Para m\u00ed es el principio y el fin,\n Para m\u00ed Cristo es el Dios eterno,\n Siempre en todo, \u00e9l es todo para m\u00ed.\/\/\n\n II\n Unos dicen que fue un pobre carpintero,\n Otros dicen que fue un sabio y nada m\u00e1s,\n Otros dicen que Jes\u00fas no fue sincero,\n Y que Hijo del Gran Dios no fue jam\u00e1s."},
{"id":355,"ti":"Para Ti Oh Se\u00f1or","tono":"C","estilo":"0","le":"\/\/Para Ti oh Se\u00f1or, para Ti quiero cantar,\n Siento gozo en mi alma cuando canto para Ti\/\/\n\n \/\/Por tu grande amor elevo m\u00e1s mi voz\n Y mi alma se goza cuando canto para Ti\/\/"},
{"id":356,"ti":"Paz En La Tormenta","tono":"C","estilo":"0","le":"Cuando lloras, por las veces que intentaste\n Y tratas de olvidar las l\u00e1grimas que lloraste\n Solo tienes pena y tristeza,\n El futuro incierto esperas,\n Puedes tener paz en la tormenta.\n\n Muchas veces me siento igual que t\u00fa,\n Y mi coraz\u00f3n anhela algo real,\n El Se\u00f1or viene a m\u00ed y me ayuda a seguir\n En paz en medio de la tormenta.\n\n \/\/Puedes tener paz en la tormenta,\n Esperanza cuando no puedas seguir,\n Aun con tu mundo hecho pedazos\n El Se\u00f1or guiar\u00e1 tus pasos,\n En paz en medio de la tormenta\/\/"},
{"id":357,"ti":"Pecador, El Santo Esp\u00edritu Te Llama","tono":"C","estilo":"0","le":"I\n \/\/Ya mi vida se la debo a Jes\u00fas\n Porque \u00c9l muri\u00f3 en la cruz por m\u00ed\/\/\n\n CORO\n \/\/Vida nueva encontr\u00e9 a los pies de Jes\u00fas\n Porque Cristo mi deuda pag\u00f3\/\/\n\n II\n \/\/Yo me rindo a los pies de Jes\u00fas, mi Se\u00f1or,\n Porque fui un infiel pecador\/\/\n\n III\n \/\/Pecador el Santo Esp\u00edritu te llama a ti,\n Ven a Cristo y salvo ser\u00e1s\/\/"},
{"id":358,"ti":"Pelea","tono":"C","estilo":"0","le":"Cuando las cosas no salgan como t\u00fa pensabas, pelea.\n Cuando parezca imposible ganar la batalla, pelea.\n Pelea esta guerra, porque la calle est\u00e1 llena de rendidos,\n Pelea sin tregua, no des tu brazo a torcer te lo pido\n Y cuando las cosas no vayan bien, t\u00fa, pelea.\n\n Cuando te digan que eres un caso perdido, pelea.\n Hay en el cielo un amigo que por ti dio la vida entera.\n Pelea esta guerra, porque la calle est\u00e1 llena de rendidos,\n Pelea sin tregua, no des tu brazo a torcer te lo pido\n Y cuando las cosas no vayan bien, t\u00fa, pelea.\n\n La batalla est\u00e1 dentro de ti y eres tu propio enemigo.\n Es de valientes saber combatir, yo te lo digo.\n Cuando las cosas no salgan bien, cuenta con cristo\n \u00c9l se enfrent\u00f3 como t\u00fa tambi\u00e9n y ha vencido.\n\n Pelea esta guerra, porque la calle est\u00e1 llena de rendidos,\n Pelea sin tregua, no des tu brazo a torcer te lo pido\n Y cuando las cosas no vayan bien, t\u00fa, pelea.\n"},
{"id":359,"ti":"Perfume A Tus Pies","tono":"C","estilo":"0","le":"I\n Cuando pienso en tu amor y en tu fidelidad,\n No puedo hacer m\u00e1s,\n Que postrarme y adorar\n Y cuando pienso en c\u00f3mo he sido\n Y hasta d\u00f3nde me has tra\u00eddo,\n Me asombro de Ti\n Y no me quiero conformar,\n He probado y quiero m\u00e1s.\n\n CORO\n Yo quiero enamorarme m\u00e1s de Ti,\n Ens\u00e9\u00f1ame a amarte y a vivir,\n Conforme a tu justicia y tu verdad,\n Con mi vida quiero adorar.\n Todo lo que tengo y lo que soy,\n Todo lo que he sido te lo doy,\n Que mi vida sea para Ti\n Como un perfume a tus pies.\n\n II\n Cuando pienso en tu cruz\n Y en todo lo que has dado,\n Tu sangre por m\u00ed, por llevar mi pecado\n Y cuando pienso en tu mano\n Hasta aqu\u00ed hemos llegado por tu fidelidad.\n Y no me quiero conformar\n He probado y quiero m\u00e1s."},
{"id":360,"ti":"P\u00eddeme Y Te Dar\u00e9","tono":"C","estilo":"0","le":"P\u00eddeme y te dar\u00e9 por herencia las naciones\n Y como posesiones los confines de la tierra.\n\n El que pide recibe, el que busca halla,\n El que me llama se le abrir\u00e1."},
{"id":361,"ti":"Pon Aceite En Mi L\u00e1mpara","tono":"C","estilo":"0","le":"\/\/Pon aceite en mi l\u00e1mpara Se\u00f1or\/\/\n Que yo quiero servirte con amor\n Pon aceite en mi l\u00e1mpara Se\u00f1or.\n\n Se\u00f1or Jes\u00fas tu eres mi vida,\n Se\u00f1or Jes\u00fas tu eres mi amor.\n\n \/\/Salvaste mi alma perdida\n Por eso te alabo con el coraz\u00f3n\/\/\n \/\/con el coraz\u00f3n\/\/"},
{"id":362,"ti":"Pon Aceite En Mi Vida","tono":"C","estilo":"0","le":"\/\/Pon aceite en mi vida Se\u00f1or,\n De tu fuego en mi coraz\u00f3n,\n Pon aceite en mi vida Se\u00f1or,\n Mi l\u00e1mpara aviva hoy\/\/\n\n Y me gozar\u00e9 y me alegrar\u00e9,\n \u00c9l me ha vestido de lino fino,\n Del gozo de su salvaci\u00f3n.\n\n Y me gozar\u00e9 y me alegrar\u00e9,\n Convidado he sido a las bodas\n A mi Rey pronto ver\u00e9."},
{"id":363,"ti":"Por El Poder De Tu Amor","tono":"C","estilo":"0","le":"I\n Vengo a Ti Se\u00f1or, c\u00e1mbiame, renu\u00e9vame,\n Por la gracia que encontr\u00e9 en Ti\n Ahora s\u00e9 que las debilidades que hay en m\u00ed,\n Desvanecer\u00e1n con el poder de tu amor.v \n CORO\n C\u00fabreme, con tu amor, rod\u00e9ame,\n T\u00f3mame cerca quiero estar;\n Y al esperar nuevas fuerzas yo tendr\u00e9\n Y me levantar\u00e9 como las \u00e1guilas\n Con el poder de tu amor.\n\n II\n Yo te quiero ver cara a cara oh Se\u00f1or\n Y conocer as\u00ed m\u00e1s de Ti en m\u00ed,\n Prep\u00e1rame Se\u00f1or para hacer tu voluntad,\n Viviendo cada d\u00eda por el poder de tu amor."},
{"id":364,"ti":"Por Eso Yo Te Canto","tono":"C","estilo":"0","le":"Eres Se\u00f1or Vencedor, el Invencible,\n Eres Campe\u00f3n, Ganador en batalla,\n Eres mi Rey y mi Dios,\n El que cuida a su pueblo.\n\n Por eso yo te canto y te alabo,\n Porque s\u00e9 que me proteges\n Porque estoy de tu lado,\n Por eso yo te canto y te adoro,\n Porque s\u00e9 que nunca jam\u00e1s\n Me dejar\u00e1s desamparado."},
{"id":365,"ti":"Por Un Momento En Tu Presencia","tono":"C","estilo":"0","le":"Por un momento en tu presencia,\n Por un instante de tu amor,\n Por un destello de tu gloria,\n Por un minuto nada m\u00e1s.\n\n Todo dar\u00eda\u2026 no importar\u00eda\n Lo que tenga que pasar,\n Lo que tenga que esperar.\n\n \/\/Tengo hambre de Ti, de tu presencia,\n De tu fragancia, de tu poder,\n Hambre que duele, que debilita,\n Que desespera por Ti\/\/\n\n Tengo hambre de Ti, Oh, Oh;\n Hambre de Ti Se\u00f1or."},
{"id":366,"ti":"Porque Grande Es Jehov\u00e1","tono":"C","estilo":"0","le":"\/\/Porque grande es Jehov\u00e1\n Y digno de suprema alabanza\n Adorad a Jehov\u00e1 en la hermosura de la santidad\/\/\n\n \/\/Y temed delante de \u00c9l toda la tierra\/\/\n \/\/\/porque grande es Jehov\u00e1\/\/\/\n Nuestro Dios."},
{"id":367,"ti":"Porque Para Siempre Dios","tono":"C","estilo":"0","le":"\/\/Porque para siempre Dios\n Tu misericordia es\/\/\n\n Mejor que la vida es, mi alma lo sabe bien,\n Porque para siempre Dios,\n Tu misericordia es\n\n M\u00e1s vasta que el ancho mar,\n M\u00e1s alta que el cielo est\u00e1,\n Porque para siempre Dios,\n Tu misericordia es."},
{"id":368,"ti":"Porque T\u00fa Eres Bueno","tono":"C","estilo":"0","le":"Porque T\u00fa eres bueno,\n Porque para siempre tu misericordia es\n \/\/Cada ma\u00f1ana al despertar,\n S\u00e9 que en Ti puedo confiar,\n Me sostienes por tu gran fidelidad\/\/\n\n Porque T\u00fa eres bueno,\n Porque tu justicia, justicia eterna es\n Y en ella yo me deleitar\u00e9,\n En tu verdad caminar\u00e9,\n Por tu sendas de justicia gu\u00edame."},
{"id":369,"ti":"Postr\u00e1ndonos Ante Ti","tono":"C","estilo":"0","le":"Postr\u00e1ndonos ante Ti Se\u00f1or,\n Tu presencia lo llena todo,\n Los cielos no pueden contenerte,\n Ni tampoco el universo.\n\n Mas qui\u00e9n soy yo para servirte,\n Para que me consideres,\n Si eres Alfa y Omega,\n Sin principio y sin fin,\n Dios todo poderoso,\n Est\u00e1s vestido de majestad, de majestad."},
{"id":370,"ti":"Precioso Jes\u00fas","tono":"C","estilo":"0","le":"Al contemplar tu obra en la cruz\n Tanto amor derramado y todo por m\u00ed\n Con gratitud me quiero acercar\n S\u00f3lo tengo mi vida ac\u00e9ptala.\n\n No s\u00e9 c\u00f3mo expresarme ante tu hermosura\n Rodeada de gloria y poder\n Necesito decirte lo que siento ahora\n Me acerco a Ti, al santo lugar.\n\n Precioso Jes\u00fas, mi redentor,\n Amado se\u00f1or eres todo para m\u00ed\n Te adorar\u00e9 cada d\u00eda de mi vida\n No puedo vivir si no est\u00e1s junto a m\u00ed."},
{"id":371,"ti":"Pronto Vendr\u00e1 El Se\u00f1or","tono":"C","estilo":"0","le":"Pronto vendr\u00e1 el Se\u00f1or\n Su Iglesia levantar gloriosa,\n La iglesia que \u00c9l compr\u00f3\n A precio de sangre preciosa\n Sus \u00c1ngeles vendr\u00e1n,\n All\u00ed se reunir\u00e1 su pueblo,\n \/\/all\u00ed yo quiero estar para escuchar su voz,\n Cuando me diga ven buen siervo\/\/\n\n D\u00f3nde est\u00e1n los que dec\u00edan aleluya\n D\u00f3nde est\u00e1n los que dec\u00edan gloria a Dios\n D\u00f3nde est\u00e1n, que los buscan, no los hallan;\n Es que el Se\u00f1or su Iglesia levant\u00f3."},
{"id":372,"ti":"Pueblos Todos","tono":"C","estilo":"0","le":"\/\/Pueblos todos batid las manos\n Aclamad a Dios con voz de j\u00fabilo\/\/\n\n \/\/Porque Jes\u00fas el Alt\u00edsimo\n Es Rey grande sobre la tierra\/\/"},
{"id":373,"ti":"Puedo Confiar En El Se\u00f1or","tono":"C","estilo":"0","le":"\/\/Puedo confiar en el Se\u00f1or que no va a faltar\/\/\n\n Si el sol llegara a oscurecer y no brille m\u00e1s,\n Yo igual confi\u00f3 en el Se\u00f1or que \u00c9l no va a faltar.\n\n Puedo descansar, puedo descansar\n Y a su mansi\u00f3n Cristo me guiar\u00e1,\n Si el sol llegara a oscurecer y no brille m\u00e1s,\n Yo igual confi\u00f3 en el se\u00f1or que \u00c9l no va a faltar."},
{"id":374,"ti":"Puedo Sentir Que Est\u00e1s Aqu\u00ed","tono":"C","estilo":"0","le":"Puedo sentir que est\u00e1saqu\u00ed,\n Que est\u00e1s entre tu pueblo,\n Nos llenas con el gran poder,\n De tu santo Esp\u00edritu.\n\n Hoy yo te veo por la fe,\n Siento tu Esp\u00edritu muy dentro de mi ser,\n Pero mi m\u00e1s grande esperanza es saber,\n Que con mis ojos te ver\u00e9."},
{"id":375,"ti":"Pues T\u00fa Glorioso Eres","tono":"C","estilo":"0","le":"\/\/Pues T\u00fa glorioso eres Se\u00f1or\n Y tu nombre es digno de alabar,\n Haz mi coraz\u00f3n puro y santo ante Ti,\n Yo te adoro con todo mi coraz\u00f3n\/\/\n\n Yo te adoro Se\u00f1or con todo mi ser,\n Yo con salmos te alabar\u00e9.\n Yo te adoro Se\u00f1or con todo mi ser,\n Todo el d\u00eda te alabar\u00e9.\n\n \/\/Yo te amo\/\/\n \/\/Yo confi\u00f3 en Ti\/\/\n \/\/Yo te amo\/\/\n En la roca me refugiar\u00e9."},
{"id":376,"ti":"\u00a1qu\u00e9 Bonito Es!","tono":"C","estilo":"0","le":"\/\/\u00a1Qu\u00e9 bonito es andar con Cristo!\n \u00a1Qu\u00e9 bonito es andar con \u00c9l!\/\/\n\n \/\/\u00c9l es mi pastor, \u00c9l es mi creador,\n \u00c9l es mi todo, mi fortaleza\/\/"},
{"id":377,"ti":"\u00a1qu\u00e9 Bueno Es El Se\u00f1or!","tono":"C","estilo":"0","le":"CORO\n \u00a1Qu\u00e9 bueno es el Se\u00f1or!\n \u00a1Tan bueno para m\u00ed!\n Que no puedo entender su grande amor\n Su Esp\u00edritu me dio y libertado fui\n \u00a1Qu\u00e9 bueno es para m\u00ed!\n No me dejar\u00e1.\n\n I\n Hay d\u00edas malos, momentos de dolor,\n Hay d\u00edas tristes y tiempos de aflicci\u00f3n;\n Pero al mirar atr\u00e1s no me puedo quejar,\n Pues en lo malo y en lo bueno \u00c9l me ha de ayudar.\n\n II\n Cuando hay problemas y dura tentaci\u00f3n\n Pregunto a mi Se\u00f1or: \u00bfqu\u00e9 pasa en m\u00ed?\n Pues \u00c9l conoce bien, aun lo que yo no s\u00e9\n Le digo: \u00a1Gracias Dios! No me he de quejar."},
{"id":378,"ti":"\u00a1qu\u00e9 Bueno Es Jesucristo!","tono":"C","estilo":"0","le":"\/\/\/\u00a1Qu\u00e9 bueno es Jesucristo\n \u00c9l me salv\u00f3 a m\u00ed!\/\/\/\n Y por ser \u00c9l tan bueno\n Quiere salvarte a ti.\n\n \/\/\/Qu\u00e9 bueno es, qu\u00e9 bueno es,\n Qu\u00e9 bueno es el Se\u00f1or\/\/\/\n \/\/Y por ser \u00c9l tan bueno\n Quiere salvarte a ti\/\/"},
{"id":379,"ti":"Que Le Alaben","tono":"C","estilo":"0","le":"I\n Que le alaben los montes y los valles,\n Que le alaben la tierra y el mar,\n Que le alaben los hombres y las aves\n Y nunca, nunca dejen de alabar.\n\n CORO\n \/\/\/Aleluya\/\/\/ al Cordero de Dios.\n\n II\n All\u00ed en el cielo todos cantan aleluya,\n Yo tambi\u00e9n voy a cantar."},
{"id":380,"ti":"\u00a1qu\u00e9 Lindo Es Sentir!","tono":"C","estilo":"0","le":"I\n \u00a1Qu\u00e9 dulce es tu presencia oh Se\u00f1or!\n M\u00e1s dulce que la miel \u00a1qu\u00e9 dulce es!\n No puedo compararla, no.\n Con nada en este mundo, no.\n \u00a1Oh cu\u00e1nto te amo mi Jes\u00fas!\n\n CORO\n \u00a1Qu\u00e9 lindo es sentir a Dios!\n \u00a1Qu\u00e9 lindo es sentir su amor!\n Su presencia es real aqu\u00ed,\n S\u00f3lo tienes que adorar\n Y su presencia sentir,\n Jes\u00fas mi Se\u00f1or est\u00e1 aqu\u00ed\n\n II\n \u00a1C\u00f3mo refrescas mi alma oh Se\u00f1or!\n Tu gozo y paz inconfundible es;\n Siento en m\u00ed vida tu poder,\n R\u00edos de agua viva en m\u00ed ser.\n \u00a1Oh cuanto te amo, mi Jes\u00fas!"},
{"id":381,"ti":"\u00a1qu\u00e9 Maravilla Es Tener Una Familia!","tono":"C","estilo":"0","le":"\u00a1Qu\u00e9 maravilla es tener una familia,\n Una familia en Cristo Jes\u00fas!\n\n \/\/Una familia unida,\n Una familia que ama,\n Una familia que clama,\n Una familia sin igual\/\/"},
{"id":382,"ti":"Que Se Abra El Cielo","tono":"C","estilo":"0","le":"Dios bienvenido a este lugar\n Y en nuestro coraz\u00f3n\n Ven y haz tu voluntad.\n Dios te queremos conocer\n Con tu fuego abrazador\n Ven y mu\u00e9vete otra vez.\n\n Esp\u00edritu, av\u00edvanos\n Te anhelamos Dios.\n\n Ante tu gloria y majestad\n Sabemos que est\u00e1s\n Para darnos libertad.\n Entr\u00f3nate en nuestra adoraci\u00f3n\n Asombroso eres Se\u00f1or\n Con tu presencia ll\u00e9nanos.\n\n \/\/\/Esp\u00edritu, av\u00edvanos\n Te anhelamos Dios\/\/\/\n\n \/\/Que se abra el cielo\n Mu\u00e9vete, Se\u00f1or\n Venga aqu\u00ed tu reino\n Oh gran Dios\/\/\n\n No hay cielo cerrado, se abre,\n Tu reino se mueve aqu\u00ed,\n En Ti est\u00e1 nuestra esperanza,\n Oh gran Dios, oh gran Dios."},
{"id":383,"ti":"\u00bfqu\u00e9 Ser\u00eda De M\u00ed?","tono":"C","estilo":"0","le":"Que ser\u00eda de m\u00ed si no me hubieras alcanzado,\n C\u00f3mo estar\u00eda hoy si no me hubieras perdonado,\n Tendr\u00eda un vac\u00edo en mi coraz\u00f3n,\n Vagar\u00eda sin rumbo y sin direcci\u00f3n\n \/\/Si no fuera por tu gracia y por tu amor\/\/\n\n Ser\u00eda como un p\u00e1jaro herido que se muere en el suelo,\n Ser\u00eda como un ciervo que brama por agua en un desierto.\n \/\/Si no fuera por tu gracia y por tu amor\/\/"},
{"id":384,"ti":"Que Tu Esp\u00edritu Descienda","tono":"C","estilo":"0","le":"I\n Transforma lo que soy,\n Desesperado estoy,\n Hambriento de tu amor.\n\n De Ti yo quiero m\u00e1s,\n Mi vida es un altar,\n Ven, toma tu lugar.\n\n Sopla con el viento\n De tu avivamiento,\n Satura todo este lugar.\n\n CORO\n \/\/Que tu Esp\u00edritu descienda,\n Aqu\u00ed, cuidamos tu presencia;\n El fuego de tu Esp\u00edritu\n No se apagar\u00e1\/\/\n\n \/\/\/\/No se apagar\u00e1\/\/\/\/\n\n PUENTE\n T\u00fa nos convocaste,\n T\u00fa nos reuniste,\n Danos de beber,\n Sacia nuestra sed."},
{"id":385,"ti":"\u00bfqui\u00e9n Como \u00c9l?","tono":"C","estilo":"0","le":"I\n \u00bfQui\u00e9n como \u00c9l?\n Nada iguala su gloria y su poder.\n Grande es su amor,\n Su majestad me consume\n Y me cautiva su voz.\n Cielo y tierra cantan:\n \u00abSanto es el Se\u00f1or\u00bb.\n Elevo mi alma en adoraci\u00f3n.\n\n CORO\n Su gloria llena el universo\n Y su mirada es como estruendo que hace temblar,\n Su voz es como dulce viento,\n Por su palabra todo acaba y vuelve a empezar."},
{"id":386,"ti":"\u00bfqui\u00e9n Es El Rey?","tono":"C","estilo":"0","le":"\/\/\u00bfQui\u00e9n es el Rey, qui\u00e9n es el Rey\n Qui\u00e9n es el Rey de Israel?\/\/\n\n Jehov\u00e1 el fuerte y poderoso,\n Jehov\u00e1 el fuerte en batalla,\n Jehov\u00e1 el fuerte y poderoso\n \/\/\/\u00c9l es el Rey\/\/\/de Israel."},
{"id":387,"ti":"\u00bfqui\u00e9n Ir\u00e1 A Laborar Los Campos?","tono":"C","estilo":"0","le":"I\n \u00bfQui\u00e9n ir\u00e1 a laborar los campos,\n Que el Maestro pronto volver\u00e1?\n \u00bfQui\u00e9n escuchar\u00e1 el llamamiento\n Y el mensaje m\u00edo predicar\u00e1?\n\n CORO\n Heme aqu\u00ed env\u00edame a m\u00ed,\n Dame todo tu poder,\n Llevar\u00e9 el fiel mensaje,\n Yo ir\u00e9, mi Se\u00f1or, yo ir\u00e9.\n\n II\n \u00a1Despertad! que ya la siega pasa\n Y con ella la oportunidad,\n Cosechemos las blancas gavillas,\n Que el Maestro fiel os premiar\u00e1.\n\n III\n Almas hay que van vagando\n En el mundo horrendo del pecar;\n \u00bfQui\u00e9n escuchar\u00e1 el cruel lamento\n Del que vive en la oscuridad?"},
{"id":388,"ti":"\u00bfqui\u00e9n Nos Podr\u00e1 Separar?","tono":"C","estilo":"0","le":"\/\/\u00bfQui\u00e9n nos podr\u00e1 separar del amor de Cristo?\n \u00bfqui\u00e9n nos podr\u00e1 separar del amor de Dios?\/\/\n\n Ni la vida, ni la muerte, ni lo alto,\n Ni lo profundo, ni \u00e1ngeles, ni potestades\n\n \/\/\/Nada nos podr\u00e1 separar\/\/\/ del amor de Dios."},
{"id":389,"ti":"\u00bfqui\u00e9n Como Jehov\u00e1?","tono":"C","estilo":"0","le":"\/\/Qui\u00e9n, qui\u00e9n, qui\u00e9n como Jehov\u00e1,\n Que con su poder el mar abri\u00f3\/\/\n\n Oir\u00e1n las naciones de sus dichos,\n Temblar\u00e1n cuando vean sus prodigios\n Y su pueblo alabar\u00e1 y con gozo cantar\u00e1\n Y dir\u00e1n, qui\u00e9n, qui\u00e9n, qui\u00e9n como Jehov\u00e1.\n\n \/\/Tu vienes contra m\u00ed con espada y jabalina\n Mas yo vengo contra ti en el nombre del Se\u00f1or\/\/\n\n Jehov\u00e1 pelear\u00e1 hoy a mi lado,\n \/\/yo te vencer\u00e9\/\/\n Jehov\u00e1 te entregar\u00e1 hoy en mis manos\n Y toda la tierra sabr\u00e1\n \/\/que de Dios\/\/ es el poder."},
{"id":390,"ti":"Quiero Amarte","tono":"C","estilo":"0","le":"Hay un anhelo que solo T\u00fa puedes llenar,\n Una tormenta que solo T\u00fa puedes calmar;\n Sediento estoy Se\u00f1or por conocerte m\u00e1s\n Y beber del r\u00edo que fluye ante Ti\n\n Quiero amarte, con el m\u00e1s profundo amor,\n Ac\u00e9rcate oh Cristo y abr\u00e1zame;\n Quiero amarte oh Dios, m\u00e1s profundamente oh Se\u00f1or,\n M\u00e1s de lo que antes te am\u00e9,\n Yo te quiero amar con el m\u00e1s profundo amor\n\n Cada ma\u00f1ana, oh Se\u00f1or, te buscar\u00e9,\n Y con tu Esp\u00edritu y tu gracia encontrar\u00e9;\n En Ti he encontrado esperanza eternal\n En tu presencia por siempre estar\u00e9."},
{"id":391,"ti":"Quiero Amarte Se\u00f1or","tono":"C","estilo":"0","le":"Si amarte significa, entregarme a Ti,\n Si amarte significa no volver atr\u00e1s,\n Si amarte es negarse a s\u00ed mismo,\n Si amarte es sentir tu excelsa paz.\n\n Quiero amarte Se\u00f1or\n Y sentir la paz excelsade tu amor,\n Quiero ser un instrumento,\n Que T\u00fa uses en tu gloria y honor,\n\n Que tu presencia me inunde,\n Que tu gloria me alumbre el coraz\u00f3n\n Y que nada se interponga,\n Ni estorbe esta bella relaci\u00f3n."},
{"id":392,"ti":"Quiero Andar Las Calles De Oro","tono":"C","estilo":"0","le":"\/\/Yo quiero andar las calles de oro con Jes\u00fas\/\/\n Yo \/\/\/quiero andar las calles de oro\/\/\/con Jes\u00fas\n\n Vencer\u00e9 porque \u00c9l est\u00e1 conmigo,\n Vencer\u00e9 porque conmigo est\u00e1\n \/\/vencer\u00e9\/\/ \/\/vencer\u00e1s\/\/\n Venceremos en el nombre de Jes\u00fas."},
{"id":393,"ti":"Quiero Cantar Una Linda Canci\u00f3n","tono":"C","estilo":"0","le":"Quiero cantar una linda canci\u00f3n\n De aquel que mi vida cambi\u00f3.\n Quiero cantar una linda canci\u00f3n\n De un hombre que me transform\u00f3.\n\n Es mi amigo Jes\u00fas, es mi amigo m\u00e1s fiel,\n \u00c9l es Dios, \u00c9l es Rey, es amor y verdad,\n S\u00f3lo en \u00c9l, encontr\u00e9, esa paz que busqu\u00e9,\n S\u00f3lo en \u00c9l, encontr\u00e9 la felicidad."},
{"id":394,"ti":"Quiero Escuchar Tu Dulce Voz","tono":"C","estilo":"0","le":"Quiero escuchar tu dulce voz\n Rompiendo el silencio en mi ser,\n S\u00e9 que me har\u00edas estremecer\n Me har\u00edas llorar o re\u00edr\n Y caer\u00eda rendido ante Ti\n\n Y no podr\u00eda estar ante Ti\n Escuch\u00e1ndote hablar sin llorar como ni\u00f1o\n Y pasar\u00eda el tiempo as\u00ed:\n Sin querer \/\/nada m\u00e1s\/\/\n Que escucharte hablar."},
{"id":395,"ti":"Quiero Levantar Mis Manos","tono":"C","estilo":"0","le":"Quiero levantar mis manos\n Quiero levantar mi voz\n Ofreciendo a Ti mi vida\n En Santidad y amor.\n\n Padre s\u00f3lo a Ti te ofrezco,\n Mi vida y mi coraz\u00f3n;\n Y me postro en tu presencia en adoraci\u00f3n.\n\n \/\/Se\u00f1or Jes\u00fas, recibe hoy;\n Toda la gloria, la honra y honor\/\/"},
{"id":396,"ti":"Rebosa Mi Coraz\u00f3n","tono":"C","estilo":"0","le":"Rebosa mi coraz\u00f3n con palabras de amor,\n Dirijo al Rey mi canci\u00f3n, postrado en adoraci\u00f3n\n Mi boca quiere expresar lo que hay en mi coraz\u00f3n\n Y no hay palabras Jes\u00fas para expresar mi atracci\u00f3n\n\n Sobre Ti, la gracia se derram\u00f3 sobre Ti,\n Eres el m\u00e1s hermoso, de los hijos de los hombres.\n Sobre Ti, la gracia se derram\u00f3 sobre Ti,\n Eres el m\u00e1s hermoso, eres el m\u00e1s deseado,\n Porque sobre Ti la gracia se derram\u00f3."},
{"id":397,"ti":"Rendido","tono":"C","estilo":"0","le":"I\n Yo quiero estar ante Ti, mi Se\u00f1or,\n Dispuestoa escucharte, sumiso a tu voz,\n A ir donde quieras, a hacer tu voluntad;\n Yo quiero ante Ti rendido estar.\n\n CORO\n Rendido, rendido estoy ante Ti,\n Yo quiero ponerme en tus manos, Se\u00f1or;\n Mis manos levanto en adoraci\u00f3n,\n Yo quiero rendirme en tus manos, Se\u00f1or.\n\n II\n Nada de m\u00ed yo te puedo ofrecer,\n Vengo ante Ti tal como soy;\n No encuentro palabras para expresar\n Lo que es sentirte cerca y tu voz escuchar."},
{"id":398,"ti":"Renu\u00e9vame","tono":"C","estilo":"0","le":"Renu\u00e9vame, se\u00f1or Jes\u00fas\n Ya no quiero ser igual.\n Renu\u00e9vame, se\u00f1or Jes\u00fas\n Pon en m\u00ed tu coraz\u00f3n.\n\n \/\/Porque todo lo que hay dentro de m\u00ed,\n Necesita ser cambiado Se\u00f1or...\n Porque todo lo que hay dentro de mi coraz\u00f3n\n Necesita m\u00e1s de Ti\/\/"},
{"id":399,"ti":"Resplandece","tono":"C","estilo":"0","le":"\/\/Resplandece pues ha venido tu luz\/\/\n\n \/\/la gloria de Jehov\u00e1 ha nacido,\n La gloria de Jehov\u00e1 est\u00e1 aqu\u00ed,\n La gloria de Jehov\u00e1 ha venido sobre ti\/\/"},
{"id":400,"ti":"Rindo Mi Coraz\u00f3n","tono":"C","estilo":"0","le":"\/\/Rindo mi coraz\u00f3n sobre tu altar Se\u00f1or,\n Rindo mi vida.\n Sin nada que ocultar, sin nada m\u00e1s que dar,\n Rindo mi vida\/\/\n\n Rasgo mi coraz\u00f3n y me acerco a tu presencia,\n Ruego por tu perd\u00f3n y tu amor.\n Vuelve tu rostro a m\u00ed\n Mu\u00e9strame sublime gracia\n \/\/Rindo hoy mi coraz\u00f3n\/\/"},
{"id":401,"ti":"Santifica Mi Alma","tono":"C","estilo":"0","le":"\/\/Santifica mi alma Se\u00f1or ahora,\n Con tu sangre l\u00e1vame se\u00f1or Jes\u00fas\/\/\n\n \/\/Yo quiero vencer dame tu poder,\n Con tu sangre l\u00e1vame Se\u00f1or Jes\u00fas\/\/"},
{"id":402,"ti":"Santo Dicen Los Serafines","tono":"C","estilo":"0","le":"\/\/\/Santo\/\/\/ dicen los serafines,\n \/\/\/santo\/\/\/ es el Se\u00f1or Jehov\u00e1,\n \/\/\/santo\/\/\/ es el que nos redime\n Y la tierra llena de su gloria est\u00e1.\n\n Cielo y tierra pasar\u00e1n,\n Mas su palabra no pasar\u00e1\n \/\/\/no\/\/\/ pasar\u00e1\n \/\/\/\/\/\/no\/\/\/\/\/\/ pasar\u00e1."},
{"id":403,"ti":"Santo Es El Se\u00f1or Dios Todopoderoso","tono":"C","estilo":"0","le":"\/\/\/Santo\/\/\/ Es el Se\u00f1or Dios Todopoderoso\n\/\/\/Digno\/\/\/ De recibir la gloria y el honor\n\n Cristo, Jesucristo, Dios de los elegidos y los fieles\n \/\/\/Justo\/\/\/ Fuente de agua viva y de amor;\n\n A todo el que venciere corona de oro fino yo le dar\u00e9,\n Le pondr\u00e9 un nombre nuevo\n Con vestiduras blancas le vestir\u00e9,\n Como yo he vencido conmigo en mi trono reinar\u00e1s."},
{"ti":"Santo Es El Seor Y Digno De Adoracin","le":"Santo es el Seor y digno de adoracin\n Mi corazn ofrezco a Ti\n \/\/\/Santo eres\/\/\/ T\n Santo eres T y digno de adoracin\n Mi corazn ofrezco a Ti\n \/\/\/Santo eres\/\/\/ T","name":"Corario IPUC castilla.js","id":"404","tono":"C","estilo":"0"},
{"ti":"santo santo T Eres","le":"\/\/Santo, santo T eres\/\/\n T que ests sentado en medio de querubines.\n\n Tu gloria llena la tierra,\n Tu gloria llena mi ser,\n Por eso canto aleluya\n A Ti santo de Israel.\n\n \/\/Tengo a Jesucristo dentro de mi ser\/\/\n \/\/Por eso confo en Cristo mi Rey\/\/\n\n Como ros de agua viva,\n Que salta de arriba, que llevo dentro\n Le alabo y le alabo en todo momento\n Con salterio y arpa y con instrumento.\n Por eso confo en Cristo mi Rey.","name":"Corario IPUC castilla.js","id":"405","tono":"C","estilo":"0"},
{"ti":"santo santo santo Mi Corazn Te Adora","le":"\/\/\/Santo\/\/\/\n Mi corazn te adora,\n Mi corazn te quiere decir:\n Santo eres T.","name":"Corario IPUC castilla.js","id":"406","tono":"C","estilo":"0"},
{"id":407,"ti":"Sat\u00farame Se\u00f1or Con Tu Esp\u00edritu","tono":"C","estilo":"0","le":"\/\/\/\/Sat\u00farame Se\u00f1or con tu Esp\u00edritu\/\/\/\/\n\n \/\/Y d\u00e9jame sentir el fuego de tu amor\n Aqu\u00ed en mi coraz\u00f3n Se\u00f1or\/\/"},
{"id":408,"ti":"Se Mueve La Mano De Dios","tono":"C","estilo":"0","le":"\/\/Se mueve la mano de Dios\n Y su palabra es vida\/\/\n\n \/\/\/Todo es posible si puedes creer\/\/\/\n \/\/Se mueve\/\/ Se mueve con poder."},
{"id":409,"ti":"Seguirte S\u00f3lo A Ti","tono":"C","estilo":"0","le":"\/\/\/Seguirte s\u00f3lo a Ti Se\u00f1or\/\/\/\n Y no mirar atr\u00e1s\n\n \/\/Seguir tu caminar Se\u00f1or,\n Seguir sin desmayar Se\u00f1or,\n Postrado ante tu altar Se\u00f1or,\n Y no mirar atr\u00e1s\/\/"},
{"id":410,"ti":"S\u00e9llame Se\u00f1or","tono":"C","estilo":"0","le":"S\u00e9llame, Se\u00f1or, con el sello de tu Nombre\n Y no me dejes fuera de tu reino\n\n Yo quiero morar contigo por toda la vida eterna\n S\u00e9llame, Se\u00f1or, con el sello de tu Nombre."},
{"id":411,"ti":"Sendas Dios Har\u00e1","tono":"C","estilo":"0","le":"Sendas Dios har\u00e1 donde piensas que no hay,\n \u00c9l obra en maneras que no podemos entender,\n \u00c9l me guiar\u00e1, a su lado estar\u00e9,\n Amor y fuerzas me dar\u00e1,\n Un camino har\u00e1 donde no lo hay.\n\n Si camino en la soledad me guiar\u00e1\n Y agua en el desierto encontrar\u00e9\n La tierra pasara su palabra eterna es,\n \u00c9l har\u00e1 algo nuevo hoy."},
{"id":412,"ti":"Sentado En Su Trono","tono":"C","estilo":"0","le":"I\n \/\/Sentado en su trono, rodeado de luz;\n Con su gran poder gobierna Jes\u00fas,\n Con ojos de fuego, con rostro de sol,\n Cuando abre su boca, es trueno su voz\/\/\n\n CORO\n Poderoso, en majestad y reino, Poderoso.\n Poderoso, en potestad e imperio, Poderoso.\n\n II\n Un gran arco iris corona su ser,\n \u00c9l es el cordero que pudo vencer.\n \u00c9l es el primero, \u00c9l es el postrer\n Y arrojan coronas delante de \u00c9l."},
{"id":413,"ti":"Se\u00f1or Estamos Ante Ti","tono":"C","estilo":"0","le":"\/\/Se\u00f1or estamos ante Ti\n Para ofrecerte toda la vida\/\/\n\n Vamos contigo proclamando victoria\n Queremos servirte y en tu palabra permanecer\n Vamos contigo proclamando victoria\n Y en nuestra vida lo m\u00e1s grande eres t\u00fa."},
{"id":414,"ti":"Si Alguien Me Pregunta","tono":"C","estilo":"0","le":"Si alguien me pregunta por qu\u00e9 estoy contento,\n Si alguien me pregunta por qu\u00e9canto as\u00ed;\n Es que Cristo me ha lavado con su sangre\n Y en una nube blanca volver\u00e1 por m\u00ed."},
{"id":415,"ti":"Si No Hubiera Sido Por El Se\u00f1or","tono":"C","estilo":"0","le":"\/\/Si no hubiera sido por el Se\u00f1or\/\/\n \/\/Mi alma se hubiera perdido,\n Si no hubiera sido por el Se\u00f1or\/\/"},
{"id":416,"ti":"Si Salvo Soy","tono":"C","estilo":"0","le":"Si Salvo soy debo decir,\n Las maravillas del Se\u00f1or:\n Que siendo yo un pecador,\n Yo fui a la cruz y vi a Jes\u00fas\n Y por la fe \u00c9l me salv\u00f3.\n\n Yo s\u00e9 que he sido salvo,\n No debo avergonzarme\n De confesar a Cristo como mi salvador\n Las grandes maravillas que obr\u00f3 mi Redentor:\n Que siendo yo un perdido \u00c9l me salv\u00f3. "},
{"id":417,"ti":"Si Quito La Mirada","tono":"C","estilo":"0","le":"\/\/Si quito la mirada del Se\u00f1or Jes\u00fas\n Mi alma se atribula y no puedo ver la luz\/\/\n\n \/\/Cristo es el camino, Cristo es la verdad,\n \u00c9l es la vida eterna y en \u00c9l puedo confiar\/\/"},
{"id":418,"ti":"Si Tratara","tono":"C","estilo":"0","le":"I\n Si tratara de contar tus bendiciones mi Dios,\n S\u00e9 que el n\u00famero ser\u00eda muy grande para m\u00ed\n Y si de alguna manera las pudiera contar\n Pasar\u00eda un mill\u00f3n de a\u00f1os as\u00ed.\n\n CORO\n Es m\u00e1s f\u00e1cil contar las estrellas mi Dios,\n los granos de arena del mar,\n cada gota de lluvia poderlas juntar,\n Que contar tus bendiciones en m\u00ed.\n\n II\n Yo no puedo explicar tu grandeza mi Dios\n Que se expresa en tu amor para m\u00ed,\n Cuando m\u00e1s te necesito all\u00ed est\u00e1s mi Dios,\n Derramando bendiciones en m\u00ed."},
{"id":419,"ti":"Sin Santidad","tono":"C","estilo":"0","le":"\/\/Sin santidad nadie ver\u00e1 al Se\u00f1or\/\/\n \/\/Pero yo s\u00e9\/\/\n \/\/Que le ver\u00e9\/\/\n Y con su esp\u00edritu me santificar\u00e9."},
{"id":420,"ti":"Sin Ti","tono":"C","estilo":"0","le":"Sin Ti nada somos en el mundo,\n Sin Ti nada podemos hacer,\n \/\/Ni las hojas de los \u00e1rboles se mueven,\n Si no es por tu poder\/\/"},
{"id":421,"ti":"Soberano Dios","tono":"C","estilo":"0","le":"Soberano Dios, Dios omnipotente,\n Rey de reyes, a Ti sea el honor,\n El imperio y la alabanza.\n\n Desde ahora y para siempre,\n Por los siglos de los siglos,\n Exaltado seas T\u00fa, coronado seas T\u00fa,\n \/\/\/Se\u00f1or Jes\u00fas\/\/\/"},
{"id":422,"ti":"Sobrenatural","tono":"C","estilo":"0","le":"Sobrenatural, eres Dios sin igual,\n Due\u00f1o del cielo y mar, sobrenatural.\n\n Sobrenatural, habitas la eternidad,\n Eres el manantial, sobrenatural.\n\n Dios, de mi vida eres Dios,\n De los cielos eres Dios,\n De los mares eres Dios, sobrenatural.\n\n De la tierra eres Dios,\n Mi sustento eres Dios,\n Siempre eterno eres Dios, sobrenatural."},
{"id":423,"ti":"Solamente En Cristo","tono":"C","estilo":"0","le":"Solamente en Cristo, solamente en \u00c9l,\n La salvaci\u00f3n se encuentra en \u00c9l.\n\n \/\/No hay otro Nombre dado a los hombres,\n Solamente en Cristo, solamente en \u00c9l\/\/"},
{"id":424,"ti":"S\u00f3lo Dios Hace Al Hombre Feliz","tono":"C","estilo":"0","le":"\/\/S\u00f3lo Dios hace al hombre feliz\/\/\n\n La vida es nada, todo se acaba,\n S\u00f3lo Dios hace al hombre feliz\n\n \/\/Si algunos no le siguen\n Por no llevar su cruz\n Yo sigo, yo sigo, yo sigo,\n A mi Jes\u00fas\/\/"},
{"id":425,"ti":"S\u00f3lo Para Ti Se\u00f1or","tono":"C","estilo":"0","le":"\/\/Ll\u00e9name\/\/ cada d\u00eda m\u00e1s de Ti Se\u00f1or\n \/\/Sat\u00farame\/\/ de tu presencia\n\n T\u00fa eres el aire que respiro,\n Mi manantial de vida,\n Sin Ti nada yo soy\n\n \u00a1Oh, oh, oh, oh, oh! ...\n\n Soy tierra que florece\n Si tu amor llueve sobre m\u00ed;\n Por m\u00e1s que el mundo ofrezca\n Nunca yo me alejar\u00e9 de Ti\n Yo vivo s\u00f3lo para Ti, Jes\u00fas,\n Yo vivo s\u00f3lo para Ti."},
{"id":426,"ti":"Somos De \u00c9l","tono":"C","estilo":"0","le":"\/\/Somos de \u00c9l\/\/\n Podemos decir que somos de \u00c9l\n\n \/\/Si es que vivimos o es que morimos\n Podemos decir que somos de \u00c9l\/\/\n\n \/\/Un grito de victoria se va a o\u00edr\/\/\n \u00bfD\u00f3nde est\u00e1 sepulcro tu victoria?\n \u00bfD\u00f3nde est\u00e1, oh muerte, tu aguij\u00f3n?"},
{"id":427,"ti":"Somos El Pueblo De Dios","tono":"C","estilo":"0","le":"Somos el pueblo de Dios\n Somos un pueblo especial\n Llamados para anunciar\n Las virtudes de aquel\n Que nos llam\u00f3 a su luz.\n\n Somos el pueblo de Dios\n Su sangre nos redimi\u00f3\n Y su Esp\u00edritu dio\n Para darnos poder\n Y ser testigos de \u00c9l.\n\n Y llevaremos su gloria\n A cada pueblo y naci\u00f3n\n Tray\u00e9ndoles esperanza\n Y nuevas de salvaci\u00f3n.\n\n Y su amor nos impulsa\n No nos podemos callar\n Anunciaremos al mundo\n De su amor y verdad."},
{"id":428,"ti":"Somos Evangelistas","tono":"C","estilo":"0","le":"Somos evangelistas\n \/\/Que caminamos\/\/\n Llevando su palabra\n \/\/Por donde andamos\/\/\n\n No vivo yo, mas Cristo vive en m\u00ed\n \/\/\/Para m\u00ed el vivir es \u00c9l\/\/\/\n Para m\u00ed el vivir es Cristo."},
{"id":429,"ti":"Somos M\u00e1s Que Vencedores","tono":"C","estilo":"0","le":"\/\/Somos m\u00e1s que vencedores,\n M\u00e1s que vencedores,\n Somos m\u00e1s que vencedores,\n En el nombre de Jes\u00fas\/\/\n\n \/\/Vamos a luchar en el nombre de Jes\u00fas\n Y a tus enemigos el Se\u00f1or derribar\u00e1\/\/"},
{"id":430,"ti":"Somos Pueblo","tono":"C","estilo":"0","le":"\/\/Somos pueblo, pueblo adquirido por Dios,\n Naci\u00f3n santa, real sacerdocio,\n Linaje escogido por Dios\/\/\n\n \/\/Para anunciar las virtudes de aquel\n Que nos llam\u00f3 de tinieblas a luz\/\/ admirable;\n Somos los hijos de luz."},
{"id":431,"ti":"Soy Feliz","tono":"C","estilo":"0","le":"\u00a1Soy feliz!, Cristo me salv\u00f3,\n \u00a1Soy feliz!, \u00c9l me transform\u00f3,\n \u00a1Soy feliz!, mis cargas \u00c9l llev\u00f3\n Gloria sea a su Nombre\n Cristo me salv\u00f3."},
{"id":432,"ti":"Soy Libertado Gloria A Dios","tono":"C","estilo":"0","le":"Soy libertado \u00a1Gloria a Dios!\n Por la palabra libre soy,\n Estuve atado por las enfermedades,\n Soy libertado \u00a1Gloria a Dios!\n\n Aqu\u00ed en esta tierra conoc\u00ed a Jes\u00fas,\n \u00c9l me dio la vida, \u00c9l me dio la luz,\n Por \u00e9l vivo y creo y a la gloria voy,\n Gloria, gloria a Cristo porque salvo soy."},
{"id":433,"ti":"Soy M\u00e1s Que Un Vencedor","tono":"C","estilo":"0","le":"Soy m\u00e1s que un vencedor\n Por medio de aquel que me am\u00f3\n Y yo nunca temer\u00e9 si a mi lado est\u00e1\n\n Y aunque venga el le\u00f3n\n Con todo su inmenso furor,\n Yo, yo, yo, soy m\u00e1s que un vencedor."},
{"id":434,"ti":"Soy Nueva Criatura","tono":"C","estilo":"0","le":"Soy nueva criatura, lo declara la escritura,\n \u00c9l me ha perdonado, con su sangre me ha lavado,\n Todos mis pecados por su sangre son borrados,\n Libre soy del pecado.\n Libre, del pecado y la maldad soy libre,\n \u00c9l ha roto mis cadenas, libre,\n Libre para dar mi vida al que me salv\u00f3."},
{"id":435,"ti":"Soy Salvo, \u00a1oh Aleluya!","tono":"C","estilo":"0","le":"Soy salvo, \u00a1oh aleluya!\n Soy salvo por el Se\u00f1or Jes\u00fas.\n Aunque el mundo me critique,\n No importa yo seguir\u00e9 a Jes\u00fas.\n\n Y sin temor yo le dir\u00e9 al pecador:\n Que soy salvo, Aleluya, \u00a1Gloria a Dios!\n\n \u00bfPor qu\u00e9 vives as\u00ed tan lejos de Dios,\n Habiendo para ti tan grande salvaci\u00f3n?\n Si dejas este mundo y vienes a la luz,\n Ser\u00e1s nueva criatura en el Se\u00f1or Jes\u00fas."},
{"id":436,"ti":"Soy Sano","tono":"C","estilo":"0","le":"\/\/T\u00fa victorioso Salvador,\n Digno de adoraci\u00f3n.\n Venciste a la muerte en la cruz,\n Por tus llagas sano soy\/\/\n\n Y no daremos gloria a nadie m\u00e1s.\n Jesucristo has venido a libertar.\n\n Soy sano, soy libre en Jes\u00fas.\n Fueall\u00e1en aquella cruz que \u00c9l venci\u00f3 la enfermedad.\n\n A \u00c9l sea la gloria y el poder,\n Me ha tocado con su mano,\n He recibido sanidad."},
{"id":437,"ti":"Su Gloria Cubri\u00f3 Los Cielos","tono":"C","estilo":"0","le":"\/\/Su gloria cubri\u00f3 los cielos\n Y la tierra se llen\u00f3 de su alabanza\/\/\n\n \/\/El resplandor fue como la luz,\n Rayos brillantes sal\u00edan de sus manos\/\/"},
{"id":438,"ti":"Su Nombre Es Jes\u00fas","tono":"C","estilo":"0","le":"Su nombre es Jes\u00fas, el nombre m\u00e1s lindo,\n Que llevo grabado en m\u00ed coraz\u00f3n,\n En cuanto a m\u00ed vivir, no puedo olvidar,\n Me dio salvaci\u00f3n."},
{"id":439,"ti":"Sum\u00e9rgeme","tono":"C","estilo":"0","le":"Cansado del camino sediento de Ti,\n Un desierto he cruzado,\n Sin fuerzas he quedado, vengo a Ti.\n\n Luch\u00e9 como soldado y a veces sufr\u00ed\n Y aunque la lucha he ganado\n Mi armadura he desgastado, vengo a Ti.\n\n Sum\u00e9rgeme en el r\u00edo de tu Esp\u00edritu\n Necesito refrescar este seco coraz\u00f3n\n Sediento de Ti."},
{"id":440,"ti":"Tal Como Soy","tono":"C","estilo":"0","le":"Tal como soy Se\u00f1or\n Sin nada que ofrecer m\u00e1s que mi canci\u00f3n,\n No tengo m\u00e1s que darte\n Pues todo es tuyo Se\u00f1or.\n\n Tal como soy Se\u00f1or,\n Sin nada que entregar m\u00e1s que el coraz\u00f3n,\n Me rindo todo a Ti,\n T\u00f3mame Se\u00f1or, tal como soy.\n\n Ac\u00e9ptame como ofrenda de amor,\n Como un sacrificio agradable en tu honor,\n Grato perfume yo quiero ser Se\u00f1or."},
{"id":441,"ti":"Te Alabar\u00e9","tono":"C","estilo":"0","le":"\/\/Te alabar\u00e9, te alabar\u00e9 con todo mi coraz\u00f3n,\n Delante de los dioses te cantar\u00e9\/\/\n\n \/\/El d\u00eda que te clam\u00e9 me respondiste Se\u00f1or\n Y me fortaleciste con vigor en mi alma\/\/"},
{"id":442,"ti":"Te Alabo Hoy","tono":"C","estilo":"0","le":"Te alabo hoy, Se\u00f1or, te alabo hoy,\n Te doy las gracias por la nueva vida en Ti,\n Porque has perdonado mis pecados\n Por la vida que me das\n \/\/\/Te alabo hoy\/\/"},
{"id":443,"ti":"Te Amo Jehov\u00e1","tono":"C","estilo":"0","le":"\/\/Te amo Jehov\u00e1, fortaleza m\u00eda,\n Roca m\u00eda, Castillo m\u00edo\/\/\n \/\/Mi libertador y Dios m\u00edo,\n Fortaleza m\u00eda, en Ti confiar\u00e9\/\/\n\n \/\/Eres T\u00fa mi escudo y la fuerza m\u00eda,\n Mi salvador, mi alto refugio\/\/\n \/\/Invoqu\u00e9 tu Nombre,\n T\u00fa eres digno de ser alabado\n Por la eternidad\/\/"},
{"id":444,"ti":"Te Doy Gloria","tono":"C","estilo":"0","le":"\u00a1Cu\u00e1n hermoso eres Jes\u00fas\n Son tus palabras, es tu amor.\n \u00a1Cu\u00e1n glorioso eres Jes\u00fas\n Es tu poder, es Jes\u00fas.\n\n El que me salv\u00f3, me rescat\u00f3\n Un momento all\u00ed nos dio libertad.\n\n CORO\n Te doy \/\/gloria\/\/\n Te doy \/\/gloria\/\/\n Te doy \/\/gloria\/\/\n A Ti Jes\u00fas."},
{"id":445,"ti":"Te Espero","tono":"C","estilo":"0","le":"\/\/Te espero, Se\u00f1or, te espero;\n Porque T\u00fa eres lo \u00fanico que tengo\/\/\n\n Cantando te alabar\u00e9, orando te esperar\u00e9\n Porque T\u00fa eres lo \u00fanico que tengo."},
{"id":446,"ti":"Te Exaltar\u00e9 Mi Dios","tono":"C","estilo":"0","le":"Te exaltar\u00e9 mi Dios, mi Rey\n Y bendecir\u00e9 tu nombre eternamente\n Y para siempre, cada d\u00eda te bendecir\u00e9.\n\n Y alabar\u00e9 tu nombre\n Eternamente y para siempre,\n\n Grande es Jehov\u00e1,\n Digno de suprema alabanza\n Y su grandeza inescrutable,\n Cada d\u00eda te bendecir\u00e9."},
{"id":447,"ti":"Te Necesito","tono":"C","estilo":"0","le":"Te necesito m\u00e1s que el d\u00eda de ayer,\n Te necesito m\u00e1s de lo que yo puedo expresar\n Te necesito Dios, pues s\u00f3lo T\u00fa eres mi Dios\n\n M\u00e1s que a mi respiraci\u00f3n,\n M\u00e1s que a mi canci\u00f3n, m\u00e1s que a\u00fan latir,\n M\u00e1s que a nadie y junto a Ti yo quiero estar\n Y poder disfrutar porque no quiero volver hacer lo que antes fui."},
{"id":448,"ti":"Te Pido La Paz","tono":"C","estilo":"0","le":"Ay\u00fadame a mirar con tus ojos,\n Yo quiero sentir con tu coraz\u00f3n,\n No quiero vivir m\u00e1s siendo insensible,\n Tanta necesidad \u00a1Oh Jesucristo!\n\n Te pido la paz para mi ciudad,\n Te pido perd\u00f3n por mi ciudad,\n Ahora me humillo y busco tu rostro\n \u00bfA qui\u00e9n ir\u00e9 Se\u00f1or sino a Ti?"},
{"id":449,"ti":"Te Vengo A Decir","tono":"C","estilo":"0","le":"I\n \/\/Te vengo a decir\/\/ Oh mi Salvador\n \/\/Que yo te amo a Ti\/\/ Con el coraz\u00f3n\n \/\/Te vengo a decir\/\/ toda la verdad\n Que te amo Se\u00f1or, te quiero Se\u00f1or,\n Con el coraz\u00f3n.\n\n CORO\n \/\/Yo quiero cantar\/\/ De gozo y de paz\n \/\/Yo quiero llorar\/\/ De felicidad\n \/\/Te vengo a decir\/\/ toda la verdad\n Que te amo Se\u00f1or, te quiero Se\u00f1or,\n Con el coraz\u00f3n.\n\n II\n \/\/Te quiero seguir\/\/ Oh mi Salvador\n \/\/Y darte mi ser\/\/ Mi amigo, mi Dios\n \/\/Te quiero servir\/\/ Mi Rey, mi Se\u00f1or\n Te vengo a poner todo lo que soy,\n Rec\u00edbelo, oh Dios.\n\n III\n \/\/Do quiera Se\u00f1or\/\/ Yo te seguir\u00e9\n \/\/Y hasta el final\/\/ Tu siervo ser\u00e9\n \/\/Env\u00edame Se\u00f1or\/\/ Do quiera yo ir\u00e9\n \/\/S\u00e9 que nada soy\/\/ pero fiel ser\u00e9."},
{"id":450,"ti":"Temprano Yo Te Buscar\u00e9","tono":"C","estilo":"0","le":"Temprano yo te buscar\u00e9,\n De madrugada yo me acercar\u00e9 a Ti,\n Mi alma te anhela y tiene sed\n Para ver tu gloria y tu poder.\n\n Mi socorro has sido T\u00fa,\n En la sombra de tus alas yo me gozar\u00e9,\n Mi alma est\u00e1 apegada a Ti,\n \/\/Porque tu diestra me ha sostenido\/\/"},
{"id":451,"ti":"Tenme Brillando","tono":"C","estilo":"0","le":"Tenme brillando, Se\u00f1or,\n Tenme brillando por Ti,\n Puro y limpio ser\u00e9, si T\u00fa brillas en m\u00ed;\n\n Tenme brillando, Se\u00f1or,\n Tenme brillando por Ti,\n Hasta que vengas pronto con poder.\n\n Oh ll\u00e9vame a la roca m\u00e1s alta, Se\u00f1or,\n Ll\u00e9vame Se\u00f1or, yo te seguir\u00e9;\n Oh ll\u00e9vame a la roca m\u00e1s alta, Se\u00f1or,\n Donde mi refugio tendr\u00e9."},
{"id":452,"ti":"Testifiquemos","tono":"C","estilo":"0","le":"Testifiquemos, que solo hay gozo,\n Que solo hay paz y salvaci\u00f3n en nuestras almas\n Y venceremos, al enemigo\n Cristo nos gu\u00eda con victoria en la batalla.\n\n \/\/Sonar\u00e1 la trompeta en Si\u00f3n,\n Sonar\u00e1, sonar\u00e1\/\/"},
{"id":453,"ti":"Todav\u00eda El Se\u00f1or Est\u00e1 Buscando Un Adorador","tono":"C","estilo":"0","le":"Todav\u00eda el Se\u00f1or est\u00e1 buscando\n \/\/Un adorador\/\/\n Que levante su voz y abra sus labios\n \/\/Y glorifique a Dios\/\/\n\n Que le alabe, que le adore,\n \/\/\/En esp\u00edritu y en verdad\/\/\/\n Que le alabe, que le adore,\n En esp\u00edritu y en verdad.\n El padre busca un adorador."},
{"id":454,"ti":"Todo Es De Mi Cristo","tono":"C","estilo":"0","le":"I\n \/\/Todo es de mi Cristo por \u00c9l y para \u00c9l\/\/\n\n CORO\n\/\/\/A \u00c9l sea la gloria\/\/\/ Por siempre am\u00e9n\n \/\/A \u00c9l sea la gloria\/\/\n A \u00c9l sea la \/\/gloria\/\/ Por siempre am\u00e9n\n\n II\n Oh profundas riquezas de la sabidur\u00eda de Dios,\n Insondables sus juicios y sus caminos son."},
{"id":455,"ti":"Todo Lo Puedo En Cristo","tono":"C","estilo":"0","le":"\/\/\/Todo lo puedo en Cristo\/\/\/\n Que me fortalece\n\n Yo soy un soldado del ej\u00e9rcito de Dios\n Voy feliz marchando siempre guiado por su voz \n\n \/\/Nada puede conmigo\/\/\n \/\/Jesucristo va adelante\/\/"},
{"id":456,"ti":"Todo Lo Que Respire","tono":"C","estilo":"0","le":"\/\/Todo lo que respire alabe a Jehov\u00e1\/\/\n\n \/\/Porque \u00c9l es Rey y Se\u00f1or de se\u00f1ores\/\/\n\n \/\/Due\u00f1o de los cielos, due\u00f1o de la tierra,\n Due\u00f1o de la mar y de mi alma\/\/"},
{"id":457,"ti":"Todo Se Lo Debo A \u00c9l","tono":"C","estilo":"0","le":"I\n Mi despertar y mi atardecer,\n Todo se lo debo a \u00c9l.\n Si en mi vivir no existiera \u00c9l\n No s\u00e9 qu\u00e9 ser\u00eda de m\u00ed,\n Porque todo se lo debo a \u00c9l.\n\n CORO\n \/\/Todo se lo debo a \u00c9l\/\/\n Mi vida y sustento,\n mi fuerza y esperanza.\n Todo se lo debo a \u00c9l.\n\n II\n Si en mi aliento \u00c9l no fuera el viento,\n \u00bfC\u00f3mo podr\u00eda vivir?\n Y si de mi coraz\u00f3n no fuera \u00c9l centro\n Habr\u00eda un vac\u00edo en m\u00ed.\n Y es que todo se lo debo a \u00c9l.\n\n CORO FINAL\n \/\/Todo se lo debo a \u00c9l\/\/\n Mi casa y mi familia\n Y todas mis canciones\n Todo se lo debo a \u00c9l."},
{"id":458,"ti":"Toma Por Favor","tono":"C","estilo":"0","le":"Toma por favor, mi mano Se\u00f1or\n Contigo quiero ir,\n Con sangre aqu\u00ed pagaste por m\u00ed\n Te quiero hoy servir.\n\n Anhelo poder lo malo vencer\n Y en santidad vivir,\n Toma por favor mi mano Se\u00f1or\n Contigo quiero ir."},
{"id":459,"ti":"Torre Fuerte","tono":"C","estilo":"0","le":"\/\/Torre fuerte es el nombre del Se\u00f1or\/\/\n\n \/\/A \u00c9l correr\u00e1 el justo y levantado ser\u00e1\/\/"},
{"id":460,"ti":"Traemos Hoy Ante Tu Altar","tono":"C","estilo":"0","le":"I\n Traemos hoy ante tu altar nuestras coronas,\n Queremos darte lo mejor de nuestras vidas,\n Te entregar\u00e9 mi amor entero,\n Los sue\u00f1os que logre alcanzar.\n\n CORO\n Te dar\u00e9 lo mejor de mi vida,\n Te dar\u00e9 lo mejor cada d\u00eda,\n Ser\u00e1 mucho m\u00e1s que una canci\u00f3n,\n Mi obediencia es mi mejor adoraci\u00f3n.\n\n II\n Traemos hoy ante tu altar nuestras coronas,\n Queremos darte lo mejor de nuestras vidas,\n Daremos solo las primicias,\n Pues T\u00fa mereces lo mejor."},
{"id":461,"ti":"Traemos Sacrificios De Alabanza","tono":"C","estilo":"0","le":"\/\/Traemos sacrificios de alabanza\n A la casa del Se\u00f1or\/\/\n\n Y traemos para Ti sacrificios de gratitud\n Y traemos para Ti sacrificios de amor."},
{"id":462,"ti":"Tu Amor Por M\u00ed","tono":"C","estilo":"0","le":"\/\/Tu amor por m\u00ed es m\u00e1s dulce que la miel\n Y tu misericordia es nueva cada d\u00eda\/\/\n\n \/\/Es por eso que te alabo,\n Es por eso que te sirvo,\n Es por eso que te doy, todo mi amor\/\/"},
{"id":463,"ti":"T\u00fa Est\u00e1s Aqu\u00ed","tono":"C","estilo":"0","le":"Aunque mis ojos no te pueden ver,\n Te puedo sentir, s\u00e9 que est\u00e1s aqu\u00ed.\n Aunque mis manos no pueden tocar tu rostro Se\u00f1or, s\u00e9 que est\u00e1s aqu\u00ed.\n\n Mi coraz\u00f3n puede sentir tu presencia\n \/\/T\u00fa est\u00e1s aqu\u00ed\/\/\n\n Puedo sentir tu majestad\n \/\/T\u00fa est\u00e1s aqu\u00ed\/\/\n\n Mi coraz\u00f3n puede mirar tu hermosura\n \/\/T\u00fa est\u00e1s aqu\u00ed\/\/\n\n Puedo sentir tu gran amor\n \/\/T\u00fa est\u00e1s aqu\u00ed\/\/"},
{"id":464,"ti":"T\u00fa Existes","tono":"C","estilo":"0","le":"I\n No importa que la ciencia hoy te niegue\n Y el intelecto humano te desprecie,\n T\u00fa existes no por dichos de la gente,\n T\u00fa existes porque eres omnipotente.\n Si aquel que cree ser sabio hoy te niega\n Y el fuerte en su poder te menosprecia,\n Bendito el ignorante que te acepta,\n Dichoso el d\u00e9bil que ansioso te espera.\n\n CORO\n T\u00fa existes, yo te siento\n Y aunque no te sintiera y aunque en Ti no creyera tu obra te manifiesta.\n Los cielos, la tierra, el mar y las estrellas,\n Los astros y a\u00fan las fieras una voz te confiesan.\n S\u00ed, Se\u00f1or T\u00fa existes, Se\u00f1or T\u00fa vives,\n Se\u00f1or, \u00bfc\u00f3mo podr\u00e9 negarte?\n\n II\n El mar y el firmamento no razonan\n Pues esta facultad la diste al hombre,\n Mas ellos cuentan de tu inmensa gloria\n Y son fiel evidencia de tus manos.\n Felices los mortales que en Ti creen,\n Que han hecho de Jehov\u00e1 su \u00fanico Dios,\n Ellos no morir\u00e1n eternamente\n Pasaron de esta vida a una perenne."},
{"id":465,"ti":"Tu Fidelidad","tono":"C","estilo":"0","le":"Tu fidelidad es grande,\n Tu fidelidad incomparable es,\n Nadie como T\u00fa, bendito Dios,\n Grande es tu fidelidad."},
{"id":466,"ti":"Tu Misericordia","tono":"C","estilo":"0","le":"Tu misericordia es m\u00e1s grande que los cielos,\n Tu misericordia es m\u00e1s grande que la tierra,\n Tu misericordia es m\u00e1s grande que el sol,\n La luna y las estrellas, tu misericordia Se\u00f1or\n\n Tu misericordia me hace feliz,\n Tu misericordia me ense\u00f1a a vivir,\n Tu misericordia me muestra el camino,\n Que Cristo trazo para m\u00ed."},
{"id":467,"ti":"Tu Nombre Levantar\u00e9","tono":"C","estilo":"0","le":"Tu nombre levantar\u00e9\n Me deleito en adorarte,\n Te agradezco que en mi vida est\u00e9s,\n Que vinieras a salvarme.\n\n \/\/Dejaste el trono para mostrarnos la luz\n De tu trono a la cruz y mi deuda pagar,\n De la cruz al morir, de la muerte a tu trono,\n Tu nombre yo levantar\u00e9\/\/"},
{"id":468,"ti":"Tu Nombre Oh Dios Exaltar\u00e9","tono":"C","estilo":"0","le":"\/\/Tu nombre oh Dios exaltar\u00e9,\n Tu majestad levantar\u00e9,\n Por siempre te proclamar\u00e9\n Tu alabanza celebrar\u00e9\/\/\n\n \/\/Porque digno, digno, eres T\u00fa\n A ti sea honor y poder,\n Porque digno, digno eres T\u00fa,\n Recibe adoraci\u00f3n\u2026 Se\u00f1or\/\/"},
{"id":469,"ti":"Tu Presencia Es El Cielo Para M\u00ed","tono":"C","estilo":"0","le":"\u00bfQui\u00e9n como T\u00fa en la tierra, 0h Se\u00f1or?\n Hermoso, inigualable es tu amor.\n Y nada en este mundo saciar\u00e1,\n Jes\u00fas Tu copa no se secar\u00e1.\n\n \/\/Tu presencia es el cielo, para m\u00ed\/\/\n\n Tesoro de mi alma y coraz\u00f3n,\n Me das tu gracia aunque d\u00e9bil soy.\n De mis errores eres redentor,\n De mi futuro eres el guardador.\n\n \/\/Tu presencia es el cielo, para m\u00ed\/\/\n\n \/\/Y cantamos oh Cristo, oh Cristo, ohhh\n Tu Presencia es el cielo, para m\u00ed\/\/\n\n Y mientras tenga vida esperar\u00e9,\n Cu\u00e1ndo cara a cara te ver\u00e9.\n Y nada en este mundo saciar\u00e1\n \/\/Jes\u00fas Tu copa no se secar\u00e1\/\/"},
{"id":470,"ti":"Tus Ojos","tono":"C","estilo":"0","le":"Tus ojos revelan que yo nada puedo esconder,\n Que no soy nada sin Ti, oh, buen Se\u00f1or.\n\n Todo lo sabes de m\u00ed cuando miras el coraz\u00f3n,\n Todo lo puedes ver muy dentro de m\u00ed.\n\n Lleva mi vida a una sola verdad\n Que cuando me miras nada puedo ocultar.\n\n \/\/S\u00e9 que es tu fidelidad\n Que lleva mi vida m\u00e1s all\u00e1\n De lo que puedo imaginar;\n S\u00e9 que no puedo negar\n Que tu mirada puesta en m\u00ed\n Me llena de tu paz\/\/"},
{"id":471,"ti":"Tu Y Yo","tono":"C","estilo":"0","le":"\/\/Dios est\u00e1 llamando a la guerra,\n Nos est\u00e1 impulsando hacia afuera;\n Acudiremos al llamado del Se\u00f1or,\n Tomaremos las armas que \u00c9l nos prepar\u00f3\/\/\n\n \/\/T\u00fa y yo somos su pueblo,\n T\u00fa y yo preparados\n Para mostrar las grandezas del Se\u00f1or,\n Para tomar la tierra que \u00c9l nos entreg\u00f3\/\/"},
{"id":472,"ti":"Tu Y Yo Somos Hermanos","tono":"C","estilo":"0","le":"T\u00fa y yo somos hermanos,\n T\u00fa y yo nos animamos,\n Sirviendo juntos, luchando en el reino de Dios.\n T\u00fa y yo de hombro a hombro\n Sirviendo unos a otros,\n Creciendo juntos, luchando en el reino de Dios\n Somos hermanos si unimos las manos\n Defendiendo la Fe y la verdad,\n Somos hermanos y nos respetamos,\n Actuando como hijos de Dios\n T\u00fa y yo somos guerreros\n T\u00fa y yo nos defendemos\n Marchando juntos, luchando en el reino de Dios.\n T\u00fa y yo de hombro a hombro\n Sirviendo unos a otros.\n Creciendo juntos luchando en el reino,\n Marchando juntosluchando en el reino,\n Sirviendo juntos luchando en el reino de Dios."},
{"id":473,"ti":"Tuya Es La Alabanza","tono":"C","estilo":"0","le":"\/\/Tuya es la alabanza en Sion oh Dios\n Tuya toda tuya es mi canci\u00f3n\/\/\n\n T\u00fa oyes la oraci\u00f3n de aquellos que te buscan\n Con tremendas cosas les responder\u00e1s.\n T\u00fa eres justicia\n \/\/Oh Dios de nuestra salvaci\u00f3n\/\/"},
{"id":474,"ti":"Tuya Es Mi Alabanza","tono":"C","estilo":"0","le":"Tuya es mi alabanza, tuya es mi canci\u00f3n,\n Recibe la ofrenda de un pueblo que te adora,\n Recibe la ofrenda de un pueblo con amor\n \/\/Rec\u00edbela Se\u00f1or porque s\u00f3lo tuya es la alabanza de un pueblo con amor\/\/"},
{"id":475,"ti":"Un Adorador","tono":"C","estilo":"0","le":"T\u00fa le diste al hombre un lenguaje muy bello,\n T\u00fa nos diste la m\u00fasica para alabarte,\n Estoy agradecido y quiero cantarte,\n Estoy agradecido y quiero adorarte.\n\n T\u00fa me hiciste con un prop\u00f3sito,\n En tus planes estaba que yo te adorara,\n Estoy agradecido y quiero cantarte,\n Estoy agradecido y quiero adorarte.\n\n \/\/Yo quiero ser un adorador\/\/\n Contemplar la hermosura de tu santidad,\n Adorarte en esp\u00edritu y en verdad\n Yo quiero ser Se\u00f1or...un adorador\n\n Mi gozo ser\u00e1 habitar en tu presencia,\n Mi gozo ser\u00e1 contemplar tu santidad,\n Con j\u00fabilo vendr\u00e9 a Ti y te cantar\u00e9,\n Con j\u00fabilo vendr\u00e9 a Ti y te adorar\u00e9."},
{"id":476,"ti":"Un Paso M\u00e1s De Fe","tono":"C","estilo":"0","le":"\/\/Un paso m\u00e1s, un paso m\u00e1s de fe\/\/\n \u00a1Adelante hermano!\n \u00a1Adelante hermana!\n Que all\u00e1 en el cielo nos espera un galard\u00f3n."},
{"id":477,"ti":"Un Toque De Tu Gloria","tono":"C","estilo":"0","le":"\/\/Dale un toque de tu gloria, Se\u00f1or,\n A esta reuni\u00f3n, a esta reuni\u00f3n\/\/ Am\u00e9n.\n\n Edif\u00edcame, santif\u00edcame\n Y ens\u00e9\u00f1ame, Se\u00f1or Jes\u00fas;\n Alim\u00e9ntame, fortal\u00e9ceme,\n Dame un toque de tu gloria, Se\u00f1or."},
{"id":478,"ti":"Una Generacion Apasionada","tono":"C","estilo":"0","le":"I\n \/\/\/\/Jehooo, Jehooo, Jehov\u00e1\/\/\/\/\n Hay una canci\u00f3n que se est\u00e1 escuchando\n Es el hambre por su amor.\n Hay un temblor que se est\u00e1 sintiendo\n El sonido de su voz.\n\n CORO\n Es una generaci\u00f3n apasionada,\n Es una generaci\u00f3n que est\u00e1 hambrienta,\n Son corazones que est\u00e1n desesperados,\n Por su palabra, por su presencia.\n Y queremos mirar su poder y majestad\n Y queremos o\u00edr el estruendo de su voz.\n\n II\n \/\/Jehooo, Jehooo, Jehov\u00e1\/\/\n Hay una corriente que no se puede parar\n Es el rio del Se\u00f1or.\n Hay una voz que no se puede callar\n De su amor quieren cantar.\n\n III\n \/\/\/\/Jehooo, Jehooo, Jehov\u00e1\/\/\/\/\n Y queremos mirar su poder y majestad\n Y queremos o\u00edr el estruendo de su voz.\n \/\/Lev\u00e1ntate, lev\u00e1ntate que el mundo sepa que eres Dios...\n Lev\u00e1ntate, lev\u00e1ntate de la creaci\u00f3n eres Se\u00f1or\/\/\n \/\/\/\/Jehooo, Jehooo, Jehov\u00e1\/\/\/\/"},
{"id":479,"ti":"Una Misi\u00f3n Que No Se Debilita. Coro Lema Damas Dorcas 2009.","tono":"C","estilo":"0","le":"I\n Comprometidas con la causa del Se\u00f1or,\n Revestidas de su gracia y de su amor,\n Trabajamos d\u00eda a d\u00eda por un pueblo que agoniza\n Y se pierde en la miseria y el dolor.\n\n Gu\u00edame, \u00fasame, como a las mujeres santas del ayer,\n Que llevaron de Jes\u00fas, su esp\u00edritu y la unci\u00f3n\n Impactando con poder nuestra naci\u00f3n.\n Gu\u00edame, \u00fasame, como a las mujeres santas del ayer,\n Que llevaron de Jes\u00fas, su esp\u00edritu y la unci\u00f3n\n Impactando con poder nuestra misi\u00f3n.\n CORO\n\n Una misi\u00f3n que no se debilita,\n Una visi\u00f3n que el fuego siempre aviva,\n Pues la obra del Se\u00f1or proclamamos sin cesar,\n Los hogares y los hombres salvar\u00e1n.\n\n Una misi\u00f3n que no se debilita,\n Y en Colombia esa llama sigue viva,\n Por la fe conquistaremos al perdido que dir\u00e1:\n \/\/Yo y mi a casa serviremos a Jehov\u00e1\/\/"},
{"id":480,"ti":"Una Zarza Que En El Monte","tono":"C","estilo":"0","le":"\/\/Una zarza que en el monte\n No dejaba de arder\/\/\n\n Esa zarza era la gloria,\n La presencia del Se\u00f1or\n \/\/Esa zarza quiero que arda\n Dentro de mi coraz\u00f3n\/\/\n\n \/\/\/\/Fuego\/\/\/\/ Que no se apaga\n \/\/\/\/Fuego\/\/\/\/ Celestial\n\n \/\/fuego que sacia el alma,\n Fuego que santifica,\n Fuego que purifica\n Dentro de mi coraz\u00f3n\/\/"},
{"id":481,"ti":"Unidos","tono":"C","estilo":"0","le":"Unidos, unidos, en su Nombre unidos\n \/\/En este mundo paz y amor tenemos\/\/\n\n Unidos, siempre unidos, tomados de las manos,\n Iremos por este mundo, cantando amor.\n La gloria de Jes\u00fas en ti resplandecer\u00e1\n Y todo se llenar\u00e1 de amor y de paz."},
{"id":482,"ti":"Unidos En Adoraci\u00f3n","tono":"C","estilo":"0","le":"Hoy nos hemos reunido en tu nombre, Jes\u00fas,\n Para darte adoraci\u00f3n de todo coraz\u00f3n;\n S\u00f3lo T\u00fa eres digno de la aclamaci\u00f3n,\n Eres santo, mi Se\u00f1or; honra y gloria te doy.\n\n Los redimidos te alabaremos con amor,\n Entonaremos una canci\u00f3n, unidos en adoraci\u00f3n,\n Elevaremos nuestra voz a Ti, mi Cristo;\n Toda la gloria tuya es; tuyo el imperio y el poder;\n Mi vida entera rendir\u00e9, s\u00f3lo a Ti."},
{"id":483,"ti":"Unos Brazos Humildes","tono":"C","estilo":"0","le":"Unos brazos humildes se abrieron\n En la tr\u00e1gica Cruz del Calvario,\n El dolor de los clavos sufrieron\n Y la cruz con su sangre ba\u00f1aron\n\n \/\/Para dar salvaci\u00f3n al mundo pecador\n Y librarnos del mal que vendr\u00e1\/\/"},
{"id":484,"ti":"Usa Mi Vida, Se\u00f1or","tono":"C","estilo":"0","le":"Usa mi vida, Se\u00f1or, usa mi vida,\n Yo quiero servirte con todas las fuerzas de mi coraz\u00f3n.\n Usa mi vida Se\u00f1or, usa mi vida\n Yo quiero amarte con todo el cari\u00f1o de mi coraz\u00f3n.\n\n Aunque indigno soy, aunque nada tengo\n Que pueda ofrecerte divino Se\u00f1or,\n Yo quiero servirte \/\/Con todas la fuerzas\/\/ \n De mi coraz\u00f3n.\n\n Aunque indigno soy, aunque nada tengo\n Que pueda ofrecerte divino Se\u00f1or\n Yo quiero amarte \/\/Con todo el cari\u00f1o\/\/\n De mi coraz\u00f3n."},
{"id":485,"ti":"\u00dasame","tono":"C","estilo":"0","le":"I\n Quiero, Se\u00f1or, que me uses\n Para hablar de tu amor,\n Decir que T\u00fa me has cambiado\n Que me has lavado, Se\u00f1or,\n Que estaba en el cieno inmundo\n Y all\u00ed tu mano baj\u00f3,\n Para sacarme del lodo\n Y darme tu gran amor.\n\n CORO\n \u00dasame cuando alguien necesite de Ti,\n \u00dasame cuando en pruebas el mundo est\u00e9,\n Que pueda yo anunciar que salvas T\u00fa\n Y que al mundo le das la paz que anhela tener;\n \u00dasame cuando alguien necesite de m\u00ed,\n \u00dasame, Oh Se\u00f1or.\n\n II\n Cuando me veas cansado,\n Casi para desmayar,\n Y veas mis fuerzas tan pocas,\n Que quiera volver atr\u00e1s,\n Exti\u00e9ndeme tu mano\n Y ll\u00e9name de valor,\n Para seguir anunciando\n Que T\u00fa eres el Salvador."},
{"id":486,"ti":"Vamos A Adorar Al Rey","tono":"C","estilo":"0","le":"\/\/\/Vamos a adorar al Rey\/\/\/\n Vamos todos a adorar al Rey\n\n \/\/Exaltar\u00e9 tu nombre oh Alt\u00edsimo\/\/\n \/\/En ese nombre hay poder\/\/\n \/\/Y ese nombre es Jes\u00fas\/\/\n \/\/\/\/\/\/\/\/Jes\u00fas\/\/\/\/\/\/\/\/\n\n \/\/Toda rodilla se doblar\u00e1\n Y toda lengua confesar\u00e1\/\/\n \/\/Que Jesucristo es el Se\u00f1or,\n que Jesucristo es el Salvador\/\/"},
{"id":487,"ti":"Vamos A Alabar A Jehov\u00e1","tono":"C","estilo":"0","le":"\/\/Vamos a alabar a Jehov\u00e1\n Con pandero y danza\/\/\n\n \/\/Lo que en la iglesia se canta\n En el cielo se oye\/\/\n\n \/\/As\u00ed, as\u00ed, as\u00ed se alaba a Dios\/\/\n\n \/\/\/Con mucha alegr\u00eda y gozo\/\/\/\n As\u00ed se alaba a Dios\n\n \/\/\/Con una sonrisa todos \/\/\/\n As\u00ed se alaba a Dios\n \/\/\/Alzando las manos todos\/\/\/\n As\u00ed se alaba a Dios\n\n \/\/\/Batiendo las manos todos\/\/\/\n As\u00ed se alaba a Dios."},
{"id":488,"ti":"Vamos A Pelear","tono":"C","estilo":"0","le":"\/\/Vamos a pelear contra las fuerzas del mal,\n Para liberar nuestra naci\u00f3n\/\/\n\n \/\/Iglesia de Jes\u00fas no esperes m\u00e1s,\n Toma tus armas ven a pelear\/\/\n\n Al enemigo hoy vencemos\n En el nombre de Jes\u00fas\n \/\/Somos el ej\u00e9rcito de Dios\n Nada nos podr\u00e1 detener\/\/\n\n \/\/Porque \u00c9l reina, \u00c9l reina, \u00c9l reina con poder\/\/"},
{"id":489,"ti":"Vamos A Romper","tono":"C","estilo":"0","le":"Vamos a romper las cadenas\n \/\/En el nombre\/\/ de Jes\u00fas\n\n Oh\u2026 Ven y lib\u00e9rate,\n Celebra victorioso las cadenas rotas son.\n\n Oh\u2026 ven y del\u00e9itate en Dios,\n Prorrumpe jubilosas alabanzas al Se\u00f1or."},
{"id":490,"ti":"Vamos Por Montes Y Collados","tono":"C","estilo":"0","le":"Vamos por montes y collados\n Llevando el evangelio que Cristo nos dej\u00f3.\n Vamos dici\u00e9ndole a las almas\n Que Cristo sana y salva,\n Que se arrepientan ya.\n\n Cristo te quiere sanar,\n Cristo te quiere salvar;\n Si te arrepientes y dejas este mundo\n Tan lleno de maldad.\n\n ******\n\n Vamos por calles y carreras\n Llevando el evangelio que Cristo nos dej\u00f3.\n Vamos dici\u00e9ndole a las almas\n Que Cristo sana y salva,\n Que se arrepientan ya.\n\n Cristo te quiere sanar,\n Cristo te quiere salvar;\n Si te arrepientes y dejas este mundo\n Tan lleno de maldad."},
{"ti":"ven ven ven Espritu Divino","le":"\/\/Ven, ven, ven, Espritu Divino,\n Ven, ven, ven apodrate de m\/\/\n\n \/\/Apodrate, apodrate,\n Apodrate de mi corazn\/\/\n\n \/\/Si T te apoderas de mi corazn,\n Con toda mi alma yo te alabar\/\/\n\n \/\/Apodrate, apodrate, Apodrate de mi corazn\/\/","name":"Corario IPUC castilla.js","id":"491","tono":"C","estilo":"0"},
{"id":492,"ti":"Ven Esp\u00edritu Santo","tono":"C","estilo":"0","le":"Estoy aqu\u00ed, desesperado por Ti,\n Con un coraz\u00f3n sediento, que espera beber de Ti.\n\n Cuando tu Gloria desciende a un lugar,\n Toda la tierra tiene que adorar,\n Resucitan los muertos, se sanan enfermos por tu poder.\n\n Queremos de Ti, ll\u00e9nanos de Ti,\n Esp\u00edritu Santo envu\u00e9lvenos en Ti,\n Derrama tu Gloria, esperamos por Ti\n\n Ven, ven, ven Esp\u00edritu Santo\n Ven, ven, ven Esp\u00edritu Santo\n Ven, ven, ven llena este lugar."},
{"id":493,"ti":"Ven Esp\u00edritu Ven","tono":"C","estilo":"0","le":"\/\/Ven Esp\u00edritu ven y ll\u00e9name Se\u00f1or\n De tu preciosa unci\u00f3n\/\/\n\n Purif\u00edcame, y l\u00e1vame, renu\u00e9vame,\n Rest\u00e1urame, Se\u00f1or, con tu poder.\n\n Purif\u00edcame, y l\u00e1vame, renu\u00e9vame,\n Rest\u00e1urame, Se\u00f1or, te quiero conocer."},
{"id":494,"ti":"Ven Te Invito A Cantar Al Se\u00f1or","tono":"C","estilo":"0","le":"\/\/Ven te invito a cantar al Se\u00f1or,\n Ven te invito te deleites en \u00c9l,\n Ven te invito a cantar al Se\u00f1or\n Con todo tu ser, con todo tu amor\/\/\n\n Suenen violines, toquen trompetas,\n Batid las manos, alabad a Dios,\n \/\/Hombres y mujeres, ni\u00f1os y ancianos,\n Sanos y enfermos alabad a Dios\/\/"},
{"id":495,"ti":"Ven Y Juntos Alabemos","tono":"C","estilo":"0","le":"\/\/Ven y Juntos alabemos,\n Vamos todos a cantar\/\/\n Levantemos nuestras manos ante \u00c9l,\n Adoremos a Jes\u00fas nuestro Rey,\n Ven, gocemos, cant\u00e9mosle a \u00c9l,\n Adoremos a Jes\u00fas nuestro Rey,\n \/\/\/Alabemos\/\/\/ al Rey."},
{"id":496,"ti":"Vengo Hoy","tono":"C","estilo":"0","le":"Vengo hoy a postrarme a tus pies mi Cristo,\n S\u00f3lo en Ti hay plenitud de amor;\n\n No hay nada, no hay nadie comparable a Ti,\n Me deleito ador\u00e1ndote, Se\u00f1or.\n\n No hay nada, no hay nadie comparable a Ti,\n \/\/\/Me deleito ador\u00e1ndote\/\/\/ Se\u00f1or."},
{"id":497,"ti":"Venid A M\u00ed Dice El Se\u00f1or","tono":"C","estilo":"0","le":"Venid a m\u00ed dice el Se\u00f1or a todo aquel,\n Que trabajado y cargado tenga sed,\n Escuchad la invitaci\u00f3n,\n Ofreciendo a todos Cristo salvaci\u00f3n.\n\n El cansancio de tu alma quitar\u00e1,\n Libertado del pecado quedar\u00e1s\n Y el esp\u00edritu de Dios, llenar\u00e1 tu coraz\u00f3n\n Y feliz anunciaras la salvaci\u00f3n."},
{"id":498,"ti":"Venid Todos Y Celebrad","tono":"C","estilo":"0","le":"\/\/Venid todos y celebrad,\n Venid todos y celebrad,\n Las maravillas de sus prodigios,\n \u00a1Pueblos todos aclamad!\/\/\n\n \/\/Porque grandes son sus obras,\n Su poder maravilloso,\n Cielos y tierra, su nombre glorificad\/\/"},
{"id":499,"ti":"Venimos Ante Ti Se\u00f1or","tono":"C","estilo":"0","le":"\/\/Venimos ante Ti, Se\u00f1or\n Con corazones sinceros\n Llenos de alabanza y de adoraci\u00f3n\/\/\n\n \/\/Porque T\u00fa eres Rey de reyes\n Y Se\u00f1or de se\u00f1ores\n S\u00f3lo T\u00fa eres digno\n De que todos te adoren\/\/"},
{"id":500,"ti":"Vestido De Ternura","tono":"C","estilo":"0","le":"Se rasgar\u00e1 el cielo y aparecer\u00e1\n \/\/Vestido de ternura, vestido de ternura,\n Jesucristo el \u00fanico Dios,\n Jesucristo el Salvador\/\/\n\n Y hay gozo hay fiesta en la iglesia esperando ver,\n \/\/que venga el rey\/\/\n Hay gozo hay fiesta en la iglesia esperando ver\n A Cristo nuestro Rey\n\n Y cantaremos y danzaremos\n Haremos fiesta para \u00c9l,\n Lleno de gloria todos veremos\n A Jesucristo nuestro Rey."},
{"id":501,"ti":"Vine A Adorar A Dios","tono":"C","estilo":"0","le":"\/\/Vine a adorar a Dios\/\/\n Vine a adorar su nombre,\n Vine a adorar a Dios.\n\n \u00c9l vino a mi vida un d\u00eda muy especial,\n Cambi\u00f3 mi coraz\u00f3n en nuevo coraz\u00f3n\n Y \u00e9sta es la raz\u00f3n por la que digo que:\n \u00abVine a adorar a Dios\u00bb"},
{"id":502,"ti":"Vine A Adorarte","tono":"C","estilo":"0","le":"I\n T\u00fa eres la luz que brill\u00f3 en las tinieblas,\n Abri\u00f3 mis ojos pude ver,\n Mi coraz\u00f3n adora tu hermosura,\n Esperanza de vida eres T\u00fa.\n\n CORO\n Vine a adorarte vine a postrarme,\n Vine a decir que eres mi Dios,\n S\u00f3lo T\u00fa eres grande, s\u00f3lo T\u00fa eres digno,\n Eres asombroso para m\u00ed.\n\n II\n T\u00fa eres el Rey grandemente exaltado\n Glorioso por siempre Se\u00f1or,\n Al mundo que creaste humilde viniste\n Y pobre te hiciste por amor.\n\n III\n Nunca sabr\u00e9 cu\u00e1nto cost\u00f3\n Ver mi maldad sobre esa cruz."},
{"id":503,"ti":"Y Me Ser\u00e9is Testigos","tono":"C","estilo":"0","le":"Y me ser\u00e9is testigos dijo Cristo,\n \/\/en las naciones\/\/\n Y en Colombia ya somos testigos\n Del evangelio y su poder.\n\n Bolivia, Per\u00fa, Argentina y Brasil,\n Ser\u00e1n como nosotros testigos del poder\n\n \/\/\/\/Poder\/\/\/\/ para vencer.\n Con el poder del cielo que Cristo nos dar\u00e1."},
{"id":504,"ti":"Ya Viene Cristo","tono":"C","estilo":"0","le":"Ya viene Cristo se\u00f1ales hay\n Almas salvadas viene a llevar,\n Los que durmieren se quedar\u00e1n\n Los que velaren con \u00c9l se ir\u00e1n\n\n \/\/\/\/Me voy con \u00c9l\/\/\/\/\n Yo no me quedo, con \u00c9l me voy"},
{"id":505,"ti":"Yo Celebrar\u00e9","tono":"C","estilo":"0","le":"\/\/Yo celebrar\u00e9, cantar\u00e9 a \u00c9l,\n Cantar\u00e9 un nuevo canto\/\/\n\n \/\/Alabar\u00e9 a Jehov\u00e1,\n Porque ha vencido con poder\/\/"},
{"id":506,"ti":"Yo Dependo De Ti","tono":"C","estilo":"0","le":"I\n Hoy el sol no est\u00e1 brillando,\n Veo nubes al venir\n Y s\u00e9 que pronto viene la tormenta,\n Pero he hallado un lugar\n Donde he encontrado seguridad,\n En la palma de tu mano descansar\u00e9.\n\n CORO\n \/\/Yo dependo de Ti\/\/\n Nadie me ha amado tanto como me amas T\u00fa\n \/\/yo dependo de Ti\/\/\n \/\/\/yo dependo que tu amor\/\/\/\n Me ha de ayudar.\n\n II\n Pruebas vienen a mi vida\n Que no puedo entender\n Y no s\u00e9 por cu\u00e1l camino debo andar,\n Pero conf\u00edo en la sangre\n Que derramaste all\u00e1 en la cruz,\n Yo dependo que tu amor me ha de ayudar."},
{"id":507,"ti":"Yo He Cre\u00eddo En Un Poder Que No Se Toca","tono":"C","estilo":"0","le":"Yo he cre\u00eddo en un poder que no se toca,\n Yo he cre\u00eddo en un poder que no se ve\n \/\/Yo he cre\u00eddo en un poder que no se toca,\n Ni se ve, pero se siente en el coraz\u00f3n\/\/\n\n \/\/Mueve tu mano Se\u00f1or\/\/\n \/\/Que tu Esp\u00edritu nos llene,\n La iglesia se renueve,\n Mueve tu mano Se\u00f1or\/\/"},
{"id":508,"ti":"Yo Le Alabo De Coraz\u00f3n","tono":"C","estilo":"0","le":"\/\/Yo le alabo de coraz\u00f3n,\n Yo le alabo con mi voz\/\/\n\n Y si me falta la voz,\n Yo le alabo con las manos;\n Y si me faltan las manos,\n Yo le alabo con los pies;\n Y si me faltan los pies,\n Yo le alabo con el alma;\n Y si me falta el alma,\n Es porque me fui con \u00c9l."},
{"id":509,"ti":"Yo Me Alegr\u00e9","tono":"C","estilo":"0","le":"\/\/Yo me alegr\u00e9 con los que me dec\u00edan\n A la casa de Jehov\u00e1 iremos\/\/\n\n \/\/Iremos, iremos\n A la casa de Jehov\u00e1 iremos\/\/"},
{"id":510,"ti":"Yo Me Gozo","tono":"C","estilo":"0","le":"Yo me gozo lunes,\n Yo me gozo martes,\n Yo me gozo mi\u00e9rcoles,\n Yo me gozo jueves,\n Yo me gozo viernes,\n S\u00e1bado tambi\u00e9n\n Y al llegar domingo,\n Sigo con el gozo\n Y te dir\u00e9 porqu\u00e9,\n Porque tengo a Cristo,\n Que me da la dicha de gozarme en \u00c9l.\n\n Mi Cristo vivo puede m\u00e1s que el diablo,\n Puede m\u00e1s que todos, si te sientes triste,\n Si te sientes solo, ven a Jesucristo y \u00c9l te har\u00e1 feliz."},
{"id":511,"ti":"Yo Navegar\u00e9","tono":"C","estilo":"0","le":"\/\/Yo navegar\u00e9 en el oc\u00e9ano de tu esp\u00edritu\n Y all\u00ed adorar\u00e9 al Dios de mi amor\/\/\n\n \/\/Esp\u00edritu\/\/desciende con tu fuego\n Como en pentecost\u00e9s y ll\u00e9name de gozo.\n\n \/\/Esp\u00edritu\/\/ yo quiero hablar en lenguas,\n Sentir tu presencia, llenarme de tu unci\u00f3n."},
{"id":512,"ti":"Yo No S\u00e9 A Lo Que T\u00fa Has Venido","tono":"C","estilo":"0","le":"\/\/Yo no s\u00e9 a lo que t\u00fa has venido,\n Pero yo vine a adorar a Dios\/\/\n\/\/Yo vine, yo vine,\n Yo vine aadorar a Dios\/\/\n\n \/\/Este gozo que yo siento en mi alma\n S\u00f3lo Cristo me lo pudo dar\/\/\n \/\/S\u00f3lo Cristo me lo pudo dar\/\/\n Este gozo que yo siento en mi alma\n S\u00f3lo Cristo me lo pudo dar.\n\n \/\/Pero que felicidad\/\/\n Cantando todos en coro\n A nuestro Padre celestial."},
{"id":513,"ti":"Yo Quiero M\u00e1s De Cristo","tono":"C","estilo":"0","le":"Yo quiero m\u00e1s y m\u00e1s de Cristo,\n Yo quiero m\u00e1s de su poder\n Yo quiero m\u00e1s de su presencia,\n Yo quiero m\u00e1s y m\u00e1s de \u00c9l.\n\n \u00c9l quiere m\u00e1s de mi alabanza,\n \u00c9l quiere m\u00e1s mi adoraci\u00f3n,\n \u00c9l quiere que yo le consagre,\n Todo mi ser, mi coraz\u00f3n."},
{"id":514,"ti":"Yo Quiero M\u00e1s De Ti","tono":"C","estilo":"0","le":"\/\/Yo quiero m\u00e1s de Ti,\n Habitar en tu presencia,\n Menguar para que crezcas T\u00fa\n Y cada d\u00eda ser\u00e9 m\u00e1s como T\u00fa\/\/\n\n Quebranta mi coraz\u00f3n, quebranta mi vida,\n Te entrego mi voluntad a Ti,\n Todo lo que soy Se\u00f1or,\n Todo cuanto tengo es tuyo,\n Yo quiero menguar para que crezcas T\u00fa."},
{"id":515,"ti":"Yo Quiero Ver Tu Gloria","tono":"C","estilo":"0","le":"Yo quiero ver tu gloria,\n M\u00e1s de tu presencia.\n Me rindo a tus pies en adoraci\u00f3n,\n Manifi\u00e9state\n\n S\u00e9 que est\u00e1s aqu\u00ed\n Respiro hoy tu paz\n Mi alma gime, abrazame,\n H\u00e1blame Se\u00f1or, toma el control.\n\n \/\/Gloria, yo quiero ver tu gloria\n Santo Esp\u00edritu de Dios\n Ven aqu\u00ed, dispuesto estoy,\n Ven y ll\u00e9name, derrama de tu unci\u00f3n\/\/"},
{"id":516,"ti":"Yo S\u00e9 Que Cristo","tono":"C","estilo":"0","le":"\/\/Yo s\u00e9 que Cristo siempre me ayudar\u00e1\/\/\n\n Si consagro todo a \u00c9l y si soy su siervo fiel;\n Yo s\u00e9 que Cristo siempre me ayudar\u00e1."},
{"id":517,"ti":"Yo S\u00e9 Que Est\u00e1s Aqu\u00ed","tono":"C","estilo":"0","le":"\/\/Yo s\u00e9 que est\u00e1s aqu\u00ed, Se\u00f1or,\n Yo s\u00e9 que est\u00e1s aqu\u00ed\/\/\n\n \/\/\/Mi alma te alaba\/\/\/\n Porque s\u00e9 que est\u00e1s aqu\u00ed."},
{"id":518,"ti":"Yo Sembr\u00e9","tono":"C","estilo":"0","le":"\/\/Yo sembr\u00e9, Apolo reg\u00f3\n Pero el crecimiento lo da Dios\/\/\n\n Siembra la semilla d\u00e9jala crecer,\n Cuando Cristo venga, \u00c9l nos pagar\u00e1."},
{"id":519,"ti":"Yo S\u00ed S\u00e9 Que Pas\u00f3 En Pentecost\u00e9s","tono":"C","estilo":"0","le":"\/\/Yo s\u00ed s\u00e9\/\/ que pas\u00f3 en pentecost\u00e9s,\n \/\/el Esp\u00edritu de Dios se derram\u00f3 con poder\/\/\n\n \/\/D\u00e9jalo que se mueva en tu coraz\u00f3n\/\/\n \/\/En tu coraz\u00f3n d\u00e9jalo que se mueva\/\/"},
{"id":520,"ti":"Yo Siento En M\u00ed","tono":"C","estilo":"0","le":"Yo siento en m\u00ed, el Cristo de poder;\n Yo siento en m\u00ed, el Esp\u00edritu santo;\n Yo siento aqu\u00ed, los \u00c1ngeles del cielo\n Que acampan a mi lado y me ayudan a vencer."},
{"id":521,"ti":"Yo Siento Gozo En Mi Alma","tono":"C","estilo":"0","le":"Yo siento \/\/\/Gozo en mi alma\/\/\/\n Y en mi ser\n Aleluya gloria a Dios,\n Son como\/\/\/R\u00edos de agua viva\/\/\/\n En mi ser\n\n \/\/Vamos cantando hasta que baje el poder\/\/\n Oh gloria a Dios, oh gloria a \u00c9l,\n Vamos cantando hasta que baje el poder."},
{"id":522,"ti":"Yo Siento Paz Y Gozo","tono":"C","estilo":"0","le":"\/\/Yo siento paz y gozo en mi coraz\u00f3n,\n Porque Jesucristo a m\u00ed me libert\u00f3\/\/\n\n \/\/Me libert\u00f3, me libert\u00f3\n De las cadenas me libert\u00f3\/\/"},
{"id":523,"ti":"Yo Soy Misionero","tono":"C","estilo":"0","le":"\/\/\/Yo soy misionero\/\/\/ Del Rey;\n Las almas perdidas, las almas amadas,\n Yo quiero traerlas a \u00c9l.\n\n Junto a \u00c9l caminar\u00e9 y con \u00c9l yo estar\u00e9\n En los brazos de mi Salvador."},
{"id":524,"ti":"Yo Soy Testigo","tono":"C","estilo":"0","le":"Yo soy testigo del poder de Dios,\n Grandes maravillas \u00c9l ha hecho en m\u00ed,\n Yo era ciego y ahora veo la luz,\n La luz divina que me dio Jes\u00fas.\n\n Nunca, nunca, Cristo me ha dejado,\n Nunca, nunca, me ha desamparado,\n En la noche oscura o en el d\u00eda de prueba,\n Jesucristo nunca me desamparar\u00e1."},
{"id":525,"ti":"Yo Te Busco","tono":"C","estilo":"0","le":"\/\/Yo te busco\/\/\n Con fuego en mi coraz\u00f3n\n \/\/Yo te busco\/\/\n Recibe mi adoraci\u00f3n.\n\n \/\/Te anhelo, te necesito,\n Te amo m\u00e1s que a mi ser\/\/\n M\u00e1s que a mi ser."},
{"id":526,"ti":"Yo Tengo El Cristo Vivo","tono":"C","estilo":"0","le":"Yo tengo el Cristo Vivo\n Y su Nombre es Jes\u00fas\n \/\/\u00c9l me am\u00f3 y me salv\u00f3\n Y con su Santo Esp\u00edritu mi alma \u00c9l llen\u00f3\/\/\n\n \u00a1Qu\u00e9 bueno es tener el Cristo de Poder!\n \/\/\u00a1Qu\u00e9 bueno es amarle, tambi\u00e9n glorificarle!\n \u00a1Qu\u00e9 bueno es tener el Cristo de poder!\/\/"},
{"id":527,"ti":"Yo Tengo Un Abogado","tono":"C","estilo":"0","le":"Yo tengo un abogado que me defiende,\n \u00c9l siempre est\u00e1 ocupado, pero me atiende,\n \u00c9l nunca pierde un pleito, todos los gana.\n \/\/Si a alguno le interesa saber su nombre:\n Jes\u00fas se llama\/\/"},
{"id":528,"ti":"Yo Tengo Un Amigo Que Me Ama","tono":"C","estilo":"0","le":"Yo tengo un amigo que \/\/\/me ama\/\/\/\n Yo tengo un amigo que me ama,\n Su nombre es Jes\u00fas.\n\n \/\/\/Que me ama\/\/\/ con su tierno amor.\n \/\/Que me ama\/\/ su nombre es Jes\u00fas.\n\n T\u00fa tienes un amigo que \/\/\/te ama\/\/\/\n T\u00fa tienes un amigo que te ama\n Su nombre es Jes\u00fas.\n\n \/\/\/Que te ama\/\/\/ con su tierno amor.\n \/\/Que te ama\/\/ su nombre es Jes\u00fas.\n\n Tenemos un amigo que \/\/\/nos ama\/\/\/\n Tenemos un amigo que nos ama\n Su nombre es Jes\u00fas.\n\n \/\/\/Que nos ama\/\/\/ con su tierno amor.\n \/\/Que nos ama\/\/ su nombre es Jes\u00fas."},
{"id":529,"ti":"Yo Tengo Un Dios","tono":"C","estilo":"0","le":"Yo tengo un Dios que con sus \u00e1ngeles cuida de m\u00ed,\n Yo tengo un Dios que da victoria en toda situaci\u00f3n,\n Yo tengo un Dios cuando enfermo o cuando ando bien,\n \/\/Yo tengo un Dios\/\/que no me ha de fallar,\n Yo tengo un Dios.\n\n Ha regresado al cielo a preparar alg\u00fan lugar,\n Cuando todos adoremos en aquel lugar\n Dentro del alma, en todo hombre a cualquier edad,\n Ser\u00e1 la luz en las tinieblas que brilla en ti,\n Yo tengo un Dios.\n\n Te sientes solo, abatido o en necesidad,\n Mira hacia arriba olvida todo y podr\u00e1s notar,\n Al Padre con sus \u00e1ngeles mirando hacia ti,\n \/\/Yo tengo un Dios\/\/que no me ha de fallar,\n Yo tengo un Dios."},
{"id":530,"ti":"Yo Tengo Un Dios Muy Grande","tono":"C","estilo":"0","le":"\/\/Yo tengo un Diosmuy, muy, muy grande\n Maravilloso es \u00c9l, siempre amoroso,\n Siempre victorioso, maravilloso es \u00c9l\/\/\n\n \/\/Maravilloso, maravilloso,\n Maravilloso es \u00c9l\/\/\n\n Cuando en pruebas y en luchas\n Siempre con nosotros est\u00e1,\n Nos levanta cuando caemos\n Y con sus brazos nos sostendr\u00e1."},
{"id":531,"ti":"Yo Vengo A Tu Presencia","tono":"C","estilo":"0","le":"\/\/Yo vengo a tu presencia dando gloria al Se\u00f1or,\n Gloria al Se\u00f1or, gloria al Se\u00f1or\/\/\n \/\/\/Ha hecho grandes cosas\/\/\/\n Alabad a Dios.\n\n El cielo me habla de Ti, Se\u00f1or,\n La luna y el sol tambi\u00e9n,\n El universo entero me hablan de tu poder inmensurable, eterno\n \/\/Que nunca morir\u00e1\/\/"},
{"id":532,"ti":"Yo Vine A Adorar A Dios","tono":"C","estilo":"0","le":"\/\/Yo vine a adorar a Dios\n Con todo mi Coraz\u00f3n\/\/\n\n \/\/Porque siento su presencia en m\u00ed,\n Su presencia en m\u00ed y su grande amor\/\/\n\n \/\/Entr\u00e9gale tu coraz\u00f3n a Cristo mi Salvador\/\/\n \/\/Y sentir\u00e1s su presencia en ti,\n Su presencia en ti y su grande amor\/\/"},
{"id":533,"ti":"Yo Vivo Se\u00f1or Porque T\u00fa Vives","tono":"C","estilo":"0","le":"Yo vivo, Se\u00f1or, porque T\u00fa vives,\n Porque T\u00fa vives, Se\u00f1or, es que yo vivo\n Me das consuelo, me das abrigo\n Y en la aflicci\u00f3n, mi Se\u00f1or est\u00e1s conmigo.\n\n Soy salvo, Se\u00f1or, pues me salvaste,\n Pues me salvaste, Se\u00f1or eternamente\n Yo voy al cielo, voy a la gloria,\n Porque Se\u00f1or, T\u00fa me diste la victoria."},
{"id":534,"ti":"Yo Voy A Ver A Mi Se\u00f1or Hermoso","tono":"C","estilo":"0","le":"Yo voy a ver a mi Se\u00f1or hermoso,\n Y siento gozo en mi coraz\u00f3n.\n\n \/\/El lleva mi alma con su poder glorioso\n A vivir en la c\u00e9lica mansi\u00f3n\/\/\n\n \/\/\/Que gloria siento en mi\/\/\/\n Aleluya Se\u00f1or la gloria que Mois\u00e9s sinti\u00f3 en el Sina\u00ed\n \/\/Aleluya\/\/ \u00a1Qu\u00e9 gloria siento en m\u00ed!\n\n \/\/Mi alma volar\u00e1, mi alma volar\u00e1,\n Al son de la trompeta mi alma volar\u00e1\/\/"},
]